INSERT INTO `al_email_templates` (`id`, `title`, `template_content`, `status`, `created_at`, `updated_at`, `archived_at`) VALUES
(1, 'Reset your password', '<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 5px 20px; font: normal 13px/18px Arial, Helvetica, sans-serif; color: #666;\" align=\"left\" valign=\"top\">\r\n<h4>Hello ###USER###,</h4>\r\n<p>Your account username is : ###USERNAME###</p>\r\n<p>As requested, here is the link to reset your password. If you didn\'t make this request then ignore the email. <br />If you did make the request, then <a href=\"###RESETLINK###\">click here</a> to reset your password.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', 1, '2016-07-20 12:55:56', '2016-08-12 12:57:45', '0000-00-00 00:00:00'),
(2, 'Default Registration Complete', '<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 5px 20px; font: normal 13px/18px Arial, Helvetica, sans-serif; color: #666;\" align=\"left\" valign=\"top\">\r\n<h4>Hello ###USER###,</h4>\r\n<p>Your account username is : ###USERNAME###</p>\r\n<p>You have succesfully registered at Apostolic Toolbox, here is the link to set your password. If you didn\'t make this request then ignore the email. <br />If you did make the request, then <a href=\"###SETLINK###\">click here</a> to set your password.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', 1, '2016-08-12 13:04:19', '2016-11-03 11:26:03', '0000-00-00 00:00:00'),
(3, 'Invite Friend', '<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 5px 20px; font: normal 13px/18px Arial, Helvetica, sans-serif; color: #666;\" align=\"left\" valign=\"top\">\r\n<h4>Dear Friend,</h4>\r\n<p>Your friend ###USERNAME### wants to know you about <a href=\"###SITELINK###\"> this </a> website.</p>\r\n<p>Here is ###USERNAME###\'s comment:<br /> ###COMMENT###</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', 1, '2016-08-17 18:41:55', '2016-08-17 18:41:55', '0000-00-00 00:00:00'),
