(378, 'Confidentiality', 'Confidentiality', 'A church office is full of sensitive documents: personnel files, counseling files, pledge cards, financial giving records, pastoral correspondence. How would you advise churches to keep those documents safe?', '1325788762Confidentiality.doc', 'http://apostolictoolbox.s3.amazonaws.com/pastortim/Confidentiality-1325788762Confidentiality.doc', '256000', 3, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-01-05 10:39:22', '2012-01-12 22:17:39'),
(861, 'The Arrows of The Deliverance', 'The Arrows of The Deliverance', 'This series of lessons that am beginning tonight was actually birthed in prayer and was confirmed to me in a very sovereign way in January of 2010 in preparation for a trip to Singapore, Ukraine and Russia. \r\n\r\nIt was a direct answer to a prayer I began praying many years ago in my own personal quest and hunger to truly be apostolic and everything that means. My passion has never changed or diminished. For that I am thankful. I told our church in Canton if they ever see that Iâ€™ve lost my passion, Iâ€™m backslid.\r\n\r\nI feel like the Lord talked to me and gave me very clear direction for this series with a very specific target we are to aim at. So with everything that in us, I want to do our bestâ€¦ \r\n', '13289773370- The Arrow of The Lords Deliverance.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Arrows-of-The-Deliverance-13289773370--The-Arrow-of-The-Lords-Deliverance.doc', '84480', 0, 1, 'doc', 31, 1, NULL, NULL, 1, 1, '2012-02-11 08:22:17', '2012-02-14 08:52:24'),
(13, 'Accountability', 'Accountability', 'THE PURPOSE OF THIS ACCOUNTABILITY BUDDY COVENANT IS TO ESTABLISH A CONSISTENT DEVOTION TO GOD.\r\n\r\nTHE STRATEGY: DEVELOPING DISCIPLINES THAT WILL MAKE US FOCUS ON GOD.\r\n\r\nACCOUNTABILITY BUDDY IS NOT A SYSTEM OF SUPPORT, THOUGH SUPPORT IS GIVEN. THE MAIN AIM OF THIS GROUPING IS NOT TO GIVE THE FLESH ANY EXCUSES. NO MORE EXCUSES\r\n', '1322065026Accountability Buddy Covenant.doc', 'http://apostolictoolbox.s3.amazonaws.com/pastortim/Accountability-1322065026Accountability-Buddy-Covenant.doc', '32768', 3, 1, 'doc', 11, 1, NULL, NULL, 1, 1, '2011-11-23 08:17:06', '2011-11-23 08:17:41'),
