(2481, 'Ministry of Care (Teacher Notes)', 'Ministry of Care (Teacher Notes)', 'Ministry of Care is a 6 Lesson series that expounds on Spiritual maturity. It highlights the importance of growing up in the Kingdom of God, understanding who we are in Christ and to care for others. Some of the topics covered will be: The Challenges of Growing Up, What is Care Ministry About, The Shepherd & You, Understanding Who You Are, Respecting Yourself, Co-Dependency and the Spirit of Manipulation.', '1333091921Teacher Notes.rar', 'http://apostolictoolbox.s3.amazonaws.com/admin/Ministry-of-Care-(Teacher-Notes)-1333091921Teacher-Notes.rar', '3407477', 0, 1, 'rar', 16, 1, '', '', 1, 1, '2012-03-30 00:18:41', '2013-01-10 00:02:53'),
(2521, 'Youth UTB Lesson Lesson 5 - Noah and his Ark (Teacher\'s Notes)', 'Youth UTB Lesson 5 - Noah and his Ark', 'A simplified version of unlocking the Bible for teens.\r\n\r\nIn this lesson, we will cover the story of Noah and the ark and explain to students the necessity to follow and obey the plan of salvation for our day.', '1333473656Youth UTB Lesson 5 - Noah and his Ark.docx', 'http://apostolictoolbox.s3.amazonaws.com/samuel/Youth-UTB-Lesson-Lesson-5---Noah-and-his-Ark-(Teacher\'s-Notes)-1333473656Youth-UTB-Lesson-5---Noah-and-his-Ark.docx', '2400155', 27, 1, 'docx', 251, 1, '', '', 1, 1, '2012-04-03 10:20:56', '2013-01-09 23:52:23'),
(2486, 'Under Cover Series (Video)', 'Under Cover Lesson 1 - It is Hard to Kick Against the Goads', 'John Bevere effectively uses his personal mistakes to illustrate riveting truths about repentance and forgiveness. As he focuses on the true authority of God, he is careful to explain by example the important difference between \"submission\" and \"obedience.\" The same struggle with divine authority is also represented through the lives of John the Baptist, the Apostle Paul, and other biblical figures. An especially helpful lesson for Christians who want to develop a serious pursuit of God.', 'http://media.tabjoy.org/media2/UnderCover/L1.mp4', 'http://apostolictoolbox.s3.amazonaws.com/admin/Under-Cover-Series-(Video)-L1.mp4', '113035773', 0, 1, 'mp4', 14, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=Mjc=\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Under Cover Lesson 1 - It is Hard to Kick Ag', 1, 1, '2012-03-30 01:08:55', '2012-05-08 00:20:00'),
(36, ' Believers Boot Camp Series (Part 1 of 6)', ' Believers Boot Camp Series (Part 1 of 6)', 'The book of Ephesians serves as a â€œBoot Campâ€ for believers, teaching us that the church is equipped with vast spiritual weaponry in order to accomplish this very task. All that remains is for us to unseal our marching orders, take our weapons, and storm the gates of Hell.', '1323853113Believers Boot Camp - Part 1.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/-Believers-Boot-Camp-Series-(Part-1-of-6)-1323853113Believers-Boot-Camp---Part-1.doc', '61440', 0, 1, 'doc', 15, 1, '', '', 1, 1, '2011-12-14 00:58:33', '2012-09-20 10:53:50'),
