(123, 'Apostolic Minister and Prayer', 'Apostolic Minister and Prayer', '', '1324051352Apostolic Minister and Prayer.docx', 'http://apostolictoolbox.s3.amazonaws.com/khengdeh/Apostolic-Minister-and-Prayer-1324051352Apostolic-Minister-and-Prayer.docx', '15922', 12, 1, 'docx', 207, 1, NULL, NULL, 1, 1, '2011-12-16 08:02:32', '2012-03-05 20:36:33'),
(124, 'Can you lend me your heart', 'Can you lend me your heart', 'We often think in order for God to have a revival it takes a group of people or congregation.But that is not necessary the case\r\nEzekiel 22:30 (NKJV) \r\n30 So I sought for a man among them who would make a wall, and stand in the gap before Me on behalf of the land, that I should not destroy it; but I found no one. \r\n', '1324057524Could you lend me your heart .docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Can-you-lend-me-your-heart-1324057524Could-you-lend-me-your-heart-.docx', '29390', 0, 1, 'docx', 11, 1, '', '', 1, 1, '2011-12-16 09:45:24', '2012-09-20 10:12:11'),
(125, 'Creating a healthy addiction', 'Creating a healthy addiction', 'WE NEED TO CREATE A \"POSITIVE ADDICTION\" TO DAILY BIBLE READING\r\n\r\nA. WHAT IS A \"POSITIVE ADDICTION\"?\r\n\r\n1. Usually when we hear the word ADDICTION, we think of NEGATIVE ADDICTIONS\r\n\r\na. Which is simply another word for BAD HABITS. Such as smoking, swearing, drinking, gambling\r\n\r\nWhen something bad for us:\r\n1) Becomes \"second nature\"\r\n2) We do it without much effort or thought\r\n3) We become dependent on it, either emotionally or physically\r\n4) When we try to do without it, we experience various degrees\r\nof discomfort\r\n \r\n2. POSITIVE ADDICTION is when you become dependent upon a good habit\r\n', '1324057850creating a healthy addiction.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Creating-a-healthy-addiction-1324057850creating-a-healthy-addiction.docx', '15765', 0, 1, 'docx', 11, 1, NULL, NULL, 1, 1, '2011-12-16 09:50:50', NULL),
(126, 'How do I love God?', 'How do I love God?', 'In his book God Is the Gospel, John Piper essentially asks whether we are in love with God:\r\n\r\nThe critical question for our generation-and for every genÂ¬eration-is this: If you could have heaven, with no sickness, and with all the friends you ever had on earth, and all the food you ever liked, and all the leisure activities you ever enjoyed, and all the natural beauties you ever saw, all the physical pleasures you ever tasted, and no human conflict or any natural disasters, could you be satisfied with heaven, if Christ was not there?11\r\n\r\nHow many of you will read those words and say, \"You know, I just might be okay with that\"? \r\n\r\nIf you are as deeply in love with God, you know you could never be satisfied in a heaven without Christ.\r\n', '1324058059how do i love God.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-do-I-love-God?-1324058059how-do-i-love-God.docx', '19598', 0, 1, 'docx', 11, 1, NULL, NULL, 1, 1, '2011-12-16 09:54:19', NULL),
(127, 'Manipulation', 'Manipulation', 'Attempts to control our own world begin with the first breath of life. A baby\'s natural cry, called the \"cry for attention,\" represents the first efforts at getting our needs met. Over the years, children can learn to use manipulative tears to get their way within their little circle of life. As we grow into adults, we develop highly refined personal skills for meeting our needs by taking matters into our own hands and manipulating people and events around us. ', '1324058195Manipulation.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Manipulation-1324058195Manipulation.docx', '44970', 0, 1, 'docx', 11, 1, NULL, NULL, 1, 1, '2011-12-16 09:56:35', NULL),
