(2491, 'Under Cover Series (Video)', 'Under Cover Lesson 6 - Honor the King', 'John Bevere effectively uses his personal mistakes to illustrate riveting truths about repentance and forgiveness. As he focuses on the true authority of God, he is careful to explain by example the important difference between \"submission\" and \"obedience.\" The same struggle with divine authority is also represented through the lives of John the Baptist, the Apostle Paul, and other biblical figures. An especially helpful lesson for Christians who want to develop a serious pursuit of God.', 'http://media.tabjoy.org/media2/UnderCover/L6.mp4', 'http://apostolictoolbox.s3.amazonaws.com/admin/Under-Cover-Series-(Video)-L6.mp4', '108103948', 0, 1, 'mp4', 14, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=NjQ=\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Lesson 6 - Honor the King', 1, 1, '2012-03-30 01:08:55', '2012-05-08 00:19:43'),
