(268, 'The 3 I AMs', 'The 3 I AMs', '\r\nThis lesson highlights some of the questions we need to ask God and helps to bring us into self-realization. ', '1325218583The 3 I AMs.pptx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-3-I-AMs-1325218583The-3-I-AMs.pptx', '1095933', 0, 1, 'pptx', 11, 1, NULL, NULL, 1, 1, '2011-12-29 20:16:23', NULL),
(269, 'Signs of the Times', 'Signs of the Times', '\r\nThis lesson emphasizes on the importance of being vigilant, and being aware of the signs of the times. It also reminds us on what is expected of us during these last days.', '1325219505Signs of the Times.pptx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Signs-of-the-Times-1325219505Signs-of-the-Times.pptx', '1096219', 0, 1, 'pptx', 11, 1, NULL, NULL, 1, 1, '2011-12-29 20:31:45', '2011-12-30 01:29:10'),
(270, 'Understanding Your Two Natures', 'Understanding Your Two Natures', '\r\nThere are battles going on constantly, in both the natural and spiritual worlds. Likewise, we too, face an ongoing battle between the Holy Spirit and our flesh. This lesson gives us understanding on both natures and their respective attributes, how to empower the Spirit and to subdue our flesh.', '1325221747Understanding Your 2 Natures.ppt', 'http://apostolictoolbox.s3.amazonaws.com/admin/Understanding-Your-Two-Natures-1325221747Understanding-Your-2-Natures.ppt', '590336', 0, 1, 'ppt', 11, 1, NULL, NULL, 1, 1, '2011-12-29 21:09:07', '2011-12-30 01:28:51'),
