(281, 'Honour\'s Reward (Teacher\'s Notes, Lesson 1)', 'Honour\'s Reward (Teacher\'s Notes, Lesson 1)', 'In HONOR\'S REWARD, bestselling author John Bevere unveils the power and truth of an often-overlooked principle-the spiritual law of honor. Bevere explains that understanding the vital role of this virtue will enable readers to attract blessing both now and for eternity.', '1325569414Lesson 1.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Honour\'s-Reward-(Teacher\'s-Notes,-Lesson-1)-1325569414Lesson-1.doc', '48128', 0, 1, 'doc', 14, 1, NULL, NULL, 1, 1, '2012-01-02 21:43:34', '2012-01-02 21:47:19'),
