(306, 'Under Cover (Teacher\'s Notes, Lesson 11 - Odds and Ends)', 'Under Cover (Teacher\'s Notes, Lesson 11 - Odds and Ends)', 'John Bevere effectively uses his personal mistakes to illustrate riveting truths about repentance and forgiveness. As he focuses on the true authority of God, he is careful to explain by example the important difference between \"submission\" and \"obedience.\" The same struggle with divine authority is also represented through the lives of John the Baptist, the Apostle Paul, and other biblical figures. An especially helpful lesson for Christians who want to develop a serious pursuit of God.', '1325585787Lesson 11.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Under-Cover-(Teacher\'s-Notes,-Lesson-11---Odds-and-Ends)-1325585787Lesson-11.doc', '50176', 0, 1, 'doc', 14, 1, NULL, NULL, 1, 1, '2012-01-03 02:16:27', NULL);
