(294, 'Bait of Satan (Teacher\'s Notes)', 'Bait of Satan (Teacher\'s Notes)', 'Escape the enemy\'s deadly trap! The Bait of Satan exposes one of the most deceptive snares Satan uses to get believers out of the will of God-offense. Most people who are ensnared by the bait of Satan don\'t even realize it. Don\'t be fooled! You will encounter offense, and it\'s up to you how it will affect your relationship with God. Your response will determine your future. If offense is handled correctly, you will become stronger rather than bitter. In this lesson, John Bevere shows you how to stay free from offense and escape the victim mentality. \r\n\r\nYou will find answers to tough questions like these:\r\n\r\n    Why am I compelled to tell \"my side\" of the story?\r\n    How can I fight thoughts of suspicion or distrust?\r\n    What can I do to stop rehearsing past hurts?\r\n    How can I regain trust after someone deeply offends me?\r\n\r\nThis lesson will help you escape the enemy\'s \"offensive trap\" as well as empower you to stay free of offense, enabling you to have an unhindered relationship with God.', '1325581755The Bait of Satan series_THE BAIT OF SATAN teacher\'s notes.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Bait-of-Satan-(Teacher\'s-Notes)-1325581755The-Bait-of-Satan-series_THE-BAIT-OF-SATAN-teacher\'s-notes.docx', '70753', 0, 1, 'docx', 14, 1, NULL, NULL, 1, 1, '2012-01-03 01:09:15', '2012-01-03 01:11:08'),
(295, 'Bait of Satan (Student Notes)', 'Bait of Satan (Student Notes)', 'Escape the enemy\'s deadly trap! The Bait of Satan exposes one of the most deceptive snares Satan uses to get believers out of the will of God-offense. Most people who are ensnared by the bait of Satan don\'t even realize it. Don\'t be fooled! You will encounter offense, and it\'s up to you how it will affect your relationship with God. Your response will determine your future. If offense is handled correctly, you will become stronger rather than bitter. In this lesson, John Bevere shows you how to stay free from offense and escape the victim mentality. \r\n\r\nYou will find answers to tough questions like these:\r\n\r\n    Why am I compelled to tell \"my side\" of the story?\r\n    How can I fight thoughts of suspicion or distrust?\r\n    What can I do to stop rehearsing past hurts?\r\n    How can I regain trust after someone deeply offends me?\r\n\r\nThis lesson will help you escape the enemy\'s \"offensive trap\" as well as empower you to stay free of offense, enabling you to have an unhindered relationship with God.', '1325581801The Bait of Satan series_THE BAIT OF SATAN student notes.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Bait-of-Satan-(Student-Notes)-1325581801The-Bait-of-Satan-series_THE-BAIT-OF-SATAN-student-notes.docx', '73315', 0, 1, 'docx', 14, 1, '', '', 1, 1, '2012-01-03 01:10:01', '2012-03-29 23:31:22'),
(296, 'Under Cover (Teacher\'s Notes, Lesson 1 - It is Hard to Kick Against the Goads)', 'Under Cover (Teacher\'s Notes, Lesson 1 - It is Hard to Kick Against the Goads)', 'John Bevere effectively uses his personal mistakes to illustrate riveting truths about repentance and forgiveness. As he focuses on the true authority of God, he is careful to explain by example the important difference between \"submission\" and \"obedience.\"\r\n\r\nThe same struggle with divine authority is also represented through the lives of John the Baptist, the Apostle Paul, and other biblical figures. An especially helpful lesson for Christians who want to develop a serious pursuit of God.\r\n', '1325582604Lesson 1.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Under-Cover-(Teacher\'s-Notes,-Lesson-1---It-is-Hard-to-Kick-Against-the-Goads)-1325582604Lesson-1.doc', '33280', 0, 1, 'doc', 14, 1, NULL, NULL, 1, 1, '2012-01-03 01:23:24', NULL),
