(365, 'Holiness Series (Holiness Principles Notes)', 'Holiness Series (Holiness Principles Notes)', 'This study on Practical Holiness has been prepared to deal with a foundational issue of Apostolic faith; that is, does the Holy Ghost affect the outward appearance of the vessel He chooses to dwell in, or not? Do the standards of conduct and appearance given in Scripture apply to us today, or should they be discarded in favor of a lifestyle that is less inconspicuous and less offensive to â€“ our modern society? These lessons concentrate on the four main areas that have been most maligned by those who find the holiness lifestyle too burdensome or embarrassing. The relationship between â€œinnerâ€ and â€œouterâ€ holiness, and the specifics of hair, apparel and adornment that are mentioned in Scripture will be covered.', '1325753051Holiness Principles.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Holiness-Series-(Holiness-Principles-Notes)-1325753051Holiness-Principles.doc', '67584', 0, 1, 'doc', 15, 1, NULL, NULL, 1, 1, '2012-01-05 00:44:11', '2012-01-05 00:47:30'),
