(641, 'Church Facilities Management', 'Church Facilities Management', 'This is an innovative resource that will help you assemble clear policy guidelines on use of church facilities. Selected by the editors of Leadership Resources at Christianity Today International, these are the best components of church facilities management policies, which come from a variety of churches and denominations.\r\nWe have assembled 12 forms to help you review your current church facilities policiesâ€”or to create new and needed ones. Although this is not exhaustive, these forms can be adapted for almost any part of your churchâ€™s physical plant.  \r\nThese 12 forms range from general use of facilities to specific issues such as a kitchen checklist, a room reservation form, an insurance agreement, or wedding setup guidelines. These forms will help your church administrator, maintenance person or pastor plan and prepare for facilities useâ€”and to set limits on what can or cannot be done on the premises. These policies also provide a clear line of accountability in case something should go wrong in the use of facilities.\r\nWe hope these forms will assist your church in making your church available to members and to people in the communityâ€”and also to ensure that the facility use demonstrates careful stewardship of the physical resources of the ministry.\r\n', '1325844134church facilities.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Church-Facilities-Management-1325844134church-facilities.doc', '372224', 0, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-01-06 02:02:14', '2012-01-06 02:12:31'),
