(663, 'Church Volunteer Evaluations', 'Church Volunteer Evaluations', 'This is an innovative resource that will help you assemble an effective volunteer evaluation. Selected by the editors of Leadership Resources at Christianity Today International, these are the best components of numerous evaluations, which come from a variety of churches and denominations.\r\nWe have assembled seven forms to help you evaluate your volunteers. You may use any component as it appears in this training packet, or you may customize any form for your particular use. \r\nThe seven forms range from evaluating your volunteer musicians to your church financial team. These forms will help your volunteers review their goals and objectives as well as evaluate whether they are using their spiritual gifts.\r\nWe hope these forms will assist your church in making volunteer evaluations a smooth and helpful process.\r\n', '1325845012church volunteers evaluation.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Church-Volunteer-Evaluations-1325845012church-volunteers-evaluation.doc', '163840', 0, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-01-06 02:16:52', NULL),
