(2506, 'Ministering with Boldness', 'Ministering in Boldness', 'At Pentecost Peter stood up in boldness to proclaim what was taking place. What a difference this was to just a few days earlier denying he even knew Jesus Christ. Following this, we see the disciples possessing faith, power, and boldness. We see them being used in the healing of the lame man at the Gate Beautiful in Acts Chapter 3.  Here we also see the Gifts of the Spirit starting to be used.  In this lesson we will deal with the boldness displayed by Peter and John. It is this boldness that causes us to wake up the spiritual gifts wanting to operate through us and causes us to press forward even in the face of opposition, persecution, and problems.  We realize, â€œno weapon that is formed against thee shall prosperâ€ (Isaiah 54:17).', '1333127000Ministering in Boldness.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Ministering-with-Boldness-1333127000Ministering-in-Boldness.doc', '37376', 0, 1, 'doc', 258, 1, '', '', 1, 1, '2012-03-30 10:03:20', '2013-01-09 23:59:06'),
(762, 'The Names Of The Holy Spirit   E.Towns', 'The Names Of The Holy Spirit   E.Towns', '', '1328296229The.Names.Of.The.HolySpirit[ETowns].pdf', 'http://apostolictoolbox.s3.amazonaws.com/jhlent/The-Names-Of-The-Holy-Spirit---E.Towns-1328296229The.Names.Of.The.HolySpirit[ETowns].pdf', '360932', 24, 1, 'pdf', 0, 1, NULL, NULL, 1, 1, '2012-02-03 11:10:29', '2012-02-03 21:01:47'),
(763, 'The Purpose of Baptism Historically and Today', 'The Purpose of Baptism Historically and Today', 'When the oneness movement began in this century the controversy over the Godhead was only one of the points of contention raised between the trinitarians and the oneness people. Other points of controversy were baptism in the name of Jesus and the essentiality of baptism. We find a wide range of beliefs on the subject of baptism today. The position of the United Pentecostal Church has always been \r\nthat one of the primary purposes of baptism is for the remission of sins after one has repented. Baptism is a demonstration of faith in Jesus Christ. Others disagree with this position, holding that baptism is only an outward sign of an inward change. A few even go to the extreme of saying that water baptism is a work and, therefore, is not \r\nto be administered at all.      This paper will examine some of the beliefs of baptism held in the past and compare them with those of the United Pentecostal Church. We will examine the beliefs of the early church along with those of \r\nthe Reformation. We will show that the position taken by the United  Pentecostal Church is doctrinally and historically correct.\r\n', '1328331297The Purpose of Baptism Historically and Today.docx', 'http://apostolictoolbox.s3.amazonaws.com/pastortim/The-Purpose-of-Baptism-Historically-and-Today-1328331297The-Purpose-of-Baptism-Historically-and-Today.docx', '36461', 3, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-03 20:54:57', '2012-02-03 21:03:21'),
(764, 'THE ORIGIN OF THE TRINITY', 'THE ORIGIN OF THE TRINITY', 'This paper will propose to examine the philosophical and pagan origins \r\nof the Trinity and its early development. Pagan pantheons of the various ethnic gods will be compared, and triads in these pantheons will be examined for specific Trinitarian-qualities. The antiquity of the Babylonian pantheon and its subsequent influence upon the various pantheons is pointed out.\r\n', '1328331591The Origen of Trinity.docx', 'http://apostolictoolbox.s3.amazonaws.com/pastortim/THE-ORIGIN-OF-THE-TRINITY-1328331591The-Origen-of-Trinity.docx', '47713', 3, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-03 20:59:51', '2012-02-03 21:01:34'),
(765, 'Give Me All Your Money', 'Give Me All Your Money', 'Some thoughts on Biblical money management', '1328361583Give Me All Your Money.pdf', 'http://apostolictoolbox.s3.amazonaws.com/Dinuks/Give-Me-All-Your-Money-1328361583Give-Me-All-Your-Money.pdf', '37121', 39, 1, 'pdf', 29, 1, '', '', 1, 1, '2012-02-04 05:19:43', '2012-09-20 09:16:32'),
(766, 'The King\'s Witness', 'The King\'s Witness', 'A look at the life of the prophet Daniel', '1328363221The Kings Witness.pdf', 'http://apostolictoolbox.s3.amazonaws.com/Dinuks/The-King\'s-Witness-1328363221The-Kings-Witness.pdf', '42384', 39, 1, 'pdf', 29, 1, NULL, NULL, 1, 1, '2012-02-04 05:47:01', '2012-02-04 06:23:55'),
(767, 'One Lord, One Faith, One Baptism', 'One Lord, One Faith, One Baptism', 'A4 Poster', '1328365498One Lord.jpg', 'http://apostolictoolbox.s3.amazonaws.com/Dinuks/One-Lord,-One-Faith,-One-Baptism-1328365498One-Lord.jpg', '1928795', 39, 1, 'jpg', 0, 1, NULL, NULL, 1, 1, '2012-02-04 06:24:58', '2012-02-04 06:27:06'),
(768, 'Baptism', 'Baptism', 'What about baptism? Is it necessary for one to be baptized\r\nto be saved; to be forgiven of our sins? This study is\r\ndevoted to answering these questions by simply allowing the\r\nBible to speak for itself on the subject of baptism and what\r\nbearing, if any, baptism may have on being saved from our\r\nsins.\r\n', '1328368135Baptism.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Baptism-1328368135Baptism.doc', '33792', 0, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:08:55', NULL),
(769, 'Water Baptism', 'Water Baptism', 'When Paul came to Ephesus and found certain disciples of John the Baptist he asked them two very vital questions; (1) Have ye received the Holy Ghost since ye believed? (2) Unto what then were ye baptized? Their answer to the first \"... we have not so much as heard whether there be any Holy Ghost.\" \r\n\r\n', '1328368228Water Baptism.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Water-Baptism-1328368228Water-Baptism.doc', '35328', 0, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:10:28', NULL),
(770, 'Baptism from Apostolic Point of View', 'Baptism from Apostolic Point of View', 'Baptism in water is a command of God. It is said, by many, to be an ordinance, that is, \"an outward sign of inward purity.\" But such an expression cannot be found in the Word of God. Christ never made such a statement in all His ministry.', '1328368305BAPTISM FROM APOSTOLIC POINT OF VIEW.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Baptism-from-Apostolic-Point-of-View-1328368305BAPTISM-FROM-APOSTOLIC-POINT-OF-VIEW.docx', '16611', 0, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:11:45', NULL),
(771, 'Infant Baptism', 'Infant Baptism', 'The fall of Jerusalem and the destruction of the Temple in 70 A.D. had a profound effect on early Christianity. The removal of what had been the central base of the Apostles forced the early fathers to create new centers from which they could work. These emerged in Asia Minor, Europe, and Northern Africa. The most influential became the church in Rome. While Christianity was on the rise during the second century, Roman culture was in a period of swift transition. Divisions between the Eastern and Western portions of the Empire were becoming more acute. Barbaric tribes were pressuring the Roman legions in Northern and Western Europe.', '1328368364Infant Baptism.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Infant-Baptism-1328368364Infant-Baptism.docx', '17391', 0, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:12:44', NULL),
(772, 'The Significance of Water Baptism', 'The Significance of Water Baptism', 'When the apostle Paul arrived in Ephesus, he met twelve men who appeared to be Christians. However, when he discovered that they had not received the Holy Ghost, he asked them, \"Unto what then were ye baptized?\" (Acts 19:3).  With this question, he probed their experience and understanding of God\'s plan. When they answered that they had been baptized with the baptism of John the Baptist, he immediately taught them of Jesus Christ and then baptized them in Christian baptism.', '1328368430THE SIGNIFICANCE OF WATER BAPTISM.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Significance-of-Water-Baptism-1328368430THE-SIGNIFICANCE-OF-WATER-BAPTISM.docx', '25144', 0, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:13:50', NULL),
(773, 'THE BAPTISMAL FORMULA AND THE GREEK TEXT', 'THE BAPTISMAL FORMULA AND THE GREEK TEXT', 'In Acts 2:38, the Apostle Peter, with the support of the other apostles, \r\ncommanded his Jewish audience to \"be baptized every one of you in the name of Jesus Christ.\" Scripture records that the Samaritans, the Gentiles, and the disciples of John at Ephesus were also baptized in the name of Jesus Christ (Acts 8:16; 10:4-8; 19:5).\r\n', '1328368509THE BAPTISMAL FORMULA AND THE GREEK TEXT.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/THE-BAPTISMAL-FORMULA-AND-THE-GREEK-TEXT-1328368509THE-BAPTISMAL-FORMULA-AND-THE-GREEK-TEXT.docx', '30788', 0, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:15:09', NULL),
(774, 'WHY WE BAPTIZE IN JESUS\' NAME', 'WHY WE BAPTIZE IN JESUS\' NAME', 'The subject of water baptism has long been called a great issue and no doubt has been made such by many church leaders of the past and present. In out study of it, let us first consider its importance, or the necessity of being baptized.\r\n', '1328368586Why we baptize in Jesus Name.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/WHY-WE-BAPTIZE-IN-JESUS\'-NAME-1328368586Why-we-baptize-in-Jesus-Name.docx', '20403', 0, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:16:26', NULL),
(775, 'What meaneth this', 'What meaneth this', 'Jerusalem was bustling at this particular time. People had thronged it from all over the civilized world, looking forward to this notable feast day. A strange phenomenon was taking place that day as had never happened before on any day of Pentecost. Thousands were pushing into the alleys and narrow streets around a building where the disciples of Jesus were staying. What was this strange thing going on? Were these actually drunk, as some were accusing? As people came closer and could see and hear, \". . .they were all amazed, and were in doubt, saying one to	another, What meaneth this?\" (1)', '1328368831What meaneth this.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/What-meaneth-this-1328368831What-meaneth-this.doc', '50688', 0, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:20:31', NULL),
(776, 'Some Useful Online Resources for PI Students', 'Some Useful Online Resources for PI Students', '', '1328370120Resources for PI.pdf', 'http://apostolictoolbox.s3.amazonaws.com/Dinuks/Some-Useful-Online-Resources-for-PI-Students-1328370120Resources-for-PI.pdf', '35659', 39, 1, 'pdf', 0, 1, NULL, NULL, 1, 1, '2012-02-04 07:42:00', '2012-02-04 08:01:26'),
(777, 'The Mark of the Beast', 'The Mark of the Beast', 'This is a short essay about the relationship between modern technology and the mark of the beast.', '1328450509The Mark of the Beast.doc', 'http://apostolictoolbox.s3.amazonaws.com/wesleywhitehead/The-Mark-of-the-Beast-1328450509The-Mark-of-the-Beast.doc', '350208', 29, 1, 'doc', 19, 1, NULL, NULL, 1, 1, '2012-02-05 06:01:49', '2012-02-05 06:02:44'),
(778, 'What if...', 'What if...', 'This is a sermon I preached at Tabernacle of Joy on July 3, 2011.', '1328453163What if.doc', 'http://apostolictoolbox.s3.amazonaws.com/wesleywhitehead/What-if...-1328453163What-if.doc', '64000', 29, 1, 'doc', 19, 1, NULL, NULL, 1, 1, '2012-02-05 06:46:03', '2012-02-05 08:48:23'),
(779, 'Do You Know What Time it is?', 'Do You Know What Time it is?', 'This is an exposition on Ecclesiastes 3:1-8.  It was written in 1997.', '1328453320Do You Know What Time it is.docx', 'http://apostolictoolbox.s3.amazonaws.com/wesleywhitehead/Do-You-Know-What-Time-it-is?-1328453320Do-You-Know-What-Time-it-is.docx', '109226', 29, 1, 'docx', 19, 1, NULL, NULL, 1, 1, '2012-02-05 06:48:40', '2012-02-05 08:47:43'),
(780, 'The Hedgehog Principle', 'The Hedgehog Principle', 'Pi essay based on the book \"Good to Great\" by Jim Collins. in this essay, I drew parallels between Collins\' Hedgehog Principle and Tabernacle of Joy\'s Multimedia Ministry.', '1328498546Good to great.doc', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/The-Hedgehog-Principle-1328498546Good-to-great.doc', '36864', 35, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-05 19:22:26', '2012-02-05 22:01:36'),
(781, 'The Heart of Ministry - Worship unto God', 'The Heart of Ministry - Worship unto God', 'This is a short essay on the importance of a balanced ministry of the word and the Spirit.', '1328537854the heart of ministry - worship (essay).doc', 'http://apostolictoolbox.s3.amazonaws.com/angelinekee/The-Heart-of-Ministry---Worship-unto-God-1328537854the-heart-of-ministry---worship-(essay).doc', '33792', 44, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-06 06:17:34', '2012-02-06 06:49:11'),
(782, 'From Good to Great', 'From Good to Great', 'Bringing the ROCK Ministry from Good to Great', '1328539973Complete Essay.pdf', 'http://apostolictoolbox.s3.amazonaws.com/yeotaiyi/From-Good-to-Great-1328539973Complete-Essay.pdf', '97549', 37, 1, 'pdf', 0, 1, NULL, NULL, 1, 1, '2012-02-06 06:52:53', '2012-02-06 09:10:37'),
(783, 'Nehemiah ', 'Nehemiah ', 'This is a character study on Nehemiah. Nehemiahâ€™s approach to the things of God serves as an example of what Christians should do before rising up and stepping into Godâ€™s call of ministry. ', '1328587434character study.doc', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/Nehemiah--1328587434character-study.doc', '35328', 35, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-06 20:03:54', '2012-02-06 20:45:18'),
(784, 'Is There Any Efficacy In Water Baptism?', 'Is There Any Efficacy In Water Baptism?', 'This lesson expounds on whether Baptism has the power to produce effects or intended results to wash away sins based on His Word.\r\n', '1328592707IS THERE ANY EFFICACY IN WATER BAPTISM.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Is-There-Any-Efficacy-In-Water-Baptism?-1328592707IS-THERE-ANY-EFFICACY-IN-WATER-BAPTISM.docx', '18078', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-06 21:31:47', NULL),
(785, 'The Change In The Early Formula Of Baptism', 'The Change In The Early Formula Of Baptism', 'This lesson brings to our attention the change(s) that took place in the early formula of baptism comparing scriptures with historical facts.', '1328593391THE CHANGE IN THE EARLY FORMULA OF BAPTISM.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Change-In-The-Early-Formula-Of-Baptism-1328593391THE-CHANGE-IN-THE-EARLY-FORMULA-OF-BAPTISM.docx', '22854', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-06 21:43:11', NULL),
(786, 'Jesus Name Baptism', 'Jesus Name Baptism', 'It is widely believed in evangelical circles today that\r\nbaptism can be safely dispensed with. Most of the preaching we\r\nhear presents baptism in a \"take it or leave it\" light. \r\n\r\nThis lesson however, will use Bible proof that baptism is absolutely essential.\r\n\r\n', '1328593818JESUS NAME BAPTISM.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Jesus-Name-Baptism-1328593818JESUS-NAME-BAPTISM.docx', '52891', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-06 21:50:18', NULL),
(798, 'The Name of the Father, Son, and Holy Ghost', 'The Name of the Father, Son, and Holy Ghost', 'The Bible commands water baptism for the New Testament church, and it is our responsibility to obey this teaching. This lesson talks about baptism in the NAME of the Father, Son and Holy Ghost.', '1328602044The Name of the Father, Son, and Holy Ghost.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Name-of-the-Father,-Son,-and-Holy-Ghost-1328602044The-Name-of-the-Father,-Son,-and-Holy-Ghost.docx', '19154', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:07:24', NULL),
(788, 'Why Is Baptism Necessary?', 'Why Is Baptism Necessary?', 'This lesson sheds light on why Baptism is necessary by exploring the Abrahamic Covenant. \r\n', '1328594392WHY IS BAPTISM NECESSARY.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Why-Is-Baptism-Necessary?-1328594392WHY-IS-BAPTISM-NECESSARY.docx', '33149', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-06 21:59:52', NULL),
(789, 'Water', 'Water', 'We are living in a time when we need to keep the message simple. We should beware at anytime lest our minds be corrupted from the simplicity that is in Jesus Christ. In this lesson, the subject of water will be discussed. Just one simple word, water! \r\n', '1328595178WATER.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Water-1328595178WATER.docx', '20464', 0, 1, 'docx', 30, 1, NULL, NULL, 1, 1, '2012-02-06 22:12:58', NULL),
(795, 'What is Baptism?', 'What is Baptism?', 'What about baptism? Is it necessary for one to be baptized to be saved; to be forgiven of our sins? This study is devoted to answering these questions by simply allowing the Bible to speak for itself on the subject of baptism and what bearing, if any, baptism may have on being saved from our sins.', '1328598740BAPTISM.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/What-is-Baptism?-1328598740BAPTISM.docx', '19278', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-06 23:12:20', NULL),
(796, 'Common Objections To Baptism', 'Common Objections To Baptism', 'This lesson covers some of the common objections to water baptism and the answers to those objections.', '1328598944COMMON OBJECTIONS TO BAPTISM.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Common-Objections-To-Baptism-1328598944COMMON-OBJECTIONS-TO-BAPTISM.docx', '23840', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-06 23:15:44', NULL),
(797, 'The Necessity of Baptism', 'The Necessity of Baptism', 'As honest seekers of the truth, we cannot be interested in counting noses as to who believes what. Counting noses does not determine truth, and God does not take opinion polls. Truth is not determined by what people believe but by what God has said in His Word. This lesson talks about the necessity of baptism.  ', '1328599497The Necessity of Baptism.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Necessity-of-Baptism-1328599497The-Necessity-of-Baptism.docx', '25982', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-06 23:24:57', NULL),
(799, 'The Purpose of Baptism Historically and Today', 'The Purpose of Baptism Historically and Today', 'This paper will examine some of the beliefs of baptism held in \r\nthe past and compare them with those of the United Pentecostal Church. We will examine the beliefs of the early church along with those of the Reformation. We will show that the position taken by the United Pentecostal Church is doctrinally and historically correct.\r\n', '1328602481THE PURPOSE OF BAPTISM HISTORICALLY AND TODAY.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Purpose-of-Baptism-Historically-and-Today-1328602481THE-PURPOSE-OF-BAPTISM-HISTORICALLY-AND-TODAY.docx', '36629', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:14:41', NULL),
(800, 'What\'s Wrong With The Name Jesus?', 'What\'s Wrong With The Name Jesus?', 'You may agree that there is nothing wrong with the name of Jesus.  However, it may shock you to find that although many \"Christians\" claim all the benefits of the Name of Jesus yet refuse to be baptized in the Name of Jesus. This lesson highlights the importance of baptism in Jesus name.\r\n', '1328602712What\'s Wrong With The Name Jesus.TXT.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/What\'s-Wrong-With-The-Name-Jesus?-1328602712What\'s-Wrong-With-The-Name-Jesus.TXT.docx', '15993', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:18:32', NULL),
(801, 'Matthew 28:19 - What does it mean?', 'Matthew 28:19 - What does it mean?', 'I\'ve been baptized in Jesus\' Name, but the preacher at my former church said, \"in the Name of Jesus\" meant, \"in the authority of Jesus\" and that\'s why they baptize according to Matthew 28:19.  Does name mean authority? \r\n\r\nThis is a common question that is covered in this short study.', '1328603003Question about Water Baptism.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Matthew-28:19---What-does-it-mean?-1328603003Question-about-Water-Baptism.docx', '14454', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:23:23', NULL),
(802, 'Should We Accept A Baptismal Compromise?', 'Should We Accept A Baptismal Compromise?', 'This short lesson covers on whether should we accept a baptismal compromise.', '1328603192Should We Accept A Baptismal Compromise.TXT.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Should-We-Accept-A-Baptismal-Compromise?-1328603192Should-We-Accept-A-Baptismal-Compromise.TXT.docx', '15662', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:26:32', NULL),
(803, 'Baptism Doth Now Save Us', 'Baptism Doth Now Save Us', 'This lesson study expounds on I Peter 3:18-22 and water baptism.\r\n', '1328603581BAPTISM DOTH NOW SAVE US.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Baptism-Doth-Now-Save-Us-1328603581BAPTISM-DOTH-NOW-SAVE-US.docx', '19291', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:33:01', NULL),
(804, 'Baptism - Fact Or Fallacy', 'Baptism - Fact Or Fallacy', 'There is much controversy about baptism. Both mode and formula are in question. This study opens our understanding on this question in the light of God\'s Word.', '1328604054BAPTISM - FACT OR FALLACY.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Baptism---Fact-Or-Fallacy-1328604054BAPTISM---FACT-OR-FALLACY.docx', '17287', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:40:54', NULL),
(805, ' The Bible Mode And Formula For Water Baptism', ' The Bible Mode And Formula For Water Baptism', 'This is one of the LIFE and DEATH messages of the Bible. The Bible lesson further teaches that there is but ONE way to baptize or be baptized. ', '1328604266The Bible Mode And Formula For Water Baptism.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/-The-Bible-Mode-And-Formula-For-Water-Baptism-1328604266The-Bible-Mode-And-Formula-For-Water-Baptism.docx', '17185', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:44:26', NULL),
(806, 'Is Water Baptism Necessary?', 'Is Water Baptism Necessary?', 'According to the Bible, water baptism is essential to our salvation. So, why do we need baptism? This lesson enlightens us on this matter.', '1328604659Is Water Baptism Necessary.TXT.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Is-Water-Baptism-Necessary?-1328604659Is-Water-Baptism-Necessary.TXT.docx', '14767', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:50:59', NULL);
INSERT INTO `atb_document_uploaded_s3` (`id`, `document_heading`, `name`, `details`, `file_path`, `new_filepath`, `file_size`, `user_id`, `language_id`, `document_type`, `author_id`, `file_type`, `embedded_code`, `embedded_code_name`, `document_status`, `upload_status`, `created_date`, `modified_date`) VALUES
(807, 'Saved by Water', 'Saved by Water', 'This study teaches on whether are we really saved by water baptism and explains I Peter 3:20, 21.', '1328604857SAVED BY WATER.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Saved-by-Water-1328604857SAVED-BY-WATER.docx', '18377', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:54:17', NULL),
(808, 'The Doctrine of Water Baptism', 'The Doctrine of Water Baptism', 'Anyone who begins a serious study of the New Testament soon faces the prominence of water baptism, both as a practice and as a doctrine in the apostolic community. John the Baptist, Jesus, Peter, Philip, Paul and other major New Testament preachers proclaimed baptism as an integral part of their mission. The strong emphasis in the New Testament church, along with foreshadowings in the Old Testament, makes a powerful case for water baptism\'s importance. This study will discuss Old Testament types pointing to baptism, the meaning of baptism, early church practice, and baptism as a factor in salvation.', '1328605189THE DOCTRINE OF WATER BAPTISM.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Doctrine-of-Water-Baptism-1328605189THE-DOCTRINE-OF-WATER-BAPTISM.docx', '20316', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 00:59:49', NULL),
(809, 'Who Is the Holy Spirit?', 'Who Is the Holy Spirit?', 'Since Pentecostals are identified by a strong emphasis on the Holy Spirit, the question arises, What or who is the Holy Spirit? Various groups have defined the Holy Spirit as an abstract principle, an impersonal force, a fluid like substance, an angel, a subordinate divine being, or the third person in a triune Godhead. But what does the Bible say?\r\n', '1328606427WHO IS THE HOLY SPIRIT.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Who-Is-the-Holy-Spirit?-1328606427WHO-IS-THE-HOLY-SPIRIT.docx', '43511', 0, 1, 'docx', 23, 1, NULL, NULL, 1, 1, '2012-02-07 01:20:27', NULL),
(810, 'What The Holy Ghost Is All About?', 'What The Holy Ghost Is All About?', 'This study discusses about what the Holy Ghost is all about and its attributes. It also includes coverage on water baptism.', '1328607038WHAT THE HOLY GHOST IS ALL ABOUT.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/What-The-Holy-Ghost-Is-All-About?-1328607038WHAT-THE-HOLY-GHOST-IS-ALL-ABOUT.docx', '40840', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 01:30:38', NULL),
(811, 'How to Receive the Holy Ghost?', 'How to Receive the Holy Ghost?', 'Perhaps you have never received this beautiful gift of\r\nthe Holy Spirit. Or, you may know someone who desires to be\r\nSpirit-filled. These instructions apply to every believer since\r\nit is God\'s will that we first be filled and then teach others\r\nhow to receive this glorious promise.\r\n', '1328607424HOW TO RECEIVE THE HOLY GHOST.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Receive-the-Holy-Ghost?-1328607424HOW-TO-RECEIVE-THE-HOLY-GHOST.docx', '33803', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 01:37:04', '2012-02-08 08:35:32'),
(812, 'Praying With Seekers ', 'Praying With Seekers ', 'This lesson teaches us on praying with seekers and shares on what we need to know about the Holy Spirit.', '1328607827PRAYING WITH SEEKERS.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Praying-With-Seekers--1328607827PRAYING-WITH-SEEKERS.docx', '19953', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-02-07 01:43:47', '2012-02-07 09:59:55'),
