(814, 'Deep Desire', 'Deep Desire', 'This phrase was inspired by Su Wern through a message that she spoken to the youths in Bacolod, Philippines. ', '1328629373story.jpg', 'http://apostolictoolbox.s3.amazonaws.com/wongpeiting90/Deep-Desire-1328629373story.jpg', '43171', 45, 1, 'jpg', 0, 1, NULL, NULL, 1, 1, '2012-02-07 07:42:53', '2012-02-07 08:19:35'),
(815, 'Speak the Truth in Love', 'Speak the Truth in Love', 'This was inspired by one of Pastor Tim\'s sermons. This is my visual tool to help me remember the message better. There is some application that comes along with it (also suggested by Pastor Tim).', '1328629621Speak-the-truth-in-love.jpg', 'http://apostolictoolbox.s3.amazonaws.com/wongpeiting90/Speak-the-Truth-in-Love-1328629621Speak-the-truth-in-love.jpg', '33492', 45, 1, 'jpg', 0, 1, NULL, NULL, 1, 1, '2012-02-07 07:47:01', '2012-02-07 08:18:49'),
(816, 'Bringing Up Girls', 'Bringing Up Girls', 'This curriculum was prepared as part of my job during my internship in Focus On The Family Singapore. \r\n\r\nSynopsis: \r\n\r\nThe old adage believes that girls are all about sugar and spice. Distinctively feminine and intuitively emotive, girls are definitely different from boys. Yet contemporary culture with its mixed messaging on sexuality issues and feminist rights has led to much confusion on how parents should coach and groom their daughters to become confident and secure women. \r\n\r\nBringing Up Girls will help you, as parents or parents-to-be, map out their daughtersâ€™ needs arising from developmental stages and emotional challenges.\r\n\r\nWe will touch on the following topics: \r\nThe Wonderful and Complex World of Girls\r\nHow different are boys and girls?\r\nGirlsâ€™ Obsession with Beauty\r\nWhy are girls so taken with princess fantasy?\r\nGirlsâ€™ Turmoil \r\nThings girls are exposed to and face every single day. \r\nTeaching Girls to be Ladies.\r\nRoles fathers and mothers play.', '1328631109Bringing Up Girls ppt (2hr) final.pdf', 'http://apostolictoolbox.s3.amazonaws.com/wongpeiting90/Bringing-Up-Girls-1328631109Bringing-Up-Girls-ppt-(2hr)-final.pdf', '6934801', 45, 1, 'pdf', 0, 1, NULL, NULL, 1, 1, '2012-02-07 08:11:49', '2012-02-07 08:18:10'),
(817, '3 The Importance of the Threshing Floor', '3 The Importance of the Threshing Floor', 'Several years ago, the HG spoke to me in response to a question I asked HIM in prayer. (Why are there so few people who want to serve in leadership?) God said, â€œthere very few leaders, because there are very few disciples!â€ His answer started me on a journey through the scriptures to actually see what the word of God said about discipleship that I was obviously missing.', '13286355163- The Importance of The Threshingfloor.doc', 'http://apostolictoolbox.s3.amazonaws.com/pastortim/3-The-Importance-of-the-Threshing-Floor-13286355163--The-Importance-of-The-Threshingfloor.doc', '78336', 3, 1, 'doc', 31, 1, '<iframe width=\"560\" height=\"340\" src=\"http://tabjoy.org/view-share-video/The+Skill+Of+Making+Disciples\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Preview teaching on the threashing floor', 1, 1, '2012-02-07 09:25:16', '2012-03-27 18:26:47'),
