(830, 'The Simplicity of the Oneness of God in Scriptures', 'The Simplicity of the Oneness of God in Scriptures', 'Through studying the scriptures in the Old and New Testaments, the story of creation, and the baptismal commandment, the oneness nature of God is clearly presented to us. ', '1328718243Oneness_-_draft[1][1].doc', 'http://apostolictoolbox.s3.amazonaws.com/charlottechan.tj/The-Simplicity-of-the-Oneness-of-God-in-Scriptures-1328718243Oneness_-_draft[1][1].doc', '35328', 42, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-08 08:24:03', '2012-02-08 18:42:14'),
(831, 'Integrity: The Courage to Meet the Demands of Reality', 'Integrity: The Courage to Meet the Demands of Reality', 'While we believe that integrity is important, we often donâ€™t connect the dots with how integrity of character works on a day-to-day basis, and how it has a real impact on the areas\r\nof life which matter most to us. In Integrity, we will look at six areas of character that will bring you results you havenâ€™t been able to obtain. Together, these character traits will enable\r\nyour talents and abilities to bring you the results that you know you should be getting, but sometimes arenâ€™t.', '1328780655Integrity_Final.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Integrity:-The-Courage-to-Meet-the-Demands-of-Reality-1328780655Integrity_Final.pdf', '163580', 0, 1, 'pdf', 16, 1, NULL, NULL, 1, 1, '2012-02-09 01:44:15', NULL),
