(836, 'Buy-In', 'Buy-In', 'So, you believe in a good idea. You\'re convinced it is needed badly, and needed now. But, you can\'t make it happen on your own. You need support in order to implement it and make things better. You or your allies present the plan. You present it well. Then, along with thoughtful issues being raised, come the confounding questions, inane comments, and verbal bulletsâ€”either directly at you or, even worse, behind your back. It matters not that the idea is needed, insightful, innovative, and logical. It matters not if the issues involved are extremely important to a business, an individual, or even a nation. The proposal is still shot down, or accepted but without sufficient support to achieve all of its true benefits, or slowly dies a sad death. What do you do?', '1328846628Buy_In.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Buy-In-1328846628Buy_In.pdf', '394076', 0, 1, 'pdf', 34, 1, NULL, NULL, 1, 1, '2012-02-09 20:03:48', '2012-02-09 20:35:35'),
(838, 'Developing the Leaders Around You', 'Developing the Leaders Around You', 'Supremely practical, this book is crammed with strategies that help you effectively transform your dreams into reality by building up your people. Emphasizing that your organization can\'t grow until its members grow, Dr. Maxwell encourages you to identify and train potential leaders. You\'ll learn how to foster productive team spirit, how to make difficult decisions, what to look for in promising leaders, and ways to nurture, encourage, and equip people.', '1328847045Developing the Leaders Around You_PRINT.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Developing-the-Leaders-Around-You-1328847045Developing-the-Leaders-Around-You_PRINT.pdf', '409038', 0, 1, 'pdf', 35, 1, NULL, NULL, 1, 1, '2012-02-09 20:10:45', '2012-02-09 20:36:03'),
(839, 'Developing the Leaders Around You', 'Developing the Leaders Around You', 'Supremely practical, this book is crammed with strategies that help you effectively transform your dreams into reality by building up your people. Emphasizing that your organization can\'t grow until its members grow, Dr. Maxwell encourages you to identify and train potential leaders. You\'ll learn how to foster productive team spirit, how to make difficult decisions, what to look for in promising leaders, and ways to nurture, encourage, and equip people.', '1328847045Developing the Leaders Around You.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Developing-the-Leaders-Around-You-1328847045Developing-the-Leaders-Around-You.pdf', '515233', 0, 1, 'pdf', 35, 1, NULL, NULL, 1, 1, '2012-02-09 20:10:45', NULL),
(840, 'Developing the Leader Within You', 'Developing the Leader Within You', 'Whether you find yourself leading 2 people or 200, you feel the responsibility of training them to achieve all that they are capable of becoming.\r\n\r\nIn this summary, Dr. John C. Maxwell shares his heart for developing exceptional leaders. Timeless principles applied in your life - and the life of your organization - will bring about positive change through personal integrity and self-discipline.', '1328847230DevelopingtheLeaderWithinYou_BIZ.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Developing-the-Leader-Within-You-1328847230DevelopingtheLeaderWithinYou_BIZ.pdf', '459184', 0, 1, 'pdf', 35, 1, NULL, NULL, 1, 1, '2012-02-09 20:13:50', '2012-02-09 20:32:35'),
(841, 'Getting Things Done', 'Getting Things Done', 'This groundbreaking work-life management system transforms personal overwhelm and overload into an integrated system of stress-free productivity. Whether you are an executive, student, or run a business and/or household, GTD will teach you the tips and tricks of how to get--and stay--on top of it all.\r\n\r\nThe summary will give you an overview of the principles, practical advice and coaching on implementing yourself through the process, and insights into why it works.', '1328847567gettingthingsdone.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Getting-Things-Done-1328847567gettingthingsdone.pdf', '453554', 0, 1, 'pdf', 36, 1, NULL, NULL, 1, 1, '2012-02-09 20:19:27', '2012-02-09 20:31:09'),
(842, 'How to Work with Just About Anyone: A 3-Step Solution for Getting Difficult People to Change', 'How to Work with Just About Anyone: A 3-Step Solution for Getting Difficult People to Change', 'Every office has them: the ever-complaining colleague...the co-worker who is constantly late for meetings...the boss who either blows up at you or blows you off...or the one person who drives everyone else totally crazy.\r\n\r\nThe problem is, the conventional methods -- like repeated warnings, threats, and heartfelt discussions -- for dealing with this negative behavior often don\'t seem to work. Drawing on a wealth of professional experience as well as forty years of research, Lucy Gill exposes the futility of these common practices and replaces them with a three-step strategy for creating a productive, conflict-free workplace:\r\n\r\n1. Get to the heart of the matter by focusing on what the real problem is.\r\n\r\n2. Determine what problem-solving methods to avoid so that you don\'t perpetuate the conflict.\r\n\r\n3. Choose a different and even surprising approach that will solve the problem and keep it solved.\r\n\r\nWhether you\'re just starting out in your career or you already have an office along the executive corridor, How to Work with Just About Anyone provides the key to success, satisfaction, and sanity in the workplace.', '1328847999HowToWorkWithJustAboutAnyone_BIZ.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Work-with-Just-About-Anyone:-A-3-Step-Solution-for-Getting-Difficult-People-to-Change-1328847999HowToWorkWithJustAboutAnyone_BIZ.pdf', '77649', 0, 1, 'pdf', 37, 1, NULL, NULL, 1, 1, '2012-02-09 20:26:39', '2012-02-09 20:30:39'),
(843, 'Leadership and Self-Deception: Getting out of the Box', 'Leadership and Self-Deception: Getting out of the Box', 'Leadership and Self-Deception uses an entertaining story about an executive facing challenges at work and at home to expose the precise psychological processes that conceal our true motivations and intentions from us and trap us in a â€œboxâ€ of endless self-justification. Most importantly, it shows us the way out.\r\n\r\nDrawing on the extensive correspondence theyâ€™re received over the years the authors have added a section that outlines the many ways that readers have been using Leadership and Self-Deception, focusing on five specific areas: hiring, team-building, conflict resolution, accountability, and personal growth and development.', '1328850440LeadershipandSelfDeception.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Leadership-and-Self-Deception:-Getting-out-of-the-Box-1328850440LeadershipandSelfDeception.pdf', '161623', 0, 1, 'pdf', 38, 1, NULL, NULL, 1, 1, '2012-02-09 21:07:20', '2012-02-09 21:44:24'),
(844, 'The Idea Generator: Quick and Easy Kaizen', 'The Idea Generator: Quick and Easy Kaizen', 'The goal of this summary is to guide improvement activities throughout the organization: to use creative ideas from all employees to serve both internal and external customers, to unlock the hidden potential of every single employee, and to bring new excitement and joy into the workplace. This summary tells you how to do it. ', '1328850943TheIdeaGenerator.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Idea-Generator:-Quick-and-Easy-Kaizen-1328850943TheIdeaGenerator.pdf', '184373', 0, 1, 'pdf', 40, 1, NULL, NULL, 1, 1, '2012-02-09 21:15:43', NULL),
(845, 'Trust Me: Developing a Leadership Style People Will Follow', 'Trust Me: Developing a Leadership Style People Will Follow', 'n recent years the world has been rocked by catastrophic business failures. The problem isnâ€™t so much obsolete factories, backward technology, complicated logistics, or an indifferent workforce. The problem is leaders who donâ€™t follow the principles proven to build success.\r\n\r\nIn Trust Me: Developing a Leadership Style People Will Follow, two expert business leaders call todayâ€™s emerging leadersâ€“including youâ€“back to the basics. They focus on the timeless principles derived from the teaching of the greatest leader of all time. Youâ€™ll become a better leader as you rediscover the time-tested, positive principles that will work in any leadership situationâ€“in a major corporation, a small business, a volunteer situation, or a church groupâ€¦any context in which you are asked to lead.\r\n\r\nFollowing the principles outlined in this book will enable you to develop trust in yourself, trust in other people, and trust within your team. The result: Healthy organizations that grow future leaders. ', '1328852318TrustMe_BIZ.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Trust-Me:-Developing-a-Leadership-Style-People-Will-Follow-1328852318TrustMe_BIZ.pdf', '96778', 0, 1, 'pdf', 41, 1, NULL, NULL, 1, 1, '2012-02-09 21:38:38', '2012-02-11 08:19:23'),
(846, 'Winning With People: Discover the People Principles that Work for You Every Time', 'Winning With People: Discover the People Principles that Work for You Every Time', 'Ask the successful CEOs of major corporations, entrepreneurs, top salespeople, and pastors what characteristic is most needed for success in leadership positions, and they\'ll tell you-it\'s the ability to work with people.\r\n\r\nSome people are born with great relationship skills, but those who are not can learn to improve them. In Winning with People Maxwell has translated decades of experience into 25 People Principles that anyone can learn.\r\n\r\nMaxwell has divided the People Principles according to the questions we must ask ourselves if we want to win with people:\r\n\r\n    Readiness: Are we prepared for relationships?\r\n    Connection: Are we willing to focus on others?\r\n    Trust: Can we build mutual trust?\r\n    Investment: Are we willing to invest in others?\r\n    Synergy: Can we create a win-win relationship?\r\n\r\nEach section contains guiding People Principles. Some are intuitive, such as The Lens Principle: Who We Are Determines How We See Others. Others may go against your instincts, such as The Confrontation Principle: Caring for People Should Precede Confronting People. All of them are 100 percent practical!\r\n', '1328852596WinningWithPeople.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Winning-With-People:-Discover-the-People-Principles-that-Work-for-You-Every-Time-1328852596WinningWithPeople.pdf', '409755', 0, 1, 'pdf', 35, 1, NULL, NULL, 1, 1, '2012-02-09 21:43:16', NULL),
(847, 'The Church in the Wilderness', 'The Church in the Wilderness', 'If you could find a perfect plan from which to build your life and business, would you use it? Then you need a Bible plan. God\'s Word gives you control when you discipline yourself to obey it. You do not control it with self-will, but you control it by being obedient to the Word and letting it perform. If you use God\'s plan, He will be your partner in all you do.', '1328853336The Church in the Wilderness.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Church-in-the-Wilderness-1328853336The-Church-in-the-Wilderness.pdf', '9296840', 0, 1, 'pdf', 43, 1, NULL, NULL, 1, 1, '2012-02-09 21:55:36', '2012-02-10 00:00:14'),
(848, 'Baptism in the Name of Jesus', 'Baptism in the Name of Jesus', 'This study expounds on Baptism in Jesus Name with various supporting scriptures.', '1328853594Baptism in the Name of Jesus.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Baptism-in-the-Name-of-Jesus-1328853594Baptism-in-the-Name-of-Jesus.doc', '51200', 0, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-02-09 21:59:54', NULL),
(849, 'Baptism in the name of Jesus ', 'Baptism in the name of Jesus ', 'Let\'s talk about the importance of the name of Jesus. After all, every god is distinguished by its name. If ANY name will save you, then the name of Jesus would not be important. But if names count, we need to know. ', '1328853741Baptism in the name of jesus Ken Raggio.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Baptism-in-the-name-of-Jesus--1328853741Baptism-in-the-name-of-jesus-Ken-Raggio.doc', '52224', 0, 1, 'doc', 44, 1, NULL, NULL, 1, 1, '2012-02-09 22:02:21', NULL),
(850, 'The Wrong Mystery', 'The Wrong Mystery', 'PI Oneness of God Essay\r\n\r\nThe universal acceptance of the trinity doctrine as â€œa mysteryâ€ is the folly of a great majority of Christian circles as they have failed to truly understand the simple truth in Colossians 1:26, â€œthe mystery that has been kept hidden for ages and generations, but is now disclosed to the saints.â€ Many Christians have actually questioned the validity of the trinity doctrine when the Oneness of God is explained by the Apostle Paul in Colossians 1:19, â€œFor God was pleased to have all his fullness dwell in him, and through him to reconcile to himself all things, whether things on earth or things in heaven, by making peace through his blood, shed on the cross.â€ The man-made doctrine of the trinity displaces the revelation of the true mystery of godliness and thus misses the simplicity of the one true God choosing to robe Himself in flesh to save our souls from eternal damnation.', '13288594843301, The Wrong Mystery_June_FINAL.doc', 'http://apostolictoolbox.s3.amazonaws.com/clay.sojourner/The-Wrong-Mystery-13288594843301,-The-Wrong-Mystery_June_FINAL.doc', '49664', 43, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-09 23:38:04', '2012-02-09 23:48:03'),
(851, 'The History of the Bible', 'The History of the Bible', 'This is a short lesson answering the question \"How did the English Bible come into our hands today?\". We will trace back from Ancient times through the Middle Ages up till our Modern Era how this wonderful book was divinely orchestrated by God to reach our hands today. \r\n\r\n\"My people will be destroyed because they have no knowledge... \" (Hosea 4:6)\r\n', '1328859741History of the Bible.docx', 'http://apostolictoolbox.s3.amazonaws.com/samuel/The-History-of-the-Bible-1328859741History-of-the-Bible.docx', '3181946', 27, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-09 23:42:21', '2012-02-09 23:44:19'),
