(858, 'What\'s Wrong with the Name of Jesus?', 'What\'s Wrong with the Name of Jesus?', 'There are many who cite and use the name of Jesus for several ceremonies and purposes, except for Baptism.', '1328863867what wrong with that name.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/What\'s-Wrong-with-the-Name-of-Jesus?-1328863867what-wrong-with-that-name.doc', '50688', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-10 00:51:07', NULL),
(859, 'Works Vs Obedience', 'Works Vs Obedience', 'There seems to be some confusion (from the author of confusion) concerning faith and works. Many confuse obedience with works. Here is a clear example of how man benefits from God\'s works by OBEDIENCE. ', '1328868829Works vs obedience.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Works-Vs-Obedience-1328868829Works-vs-obedience.doc', '26112', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-10 02:13:49', NULL),
(860, 'An Unchangeable Balance', 'An Unchangeable Balance', 'PI Essay - The importance of a balanced ministry of the Word and Spirit', '1328926844Final Essay.pdf', 'http://apostolictoolbox.s3.amazonaws.com/yeotaiyi/An-Unchangeable-Balance-1328926844Final-Essay.pdf', '84388', 37, 1, 'pdf', 47, 1, NULL, NULL, 1, 1, '2012-02-10 18:20:44', '2012-02-11 08:01:51'),
(862, '1 Expanding the Vision', '1 Expanding the Vision', 'What we see with our natural eye matters, because God designed the human body to go where weâ€™re looking. Vision is direction setting and more than any of the five senses, enables us to make right decisions. \r\n\r\nThe first arrow we are going to teach on tonight is the Arrow of an Expanded Spiritual Vision. This arrow is first because it enables all the others. Itâ€™s extremely important that you do not confuse spiritual vision with natural vision. As important as our natural vision is, it does not equal the importance of our spiritual vision!\r\n', '13289774171- Expanding the Vision.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/1-Expanding-the-Vision-13289774171--Expanding-the-Vision.doc', '97792', 0, 1, 'doc', 31, 1, '<iframe width=\"560\" height=\"210\" src=\"http://tabjoy.org/view-share-video/An+Expanded+Vision\" frameborder=\"0\" allowfullscreen></iframe>\r\n', '', 1, 1, '2012-02-11 08:23:37', '2012-03-26 11:47:08'),
(863, '2 The Prayer Closet', '2 The Prayer Closet', 'Life is made up of foundational laws and principles. In the Kingdom of God, there is nothing more foundational than prayer. In the Kingdom of God, there is NO substitute for consistent daily prayer. Because of these two factors, your personal prayer closet is your most important place and must not be substituted by anything! ', '13289777972- The Prayer Closet.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/2-The-Prayer-Closet-13289777972--The-Prayer-Closet.doc', '99328', 0, 1, 'doc', 31, 1, '<iframe width=\"560\" height=\"340\" src=\"http://tabjoy.org/view-share-video/A+Passion+To+Pray\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Preview teaching on the prayer closet', 1, 1, '2012-02-11 08:29:57', '2012-03-27 18:23:21'),
(864, '4 Spirit-Lead Leadership', '4 Spirit-Lead Leadership', 'It has been said by many that everything rises and falls on leadership. That statement continues to prove itself true in every aspect of life. It is true in government, in business, in sports and in family life; it is especially true in the church at every level. \r\n\r\nUltimately, any organized effort and its ability to succeed will be determined by its decision makers and those who lead it. Decisions, not Godâ€™s will, determine destiny. Godâ€™s word proves this to be true. How desperately we need the leadership of the Holy Ghost to guide us in every decision we make!\r\n', '13289779704- Spirit- Led Leadership I.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/4-Spirit-Lead-Leadership-13289779704--Spirit--Led-Leadership-I.doc', '113664', 0, 1, 'doc', 31, 1, NULL, NULL, 1, 1, '2012-02-11 08:32:50', '2012-02-11 09:03:27'),
(865, '5 The Government of God', '5 The Government of God', 'In our quest and efforts to find ways to effectively reach this current generation of 7 billion people, we must never forget that God has given us a standard that everything we do must be measured by. Everything we areâ€¦ every method or program we useâ€¦ every doctrine we preach or teachâ€¦ every process or procedure we followâ€¦ every governing rule or standard we use in the church to guide what we doâ€¦ must be measured as right or wrong, good or bad, by the Holy Word of God! Let God be true and EVERY MAN be a liar! ( Romans 3:4) ', '1328978041The Government of God- 5.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/5-The-Government-of-God-1328978041The-Government-of-God--5.doc', '192929', 0, 1, 'doc', 31, 1, NULL, NULL, 1, 1, '2012-02-11 08:34:01', NULL),
(866, '6. The Ephesus Model', '6. The Ephesus Model', 'Evangelism was never meant to merely be a program in the church done by a few faithful people. Evangelism is the very reason the church exists.  I sincerely believe, that in these last days, our passion for evangelism will be the thing that identifies the apostolic believers more than anything else! \r\n\r\nThe 21st Century church faces unprecedented challenges as move closer to the coming of Lord. \r\n', '13289781206- The Ephesus Model.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/6.-The-Ephesus-Model-13289781206--The-Ephesus-Model.doc', '95232', 0, 1, 'doc', 31, 1, NULL, NULL, 1, 1, '2012-02-11 08:35:20', NULL),
