(870, 'The Successful Christian', 'The Successful Christian', 'Someone better tie success and the spiritual together.\r\n\r\nThe rest of the world sits off skeptically observing. That percentage (probably more than half of the people) won\'t buy success principles which fail to relate to the spiritual side of Life, and they want nothing to do with a Christianity that can\'t tell them how to be successful.\r\n\r\nGod, are you interested or not interested in my being successful? Voices are coming at me from every side. I\'m coming apart at the seams. I\'ve got to know!\r\n', '1329205395The Successful Christian.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Successful-Christian-1329205395The-Successful-Christian.doc', '70656', 0, 1, 'doc', 48, 1, NULL, NULL, 1, 1, '2012-02-13 23:43:15', NULL),
