(885, 'Leadership: What\'s It All About', 'Leadership: What\'s It All About', 'What is leadership? That is a tough question. \r\n\r\nThe dictionary tells us a leader is someone with the capacity or ability to lead, someone who fills the position or office of leader. The Bible uses a number of terms to describe these positions or offices- ruler, chief, prince, magistrate, governor, judge, guide, captain, and noble are just a few.  \r\n\r\nBut because someone holds this office or has these responsibilities, is that person a leader? The general sensed there was more to it than that.', '1329222310Leadership, What\'s It All About.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Leadership:-What\'s-It-All-About-1329222310Leadership,-What\'s-It-All-About.doc', '30720', 0, 1, 'doc', 53, 1, NULL, NULL, 1, 1, '2012-02-14 04:25:10', NULL),
(886, 'Releasing Lay People', 'Releasing Lay People', 'We are living in a time of spiritual awakening. Worldwide church growth statistics are impressive. In the West there is great interest in church growth and power evangelism. \r\n\r\nBut for this awakening to continue and grow, every Christian must be equipped and released to minister. This sheds more light on this topic.\r\n', '1329222794Releasing Lay People.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Releasing-Lay-People-1329222794Releasing-Lay-People.doc', '47104', 0, 1, 'doc', 54, 1, NULL, NULL, 1, 1, '2012-02-14 04:33:14', NULL),
(887, 'Moses as a Leader: A Biblical Model', 'Moses as a Leader: A Biblical Model', 'This is study on Leadership based on the Biblical model of Moses.', '1329223764Moses as a Leader - A Biblical Model.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Moses-as-a-Leader:-A-Biblical-Model-1329223764Moses-as-a-Leader---A-Biblical-Model.doc', '58880', 0, 1, 'doc', 55, 1, NULL, NULL, 1, 1, '2012-02-14 04:49:24', NULL),
(888, '\"Who Sharpens Them? The Need For Accountability Relationships Among Leaders\"', '\"Who Sharpens Them? The Need For Accountability Relationships Among Leaders\"', 'Who \"sharpens\" them? Who helps the leaders of the body of\r\nChrist keep their \"keen edge\", both their doctrinal and ethical\r\npurity? \r\n\r\nIs it possible that, in many cases, there is no one?', '1329224983Who Sharpens Them - The Need For Accountability Relationships Among Leaders.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/\"Who-Sharpens-Them?-The-Need-For-Accountability-Relationships-Among-Leaders\"-1329224983Who-Sharpens-Them---The-Need-For-Accountability-Relationships-Among-Leaders.doc', '35840', 0, 1, 'doc', 56, 1, NULL, NULL, 1, 1, '2012-02-14 05:09:43', NULL),
(889, 'Imperative Leadership', 'Imperative Leadership', 'The word imperative is defined as obligatory, mandatory, and very necessary. In church life today there is no issue more critical than leadership training and this lesson shares more about it.\r\n', '1329225282Imperative Leadership.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Imperative-Leadership-1329225282Imperative-Leadership.doc', '34816', 0, 1, 'doc', 57, 1, NULL, NULL, 1, 1, '2012-02-14 05:14:42', NULL),
(890, 'Turn Your Failures into Stepping Stones', 'Turn Your Failures into Stepping Stones', 'When you think of \"failure\" in ministry, what kind of person comes to mind? Have you considered the idea that people whom you think successful have often failed the most?\r\n\r\nWe don\'t usually hear about the failures of those we admire most, but rest assured that they have attempted lots of things that didn\'t work. They keep running the risk. They try and try until they get through. Then they tell you what they\'ve learned.\r\n', '1329226283Turn Your Failures into Stepping Stones.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Turn-Your-Failures-into-Stepping-Stones-1329226283Turn-Your-Failures-into-Stepping-Stones.doc', '34816', 0, 1, 'doc', 58, 1, NULL, NULL, 1, 1, '2012-02-14 05:31:23', NULL),
(891, 'Goal Setting: Ticket to Anywhere', 'Goal Setting: Ticket to Anywhere', 'As set forth in the preface of this book, one of the mysteries of mankind is that we find 20 percent of the people in practically every line of endeavor responsible for 80 percent of the constructive activities of this life and the other 80 percent responsible for the remaining 20 percent.\r\n\r\nWhy are some people creators of circumstances and others, with equal opportunity, only creatures of circumstances? Why do things happen to some people and why is it that others happen to things?\r\n\r\nThis study will assist you in understanding this great mystery of life. \r\n', '1329229009Goal Setting, Ticket to Anywhere.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Goal-Setting:-Ticket-to-Anywhere-1329229009Goal-Setting,-Ticket-to-Anywhere.doc', '59904', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-14 06:16:49', '2012-02-14 06:29:20');
