(892, 'Great Souls Have Wills', 'Great Souls Have Wills', 'This lesson talks about Willpower and setting goals.', '1329229398Great Souls Have Wills.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Great-Souls-Have-Wills-1329229398Great-Souls-Have-Wills.doc', '41472', 0, 1, 'doc', 59, 1, NULL, NULL, 1, 1, '2012-02-14 06:23:18', '2012-02-14 06:29:30'),
(893, 'Goal Setting in the Work of God', 'Goal Setting in the Work of God', 'Why Should We Plan?\r\n\r\nMost people want to see their church succeed-succeed in terms of carrying out God\'s work to the greatest possible degree. They want to do good work. They want to contribute to the church\'s progress in the most meaningful and rewarding manner possible.\r\n\r\nYet some churches are more successful than others in carrying out their mission. Why? While there are probably several answers to this question, two are particularly significant to planning.\r\n\r\nThey involve how we use our time and how we plan and organize our efforts.These are interrelated.\r\n', '1329229737Goal Setting in the Work of God.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Goal-Setting-in-the-Work-of-God-1329229737Goal-Setting-in-the-Work-of-God.doc', '33792', 0, 1, 'doc', 60, 1, NULL, NULL, 1, 1, '2012-02-14 06:28:57', NULL),
(894, '7 Characteristics of Effective Leaders', '7 Characteristics of Effective Leaders', 'This study explores Ephesians 4:11 and shares the 7 characteristics of an effective Leader. ', '13292300607 Characteristics of Effective Leaders.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/7-Characteristics-of-Effective-Leaders-13292300607-Characteristics-of-Effective-Leaders.doc', '26624', 0, 1, 'doc', 61, 1, NULL, NULL, 1, 1, '2012-02-14 06:34:20', NULL),
(895, 'Don\'t Sink Your Boat', 'Don\'t Sink Your Boat', 'Even though we are born again, Spirit-filled, tongue-talkng, we can be flat ugly if we want to! We can do things ourselves to sink our own boat! We ran hinder our own success, we can sabotage our own walk with the Lord Jesus Christ, putting holes in our own boats. We can get in God\'s way and not walk in the victory that is already provided for us.\r\n\r\nLet\'s examine a few ways to sink our boat, and let\'s patch some holes!\r\n', '1329230376Don\'t Sink Your Boat.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Don\'t-Sink-Your-Boat-1329230376Don\'t-Sink-Your-Boat.doc', '51712', 0, 1, 'doc', 62, 1, NULL, NULL, 1, 1, '2012-02-14 06:39:36', NULL),
(896, 'To Help You Better Manage Your Business Affairs', 'To Help You Better Manage Your Business Affairs', 'This lesson helps to show us how to better manage your business affairs.', '1329230926To Help You Better Manage Your Business Affairs.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/To-Help-You-Better-Manage-Your-Business-Affairs-1329230926To-Help-You-Better-Manage-Your-Business-Affairs.doc', '27648', 0, 1, 'doc', 64, 1, NULL, NULL, 1, 1, '2012-02-14 06:48:46', NULL),
(897, 'Characteristics of an Effective Leader', 'Characteristics of an Effective Leader', 'This study shows the characteristics of an Effective through the eyes of John Maxwell.', '1329232225Characteristics of an Effective Leader.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Characteristics-of-an-Effective-Leader-1329232225Characteristics-of-an-Effective-Leader.doc', '26112', 0, 1, 'doc', 35, 1, NULL, NULL, 1, 1, '2012-02-14 07:10:25', NULL),
(898, 'Staying Motivated in Christian Service', 'Staying Motivated in Christian Service', 'This lesson shows us how to stay motivated in the christian service.', '1329232673Staying Motivated in Christian Service.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Staying-Motivated-in-Christian-Service-1329232673Staying-Motivated-in-Christian-Service.doc', '80896', 0, 1, 'doc', 48, 1, NULL, NULL, 1, 1, '2012-02-14 07:17:53', NULL),
(899, 'Excitement in Christian Service', 'Excitement in Christian Service', 'Marcus Aurelius said, \"A man\'s Life is what his thoughts\r\nmake it.\" The Bible says \"As a man thinketh in his heart, so is\r\nhe.\" \r\n\r\nCan you even dare to dream what might happen if you were to\r\nbegin getting excited in your thinking?\r\n', '1329233397Excitement in Christian Service.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Excitement-in-Christian-Service-1329233397Excitement-in-Christian-Service.doc', '39936', 0, 1, 'doc', 48, 1, NULL, NULL, 1, 1, '2012-02-14 07:29:57', NULL),
(900, 'Leadership that Lifts', 'Leadership that Lifts', 'This lesson shares with us on effective and motivational leadership in based on the Word of God', '1329233626Leadership that Lifts.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Leadership-that-Lifts-1329233626Leadership-that-Lifts.doc', '35840', 0, 1, 'doc', 65, 1, NULL, NULL, 1, 1, '2012-02-14 07:33:46', NULL),
(901, 'Do it Now!', 'Do it Now!', 'This is a short excerpt from \"Total Church Growth\".', '1329234051Do it Now.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Do-it-Now!-1329234051Do-it-Now.doc', '51200', 0, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-02-14 07:40:51', NULL),
(902, 'Frustration and What to do About It', 'Frustration and What to do About It', 'This lesson talks about Frustration and how to handle it.', '1329235023Frustration and What to do About It.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Frustration-and-What-to-do-About-It-1329235023Frustration-and-What-to-do-About-It.doc', '78336', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-14 07:57:03', NULL),
(903, 'Get Up and Try Again!', 'Get Up and Try Again!', 'How do you help people who are down to get up and try again?  All of us have been there and will no doubt be there again. This lesson helps us understand more.', '1329235994Get Up and Try Again.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Get-Up-and-Try-Again!-1329235994Get-Up-and-Try-Again.doc', '29696', 0, 1, 'doc', 66, 1, NULL, NULL, 1, 1, '2012-02-14 08:13:14', '2012-03-21 12:25:34'),
(904, 'Positive Thinking for Christian Leaders', 'Positive Thinking for Christian Leaders', 'The first idea of positive thinking did not come from Norman Vincent Peale, Napolean Hill, John Haggai, Calude M. Bristol, or Robert H. Schuller, although these are all great writers on the subject, but it came from the wonderful book called the Bible. In every part of life, the Bible is the source of strength and power and all positive ideas. Many things in life are so uncertain, but the Bible is so sure(positive).\r\n', '1329237414Positive Thinking for Christian Leaders.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Positive-Thinking-for-Christian-Leaders-1329237414Positive-Thinking-for-Christian-Leaders.doc', '44544', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-14 08:36:54', NULL),
(905, 'When Opportunity Whispers', 'When Opportunity Whispers', 'Bit by bit, we shape our own lives by choosing what thoughts to dwell on, what words to say, what to do, and what not to do.  These choices form patterns that direct our lifestyles and impact our relationships.  It\'s awesome to realize how much control we have over something so important - our lives!\r\n\r\nAnimals, birds, fish, and plants can\'t make these choices; they only know when and how to function through delicately timed God-given instincts.  But God gave us the great endowment of a free will - a uniquely human ability.  He offers us guidance through his Word but it is our choice whether or not to let him direct our paths.  It\'s a joint venture; his ways are perfect and we choose to follow him. \"...I have set before you life and death, blessing and cursing; therefore, choose life, that both you and your descendants may live\" (Deut. 30:19).  It\'s an opportunity of a lifetime!\r\n', '1329237626When Opportunity Whispers.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/When-Opportunity-Whispers-1329237626When-Opportunity-Whispers.doc', '38912', 0, 1, 'doc', 67, 1, NULL, NULL, 1, 1, '2012-02-14 08:40:26', '2012-02-14 08:40:57'),
(906, 'The Power of Optimism: Positive Faith in Negative Times', 'The Power of Optimism: Positive Faith in Negative Times', 'This short study reflects on the power of positive faith in negative times.', '1329237821The Power of Optimism, Positive Faith in Negative Times.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Power-of-Optimism:-Positive-Faith-in-Negative-Times-1329237821The-Power-of-Optimism,-Positive-Faith-in-Negative-Times.doc', '26624', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-14 08:43:41', NULL),
(907, 'The Call of God', 'The Call of God', 'This lesson explores the topic of the call of God based on Hebrews 5:1-4.', '1329238071The Call of God.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Call-of-God-1329238071The-Call-of-God.doc', '34304', 0, 1, 'doc', 68, 1, NULL, NULL, 1, 1, '2012-02-14 08:47:51', NULL),
(908, 'Involving More Members in Ministry', 'Involving More Members in Ministry', 'This study shows us how to get more members in ministry without burning out those in ministries.', '1329238379Involving More Members in Ministry.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Involving-More-Members-in-Ministry-1329238379Involving-More-Members-in-Ministry.doc', '36352', 0, 1, 'doc', 69, 1, NULL, NULL, 1, 1, '2012-02-14 08:52:59', NULL),
(909, 'Time Management', 'Time Management', 'Time Management is the key in fulfilling God\'s Will for your life,to accomplish what God has ordained for your life - Go For The Gold!!\r\n\r\n\r\nG*0*L*D\r\n\r\n(1) G - Goals\r\n(2) 0 - Organized Priorities\r\n(3) L - Listing Activities\r\n(4) D - Do It Now!\r\n', '1329238615Time Management.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Time-Management-1329238615Time-Management.doc', '43008', 0, 1, 'doc', 70, 1, NULL, NULL, 1, 1, '2012-02-14 08:56:55', NULL),
(910, 'Time Management', 'Time Management', 'This lesson teaches us on making the most of our time.', '1329238826Time Management.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Time-Management-1329238826Time-Management.doc', '29696', 0, 1, 'doc', 71, 1, NULL, NULL, 1, 1, '2012-02-14 09:00:26', NULL),
(911, 'The Ministry Role of the Church Board Member', 'The Ministry Role of the Church Board Member', 'The role of a church board member is a very important ministry in the local church. The greatest challenge for an individual willing to serve in this office is to take care in always considering the â€œWill of Godâ€ for the church.  This is only possible to know through acknowledging God-given leadership designated through the office of Pastor.  Perhaps the major challenge of being a church board member is the fact that it is a true support role.  Never forget this is the work of God, not the work of man.  ', '1329238894Church Board Member Ministry.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Ministry-Role-of-the-Church-Board-Member-1329238894Church-Board-Member-Ministry.doc', '27648', 0, 1, 'doc', 72, 1, NULL, NULL, 1, 1, '2012-02-14 09:01:34', '2012-02-14 09:02:20'),
(912, 'Do it Now! Overcoming Procrastination', 'Do it Now! Overcoming Procrastination', 'This lesson highlights the negative effects of procrastination and the importance of getting things done...now!', '1329239013Do it Now, Overcoming Procrastination.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Do-it-Now!-Overcoming-Procrastination-1329239013Do-it-Now,-Overcoming-Procrastination.doc', '27136', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-14 09:03:33', NULL),
(913, 'Feed our faith and starve our doubts', 'Feed our faith and starve our doubts', 'We made the mistake sometimes thinking that the doubt pushers just did not see the promise land but in this case look they were there but they just simply choose the wrong kind of thinking.', '1329239427FEED OUR FAITH AND STARVE OUR DOUBTS.docx', 'http://apostolictoolbox.s3.amazonaws.com/pastortim/Feed-our-faith-and-starve-our-doubts-1329239427FEED-OUR-FAITH-AND-STARVE-OUR-DOUBTS.docx', '27748', 3, 1, 'docx', 11, 1, NULL, NULL, 1, 1, '2012-02-14 09:10:27', '2012-02-14 09:11:41'),
(914, 'Branding Faith', 'Branding Faith', 'Through his decades in the media industry, Phil has discovered keys to help leaders expand ministry effectively while using the best of contemporary media resources. Branding Faith will impact many with wisdom that will help them maintain substance and integrity in character as they represent the Savior to the masses.', '1329239775Branding_Faith.epub', 'http://apostolictoolbox.s3.amazonaws.com/admin/Branding-Faith-1329239775Branding_Faith.epub', '443896', 0, 1, 'epub', 73, 1, NULL, NULL, 1, 1, '2012-02-14 09:16:15', '2012-02-14 09:18:06'),
(915, 'God\'s Armor Bearer 3', 'God\'s Armor Bearer 3', 'Not forsaking the assembling of ourselves together, as is the manner of some, but exhorting one another, and so much the more as you see the Day approaching (Hebrews 10:25).\r\nThe definition of the word forsaking is â€œto desert or leave.â€ People desert the local church for many reasons:\r\nThey are offended.\r\nThey are rebellious and cannot submit to spiritual authority.\r\nThey have allowed the spirit of the world to be a stronger influence in their lives than the Spirit of God.\r\nThey have been under abusive spiritual authority.\r\nIn most cases, these deserters have backslidden and most donâ€™t even know it. I accept the fact that there are some legitimate reasons why people have left a particular church. I also realize that there are some leaders who are so controlling that they end up hurting and abusing Godâ€™s people. In this book I am not dealing with these abusive situations. I am dealing with people who cannot submit their lives into the biblically-ordained care of another. They may not see themselves this way, but they are deserters of the faith because they have no accountability in their lives. They lead a life totally ruled by circumstances, feelings, emotions, and ultimately, satan.', '1329240346God\'s Armor Bearer_ Running with Your Pa - Terry Nance.epub', 'http://apostolictoolbox.s3.amazonaws.com/admin/God\'s-Armor-Bearer-3-1329240346God\'s-Armor-Bearer_-Running-with-Your-Pa---Terry-Nance.epub', '2125480', 0, 1, 'epub', 0, 1, NULL, NULL, 1, 1, '2012-02-14 09:25:46', '2012-02-17 08:33:52'),
(916, 'Consolidate', 'Consolidate', 'Just because there\'s lots of activity doesn\'t mean there\'s lots of fruit. \r\n\r\nAs you grow, it proliferates branches. We add more. We seldom cut back, but just keep on adding. And my, are we busy. \r\n\r\nFinally, God has to come to us in a forceful way and say, \r\n\r\n\"It\'s time to cut back and slow down.\"\r\n\r\nIt is time to consolidate!\r\n\r\nThe same kind of thing happens with individuals. \r\n', '1329241125consolidate.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Consolidate-1329241125consolidate.doc', '67072', 0, 1, 'doc', 11, 1, NULL, NULL, 1, 1, '2012-02-14 09:38:45', NULL),
