(1129, 'The State of Evangelism in America', 'The State of Evangelism in America', 'This article shares about the state of evangelism in America.', '1329374926The State of Evangelism in America.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-State-of-Evangelism-in-America-1329374926The-State-of-Evangelism-in-America.doc', '38912', 0, 1, 'doc', 78, 1, NULL, NULL, 1, 1, '2012-02-15 22:48:46', NULL),
(1130, 'The Unchurched American', 'The Unchurched American', 'This study was the first major investigation into the values, interests and backgrounds of the unchurched in America. It covered a wide range of factors related to churchlessness, including basic matters of beliefs, life-styles, upbringing, training and social/interpersonal relations. Are people unchurched by choice or do they feel excluded? Are some people just \"unreachable\"? What are the best ways to reach them?', '1329375332The Unchurched American.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Unchurched-American-1329375332The-Unchurched-American.doc', '40960', 0, 1, 'doc', 79, 1, NULL, NULL, 1, 1, '2012-02-15 22:55:32', NULL),
(1140, 'Breaking the 200 Barrier', 'Breaking the 200 Barrier', 'This article, however, is for those who desire that their small church becomes larger. It might not necessarily become a superchurch, but perhaps a goal of 500 or so would be something that would please God.\r\n\r\nSo Let\'s analyze the 200 barrier itself and list some of the important steps to take in breaking it.\r\n', '1329381417Breaking the 200 Barrier.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Breaking-the-200-Barrier-1329381417Breaking-the-200-Barrier.doc', '35840', 0, 1, 'doc', 77, 1, NULL, NULL, 1, 1, '2012-02-16 00:36:57', NULL),
(1139, 'Building An Evangelistic Church', 'Building An Evangelistic Church', 'This lesson teaches us on what is needed to build an evangelistic church.', '1329380324Building An Evangelistic Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Building-An-Evangelistic-Church-1329380324Building-An-Evangelistic-Church.doc', '30208', 0, 1, 'doc', 80, 1, NULL, NULL, 1, 1, '2012-02-16 00:18:44', NULL),
(1138, 'Apostolic Keys to Church Growth', 'Apostolic Keys to Church Growth', 'This lesson provides us with the apostolic keys to church growth.', '1329380126Evangelism Through Church Planting.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Apostolic-Keys-to-Church-Growth-1329380126Evangelism-Through-Church-Planting.doc', '51200', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-16 00:15:26', '2012-02-16 00:19:12'),
(1141, 'Church Growth Through Prayer and Worship', 'Church Growth Through Prayer and Worship', 'This lesson highlights how church growth can take place through prayer and worship.', '1329382618Church Growth Through Prayer and Worship.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Church-Growth-Through-Prayer-and-Worship-1329382618Church-Growth-Through-Prayer-and-Worship.doc', '61440', 0, 1, 'doc', 81, 1, NULL, NULL, 1, 1, '2012-02-16 00:56:58', NULL),
(1142, 'The Practical and Spiritual Aspects of Consistent Revival', 'The Practical and Spiritual Aspects of Consistent Revival', 'This lesson teaches the various practical and spiritual aspects of consistent revival.', '1329383906The Practical and Spiritual Aspects of Consistent Revival.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Practical-and-Spiritual-Aspects-of-Consistent-Revival-1329383906The-Practical-and-Spiritual-Aspects-of-Consistent-Revival.doc', '41472', 0, 1, 'doc', 82, 1, NULL, NULL, 1, 1, '2012-02-16 01:18:26', NULL),
(1143, 'The Price of Growth', 'The Price of Growth', 'This article illustrates the price of growth in church.', '1329384152The Price of Growth.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Price-of-Growth-1329384152The-Price-of-Growth.doc', '35840', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-16 01:22:32', NULL),
(1144, 'Creating a Growth Climate', 'Creating a Growth Climate', 'Undoubtedly, growth is of God. \r\n\r\nA Swiss professor has calculated that if nothing hindered, a single grain of wheat in only eight years could sufficiently multiply to feed all the inhabitants of the earth for a year. Growth is the natural process of life. It is true in the plant kingdom, it is signally true in God\'s kingdom. \r\n\r\nSo what creates a growth climate?\r\n', '1329385890Creating a Growth Climate.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Creating-a-Growth-Climate-1329385890Creating-a-Growth-Climate.doc', '60416', 0, 1, 'doc', 83, 1, NULL, NULL, 1, 1, '2012-02-16 01:51:30', NULL),
(1145, 'Components of Revival', 'Components of Revival', 'This lesson teaches us the components of revival.', '1329386530Components of Revival.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Components-of-Revival-1329386530Components-of-Revival.doc', '54272', 0, 1, 'doc', 84, 1, NULL, NULL, 1, 1, '2012-02-16 02:02:10', NULL),
(1146, 'General Views of Evangelism', 'General Views of Evangelism', 'This lesson shares some of the general views among people regarding evangelism.', '1329448939General Views of Evangelism.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/General-Views-of-Evangelism-1329448939General-Views-of-Evangelism.doc', '35840', 0, 1, 'doc', 85, 1, NULL, NULL, 1, 1, '2012-02-16 19:22:19', NULL),
(1147, 'Your New Building: Growth Booster or Growth Barrier', 'Your New Building: Growth Booster or Growth Barrier', 'This study reveals to us some of a Pastor\'s secrets of finding success in a building program.', '1329449981Your New Building, Growth Booster or Growth Barrier.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Your-New-Building:-Growth-Booster-or-Growth-Barrier-1329449981Your-New-Building,-Growth-Booster-or-Growth-Barrier.doc', '37376', 0, 1, 'doc', 86, 1, NULL, NULL, 1, 1, '2012-02-16 19:39:41', NULL),
(1148, 'Evangelism in the New Testament Church', 'Evangelism in the New Testament Church', 'This lesson shares with us how the New Testament church went about evangelism.', '1329450586Evangelism in the New Testament Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Evangelism-in-the-New-Testament-Church-1329450586Evangelism-in-the-New-Testament-Church.doc', '59392', 0, 1, 'doc', 50, 1, NULL, NULL, 1, 1, '2012-02-16 19:49:46', NULL),
(1149, 'Holiness Vs Growth', 'Holiness Vs Growth', 'As the title of this article suggests, there appears to be a conflict in some people\'s minds concerning these two vital elements of the Church: holiness and growth. Are these two ideas mutually exclusive? Or, is it possible to have each simultaneously and in equal proportions?\r\n\r\nThe objective of this article is to explore the relationship of holiness and growth. Then, it will be possible to draw some practical and beneficial conclusions that will be applicable to a saint, a church, or an organization of churches.\r\n', '1329451354Holiness Vs Growth.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Holiness-Vs-Growth-1329451354Holiness-Vs-Growth.doc', '87552', 0, 1, 'doc', 87, 1, NULL, NULL, 1, 1, '2012-02-16 20:02:34', NULL),
(1150, '20 Practical Steps to Growing A Church', '20 Practical Steps to Growing A Church', 'This lesson provides us with 20 practical steps to growing a church.', '132945443420 Practical Steps to Growing A Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/20-Practical-Steps-to-Growing-A-Church-132945443420-Practical-Steps-to-Growing-A-Church.doc', '78336', 0, 1, 'doc', 88, 1, NULL, NULL, 1, 1, '2012-02-16 20:53:54', NULL),
(1151, 'The Kind of Preaching Needed in a Revival', 'The Kind of Preaching Needed in a Revival', 'The kind of preaching needed in a revival is of a very specialized nature. It is unique, and in many respects, different from any other kind of preaching. One reason why many evangelists and pastors have not been successful in their evangelistic work is that they have not given due consideration to the kind of preaching that is essential to success in that \r\nkind of work. Many have been of the opinion that almost any kind of preaching would do, providing the gospel was being presented. Careful consideration will demonstrate conclusively that this is not so, but rather, a revival service demands a very exacting and specialized kind of preaching.\r\n\r\nWe trust, however, that the following suggestions may prove helpful, guiding many into a more fruitful evangelistic ministry by assisting them to do the kind of preaching needed \r\nin revival.\r\n', '1329460524The Kind of Preaching Needed in a Revival.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Kind-of-Preaching-Needed-in-a-Revival-1329460524The-Kind-of-Preaching-Needed-in-a-Revival.doc', '60928', 0, 1, 'doc', 89, 1, NULL, NULL, 1, 1, '2012-02-16 22:35:24', NULL),
(1152, '10 Critical Church Growth Issues', '10 Critical Church Growth Issues', 'This study highlights 10 critical church growth issues that we need to take note and look into.', '132946093910 Critical Church Growth Issues.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/10-Critical-Church-Growth-Issues-132946093910-Critical-Church-Growth-Issues.doc', '28160', 0, 1, 'doc', 90, 1, NULL, NULL, 1, 1, '2012-02-16 22:42:19', NULL),
(1153, 'The Kind of a Message needed for Revival', 'The Kind of a Message needed for Revival', 'The article reveals to us just the kind of message that is needed for revival in our time.', '1329462924The Kind of a Message needed for Revival.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Kind-of-a-Message-needed-for-Revival-1329462924The-Kind-of-a-Message-needed-for-Revival.doc', '84480', 0, 1, 'doc', 91, 1, NULL, NULL, 1, 1, '2012-02-16 23:15:24', NULL),
(1154, 'What to do if your Church Isn\'t Growing', 'What to do if your Church Isn\'t Growing', 'This article shares on what are some of the steps we can take if your churches aren\'t growing.', '1329463265What to do if your Church Isn\'t Growing.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/What-to-do-if-your-Church-Isn\'t-Growing-1329463265What-to-do-if-your-Church-Isn\'t-Growing.doc', '27648', 0, 1, 'doc', 92, 1, NULL, NULL, 1, 1, '2012-02-16 23:21:05', NULL),
(1155, 'Factors that Contribute to a Plateaud Church', 'Factors that Contribute to a Plateaud Church', 'Although numerical growth is, admittedly, only line of many measures of a church\'s health, taken in proper context \r\nnumerical growth can serve as an appropriate gauge to evaluate progress or lack thereof.\r\n\r\nThis article examines several basic factors that contribute to the plateau.\r\nphenomenon. Within the discussion of each causal factor is included \r\nsuggested action for avoiding or overcoming the plateau condition. These \r\nelements are interrelated and should be viewed as a family of factors.\r\n\r\n', '1329463594Factors that Contribute to a Plateaud Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Factors-that-Contribute-to-a-Plateaud-Church-1329463594Factors-that-Contribute-to-a-Plateaud-Church.doc', '38912', 0, 1, 'doc', 93, 1, NULL, NULL, 1, 1, '2012-02-16 23:26:34', NULL),
(1156, 'Howard A Goss:  A Pentecostal Life ', 'Howard A Goss:  A Pentecostal Life ', 'This article shares about the origins of the Oneness Pentecostal movement in the early 1900s. ', '1329465276Robin M. Johnston - Howard A Goss, a Pentecostal Life (2010).pdf', 'http://apostolictoolbox.s3.amazonaws.com/pjsilvercross/Howard-A-Goss:--A-Pentecostal-Life--1329465276Robin-M.-Johnston---Howard-A-Goss,-a-Pentecostal-Life-(2010).pdf', '4490378', 5, 1, 'pdf', 95, 1, NULL, NULL, 1, 1, '2012-02-16 23:54:36', '2012-02-17 00:14:28'),
(1157, 'The Super Glue Touch', 'The Super Glue Touch', '', '1329466630The Superglue Touch.doc', 'http://apostolictoolbox.s3.amazonaws.com/graciosa89/The-Super-Glue-Touch-1329466630The-Superglue-Touch.doc', '38912', 6, 1, 'doc', 96, 1, NULL, NULL, 1, 1, '2012-02-17 00:17:10', '2012-02-17 00:31:07'),
(1158, 'The Rebirth of the Church', 'The Rebirth of the Church', 'The good news is that today you can probably finish the Reformation in your church within a year or two - because the ten problems above don\'t have to be solved one by one. \r\n\r\nBy following the New Testament guidelines and opening the \r\nheart of your church to the rank and file, you can eventually.\r\n', '1329470968The Rebirth of the Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Rebirth-of-the-Church-1329470968The-Rebirth-of-the-Church.doc', '169472', 0, 1, 'doc', 94, 1, NULL, NULL, 1, 1, '2012-02-17 01:29:28', NULL),
(1159, 'Growing Churches: What They have in Common', 'Growing Churches: What They have in Common', 'Churches, like people, have personalities. Some are formal, others informal. Some never have met a stranger; others offer a cool reception to newcomers. Growing churches have distinct personalities. Just as members of an extended family share identifiable traits that distinguish them, growing church also bear marked resemblances. \r\n\r\nThe following article shares 10 of the more pronounced similarities.\r\n', '1329471671Growing Churches, What They have in Common.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Growing-Churches:-What-They-have-in-Common-1329471671Growing-Churches,-What-They-have-in-Common.doc', '34304', 0, 1, 'doc', 97, 1, NULL, NULL, 1, 1, '2012-02-17 01:41:11', NULL),
(1160, ' What You Already Know About Church Growth', ' What You Already Know About Church Growth', 'What is the success of church growth?', '1329472037What You Already Know About Church Growth.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/-What-You-Already-Know-About-Church-Growth-1329472037What-You-Already-Know-About-Church-Growth.doc', '29696', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-17 01:47:17', NULL),
