(1177, 'The Key to the House that Leaves No Doubt', 'The Key to the House that Leaves No Doubt', 'Does speaking in tongues signify the indwelling of God\'s spirit?  A through look at Holy Spirit baptism, speaking in tongues, and common questions people have about this wonderful gift.  ', '1329731509The Key.doc', 'http://apostolictoolbox.s3.amazonaws.com/solo7100/The-Key-to-the-House-that-Leaves-No-Doubt-1329731509The-Key.doc', '61952', 33, 1, 'doc', 9, 1, NULL, NULL, 1, 1, '2012-02-20 01:51:49', '2012-02-20 02:10:14'),
(1178, 'The Pentateuch', 'The Pentateuch', 'Purpose Institute Essay on The Pentateuch model', '1329754673The Pentateuch.pdf', 'http://apostolictoolbox.s3.amazonaws.com/cheryl.actsperience/The-Pentateuch-1329754673The-Pentateuch.pdf', '61650', 18, 1, 'pdf', 105, 1, NULL, NULL, 1, 1, '2012-02-20 08:17:53', '2012-02-20 08:58:44'),
(1179, 'A Look at Scoffers', 'A Look at Scoffers', 'A personal study on Scoffers', '1329754802A look at Scoffers.pdf', 'http://apostolictoolbox.s3.amazonaws.com/cheryl.actsperience/A-Look-at-Scoffers-1329754802A-look-at-Scoffers.pdf', '353998', 18, 1, 'pdf', 105, 1, NULL, NULL, 1, 1, '2012-02-20 08:20:02', '2012-02-20 08:57:23'),
(1181, 'How Guilt Can Cause Depression', 'How Guilt Can Cause Depression', 'Depression is Satan\'s number one tool today. If he can\'t get us through outright sin, then he will come in the back door. He\'s sneaky. He will get you depressed, if he can. One of the quickest routes to depression is through guilt. Let\'s take a look at it...', '1329793568How Guilt Can Cause Depression.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-Guilt-Can-Cause-Depression-1329793568How-Guilt-Can-Cause-Depression.doc', '29696', 0, 1, 'doc', 106, 1, NULL, NULL, 1, 1, '2012-02-20 19:06:08', NULL),
(1182, 'The Quiet and Deadly Force', 'The Quiet and Deadly Force', 'Celebrities and addicts alike are drawing our nation\'s attention to the drug problem. Crime is running rampant. Prisons and jails are overflowing as fast as we can build them, and everyone is trembling in fear over AIDS. There is no doubt that illegal drugs are a killer. A big killer.\r\n\r\nBut even while all this is going on, there is a quiet and deadly force that is killing thousands every year. It is legal. ', '1329794312The Quiet and Deadly Force.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Quiet-and-Deadly-Force-1329794312The-Quiet-and-Deadly-Force.doc', '31744', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-20 19:18:32', NULL),
(1183, 'New Convert Visitation Program', 'New Convert Visitation Program', 'When is a person fully assimilated into the life of the\r\nchurch? In some ways the question could be answered \"never,\" but\r\nsuch an answer does not assist congregational leaders in identifying a goal toward which to work.\r\n', '1329795132New Convert Visitation Program.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/New-Convert-Visitation-Program-1329795132New-Convert-Visitation-Program.doc', '37888', 0, 1, 'doc', 107, 1, NULL, NULL, 1, 1, '2012-02-20 19:32:12', '2012-02-20 20:55:34'),
(1184, 'Untimely Birth', 'Untimely Birth', 'There are a lot of babies born into the world that are born prematurely. Their only chance for survival is that they be placed in an oxygen tent, and receive special care for a period of time. Then after this, many of them just simply do not live. When a baby is born prematurely, it is simply the fact that it has not spent enough time in the womb of the mother. We have the same thing today in a spiritual sense.', '1329795320Untimely Birth.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Untimely-Birth-1329795320Untimely-Birth.doc', '26112', 0, 1, 'doc', 108, 1, NULL, NULL, 1, 1, '2012-02-20 19:35:20', '2012-02-20 20:55:17'),
(1185, 'Friends of the Bride', 'Friends of the Bride', 'An Introduction for prospects who need a friend or personal \r\ncontact, to bridge their journey from the world to the establishing of a solid Christian.\r\n', '1329798794Friends of the Bride.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Friends-of-the-Bride-1329798794Friends-of-the-Bride.doc', '30208', 0, 1, 'doc', 109, 1, NULL, NULL, 1, 1, '2012-02-20 20:33:14', '2012-02-20 20:54:51'),
