(1187, '10 Things Every Council Member Should Know About Hospitality and Assimilation', '10 Things Every Council Member Should Know About Hospitality and Assimilation', 'This article shares about 10 Things every council member should know about hospitality and assimilation.', '132980028610 Things Every Council Member Should Know About Hospitality and Assimilation.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/10-Things-Every-Council-Member-Should-Know-About-Hospitality-and-Assimilation-132980028610-Things-Every-Council-Member-Should-Know-About-Hospitality-and-Assimilation.doc', '34816', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-20 20:58:06', NULL),
(1188, 'Sound Advice for New Converts', 'Sound Advice for New Converts', 'Maybe you have been filled with the Holy Ghost a little less than one year, and for the last month or so you have had no feeling and no joy. You cannot seem to pray. You do not know that I have done wrong, but the devil tells you that you have committed the unpardonable sin. You are getting desperate. \r\n\r\nWhat do you do?\r\n', '1329801302Sound Advice.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Sound-Advice-for-New-Converts-1329801302Sound-Advice.doc', '33280', 0, 1, 'doc', 112, 1, NULL, NULL, 1, 1, '2012-02-20 21:15:02', NULL),
(1189, 'Training Together by Common Ground', 'Training Together by Common Ground', 'How do we go about making disciples and not just gathering new converts.', '1329802519Training Together by Common Ground.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Training-Together-by-Common-Ground-1329802519Training-Together-by-Common-Ground.doc', '31232', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-20 21:35:19', NULL),
(1190, 'blind spots of homeschoolers', 'blind spots of homeschoolers', 'The following article was emailed to Sister Melanie Shock who posted it on her blog. She has used this to form principles and many teaching points. \r\n\r\nIt is written to parents, but it is so much more than that. Anyone who pastors or teaches or instructs children and/or parents in any kind of setting needs to read this.\r\n\r\nIt\'s somewhat lengthy, but will be well worth your time. An excellent, thought-provoking article.\r\n\r\n', '1329803058Exposing Major Blind Spots of Homeschoolers by Reb Bradley.docx', 'http://apostolictoolbox.s3.amazonaws.com/samuel/blind-spots-of-homeschoolers-1329803058Exposing-Major-Blind-Spots-of-Homeschoolers-by-Reb-Bradley.docx', '28413', 27, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-20 21:44:18', '2012-02-21 01:13:18'),
