(1200, 'Baptismal Class', 'Baptismal Class', 'This lesson shows us what are some of the things covered in Baptismal class.', '1329807453Baptismal Class.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Baptismal-Class-1329807453Baptismal-Class.doc', '31232', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-20 22:57:33', NULL),
(1201, 'New Convert\'s Course Outline', 'New Convert\'s Course Outline', 'This document is a sample outline to an introduction course for new converts. It includes the purpose of the course, the history of the church, the ministries and leaders, history of the UPC, etc.\r\n', '1329807710New Convert\'s Course Outline.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/New-Convert\'s-Course-Outline-1329807710New-Convert\'s-Course-Outline.doc', '29184', 0, 1, 'doc', 118, 1, NULL, NULL, 1, 1, '2012-02-20 23:01:50', NULL),
(1202, 'How do You Choose an Effective Worship Leader', 'How do You Choose an Effective Worship Leader', 'An effective worship leader often makes the difference between the good church and a great church, just another song service or an uplifting worship experience. Yet there is little taught about this high calling-the ministry of leading worship. This article shares more on choosing the right kind people to lead worship.\r\n', '1329808403How do you choose an Effective Worship Leader.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-do-You-Choose-an-Effective-Worship-Leader-1329808403How-do-you-choose-an-Effective-Worship-Leader.doc', '41984', 0, 1, 'doc', 119, 1, NULL, NULL, 1, 1, '2012-02-20 23:13:23', NULL),
(1203, 'Music and the Revival', 'Music and the Revival', 'Music should occupy a place of great importance in every revival. From the standpoint of the program it is, of course, second only to the evangelistic message in importance. If the musical program is to be truly effective, there are a number of very important matters which need to be kept in mind. This lesson will highlights those points.\r\n', '1329809902Music and the Revival.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Music-and-the-Revival-1329809902Music-and-the-Revival.doc', '43520', 0, 1, 'doc', 89, 1, NULL, NULL, 1, 1, '2012-02-20 23:38:22', NULL),
(1204, 'Material Improvements for Your Choir Robes', 'Material Improvements for Your Choir Robes', 'Is your choir asking for new robes? They probably will sometime, if they aren\'t already, so it\'s good to have the information to help them make a superb selection. Here, then, are some facts to file until the time arrives.', '1329812112Material Improvements for Your Choir Robes.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Material-Improvements-for-Your-Choir-Robes-1329812112Material-Improvements-for-Your-Choir-Robes.doc', '33792', 0, 1, 'doc', 120, 1, NULL, NULL, 1, 1, '2012-02-21 00:15:12', NULL),
(1205, 'Music and the Popular', 'Music and the Popular', 'Nothing is more singular about this generation than its addiction to music. The saturation of music in our modern culture has created a change in the way we listen to music. \r\n\r\nIt is no longer a rare enjoyment where the listener sits in total captivation, absorbing every sound, but it has become an audio addiction-just a backdrop to life, a soother for our fast-paced society. But as we become desensitized to its effect, we require more in the way of variation and novelty to stimulate our emotions and to stir our interest.\r\n\r\nNever has music played such a prevalent role in the church service, nor in the private life of the individual Christian. This article explores its influence in our time.', '1329814244Music and the Popular.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Music-and-the-Popular-1329814244Music-and-the-Popular.doc', '38912', 0, 1, 'doc', 121, 1, NULL, NULL, 1, 1, '2012-02-21 00:50:44', NULL),
(1206, 'Evangelistic Music', 'Evangelistic Music', 'The phrase \"evangelistic music\" is technically a \r\nmisnomer. Music alone may indeed imply a mood, but without \r\naccompanying lyrics, what evangelistic message (or message of any \r\nsort)can ultimately be communicated? \r\n', '1329814753Evangelistic Music.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Evangelistic-Music-1329814753Evangelistic-Music.doc', '37888', 0, 1, 'doc', 122, 1, NULL, NULL, 1, 1, '2012-02-21 00:59:13', NULL),
(1207, 'Philosophy of Worship Ministries', 'Philosophy of Worship Ministries', 'The philosophy of worship describes the way one approaches worship\r\nand includes a thorough analysis of our underlying presuppositions. This article sheds more light on this matter.\r\n', '1329815379Philosophy of Worship Ministries.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Philosophy-of-Worship-Ministries-1329815379Philosophy-of-Worship-Ministries.doc', '62464', 0, 1, 'doc', 123, 1, NULL, NULL, 1, 1, '2012-02-21 01:09:39', NULL),
(1208, 'Spiritual Songs', 'Spiritual Songs', 'This article expounds on worship in church.', '1329815985Spiritual Songs.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Spiritual-Songs-1329815985Spiritual-Songs.doc', '33792', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-21 01:19:45', NULL),
(1209, 'The Music Of The New Millennium', 'The Music Of The New Millennium', 'What is the next generation coming to? What will they do with our precious doctrine? What will happen to our Biblical standards? To our long accepted lifestyles? What will happen to our traditional church structure? What about our beloved organization, where is it headed? And where in the world is this generation going with our MUSIC?\r\n', '1329816658The Music Of The New Millennium.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Music-Of-The-New-Millennium-1329816658The-Music-Of-The-New-Millennium.doc', '32768', 0, 1, 'doc', 124, 1, NULL, NULL, 1, 1, '2012-02-21 01:30:58', NULL),
(1210, 'The Educated Piano Puchase', 'The Educated Piano Puchase', 'Problem: Each year about 150,000 new pianos are sold, and hundreds of thousands of older ones change hands. Yet most people-even many of the twenty million piano players-know little about how a piano works or how to buy one.\r\n\r\nSolution: Information. Here, then, are some of the basics to know when it\'s your turn to buy.\r\n', '1329816837The Educated Piano Puchase.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Educated-Piano-Puchase-1329816837The-Educated-Piano-Puchase.doc', '30720', 0, 1, 'doc', 125, 1, NULL, NULL, 1, 1, '2012-02-21 01:33:57', NULL),
(1211, 'Not Many Fathers', 'Not Many Fathers', 'Explore with Dr. Hanby the relationship of father and son as the foundational connection for all spiritual impartation. As we turn our hearts toward one another, we will recover our heritage of generational blessing and double-portion anointing', '1329879128Not Many Fathers FULL BOOK.docx', 'http://apostolictoolbox.s3.amazonaws.com/samuel/Not-Many-Fathers-1329879128Not-Many-Fathers-FULL-BOOK.docx', '4171140', 27, 1, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-02-21 18:52:08', '2012-02-21 19:50:17'),
