(1218, 'Computerizing Your Musical Staff', 'Computerizing Your Musical Staff', 'Introducing modern technology to improve your music ministry.', '1329893314Computerizing Your Musical Staff.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Computerizing-Your-Musical-Staff-1329893314Computerizing-Your-Musical-Staff.doc', '38400', 0, 1, 'doc', 129, 1, NULL, NULL, 1, 1, '2012-02-21 22:48:34', NULL),
(1219, 'Choir Clinics', 'Choir Clinics', 'Where do you find good teachers for choir clinics? This might help.', '1329893471Chior Clinics.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Choir-Clinics-1329893471Chior-Clinics.doc', '25088', 0, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-02-21 22:51:11', '2012-02-22 01:10:43'),
(1220, 'What Should Motivate a Musical Ministry', 'What Should Motivate a Musical Ministry', 'Pentecostal churches have been both blessed and cursed by their success. The phenomenal growth of many churches has enabled them to minister musically in powerful new ways. A large sanctuary provides a sense of grandeur, an atmosphere conducive to musical productions. The danger lies in the temptation merely to \r\nentertain people while pretending to exalt the Lord.\r\n\r\nThe article defines the right motivation behind a Musical Ministry.', '1329893725What Should Motivate a Musical Ministry.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/What-Should-Motivate-a-Musical-Ministry-1329893725What-Should-Motivate-a-Musical-Ministry.doc', '31232', 0, 1, 'doc', 130, 1, NULL, NULL, 1, 1, '2012-02-21 22:55:25', NULL),
(1221, 'How Do You Recruit and Retain Chior Members?', 'How Do You Recruit and Retain Chior Members?', 'What is the most important quality to look for in a prospective choir member? Ability to sight-read, harmonize or hold pitch? Or is it willingness to follow directions, sing expressively or enunciate clearly?\r\n\r\nThis article highlights the essential traits of a Choir member.\r\n', '1329894379How Do You Recruit and Retain Chior Members.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-Do-You-Recruit-and-Retain-Chior-Members?-1329894379How-Do-You-Recruit-and-Retain-Chior-Members.doc', '31232', 0, 1, 'doc', 131, 1, NULL, NULL, 1, 1, '2012-02-21 23:06:19', NULL),
(1222, 'How Should a Choir Rehersal be Paced?', 'How Should a Choir Rehersal be Paced?', 'This study is useful benchmark for pacing your choir rehearsals.', '1329894610How Should a Choir Rehersal be Paced.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-Should-a-Choir-Rehersal-be-Paced?-1329894610How-Should-a-Choir-Rehersal-be-Paced.doc', '31232', 0, 1, 'doc', 132, 1, NULL, NULL, 1, 1, '2012-02-21 23:10:10', NULL),
(1223, 'Motivating the Choir - Your Secret to Success', 'Motivating the Choir - Your Secret to Success', 'One of the most difficult tasks a minister of music faces is keeping his choir motivated and excited about the ministry of music in the church. We all have suffered through the down cycles in the calendar year.\r\n\r\nSo how do we keep them motivated?', '1329895280Motivating the Choir - Your Secret to Success.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Motivating-the-Choir---Your-Secret-to-Success-1329895280Motivating-the-Choir---Your-Secret-to-Success.doc', '31232', 0, 1, 'doc', 133, 1, NULL, NULL, 1, 1, '2012-02-21 23:21:20', NULL),
(1224, 'The Musician and the Church', 'The Musician and the Church', 'The relationship between the gifted musician and the church is often one of tension and misunderstanding.  However, worship is central to church life, and this relationship can have a major impact on the entire church, for good or bad.  \r\n\r\nTherefore church leaders need to understand the unique traps that the enemy lays to ensnare musicians, in order to help them avoid these, while at the same time, protecting the worship atmosphere of the church.', '1329895618The Musician and the Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Musician-and-the-Church-1329895618The-Musician-and-the-Church.doc', '30208', 0, 1, 'doc', 134, 1, NULL, NULL, 1, 1, '2012-02-21 23:26:58', NULL),
(1225, 'The Historical Development of Sacred Music', 'The Historical Development of Sacred Music', 'Man is basically a religious though unregenerate being. In all human life there is a consciousness of a supreme power. Even the most primitive savage is a religious being as he attempts to fulfill his duties to the invisible powers he senses about him. \r\n\r\n\r\nAnd since the beginning of recorded time, music has always had a unique association with man\'s worship experiences.', '1329895859The Historical Development of Sacred Music.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Historical-Development-of-Sacred-Music-1329895859The-Historical-Development-of-Sacred-Music.doc', '71680', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-21 23:30:59', NULL),
(1226, 'Qualifications of a Church Music Director', 'Qualifications of a Church Music Director', 'This article lists the qualifications of a Church Music Director.', '1329896224Qualifications of a Church Music Director.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Qualifications-of-a-Church-Music-Director-1329896224Qualifications-of-a-Church-Music-Director.doc', '76288', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-21 23:37:04', NULL),
(1227, 'Congregational Singing', 'Congregational Singing', 'This article explains what Congregational Singing is all about.', '1329897136Congregational Singing.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Congregational-Singing-1329897136Congregational-Singing.doc', '50176', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-21 23:52:16', NULL),
(1228, 'Intermediate-Teen-Age-Young People Choir', 'Intermediate-Teen-Age-Young People Choir', 'The Intermediate Choir or the age group from the ages of thirteen through high school is generally considered the most difficult of all church choirs for any director to administer. The adolescent personality combined with various difficult musical problems present a real challenge for any director.\r\n\r\nThis article sheds further light on this matter.\r\n', '1329897441Intermediate Teen Age Young People Choir.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Intermediate-Teen-Age-Young-People-Choir-1329897441Intermediate-Teen-Age-Young-People-Choir.doc', '52736', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-21 23:57:21', NULL),
(1229, 'Senior Choirs', 'Senior Choirs', 'There are, however, specific problems that confront directors of church senior choirs. These problems can be categorized under two broad headings--problems of administration and problems involved in developing group musicianship. \r\n\r\nBoth of these topics as well as the choice and use of appropriate materials will be considered in this article.\r\n', '1329897983Senior Choirs.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Senior-Choirs-1329897983Senior-Choirs.doc', '157184', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-22 00:06:23', NULL),
(1230, 'Instrumental Program', 'Instrumental Program', 'One of the areas of a total church music ministry that is generally given little attention in most churches is that of the instrumental program. Although church music directors agree that the music of the church is and should be primarily vocal, there is a growing interest in church orchestras, bands, instrumental ensembles, and instrumental accompaniments for choral anthems. Because music, instrumental music in particular, is given greater emphasis in our public schools today than ever before in the history of public education, church music directors are finding more and more instrumentalists who wish to continue their amateur playing upon completion of school. \r\n\r\nA challenging question indeed is how to use this talent, experience and desire to serve the church music program most effectively. ', '1329898192Instrumental Program.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Instrumental-Program-1329898192Instrumental-Program.doc', '51712', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-22 00:09:52', NULL),
(1231, 'Other Musical Groups', 'Other Musical Groups', 'What are some of the services in the average church which need special music periodically without necessarily using one of the regular church choirs?\r\n\r\nHow do we use them?\r\n\r\n', '1329898458Other Musical Groups.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Other-Musical-Groups-1329898458Other-Musical-Groups.doc', '36352', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-22 00:14:18', NULL),
(1232, 'The Radio Ministry', 'The Radio Ministry', 'What makes a successful radio ministry?', '1329898899The Radio Ministry.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Radio-Ministry-1329898899The-Radio-Ministry.doc', '43520', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-22 00:21:39', NULL),
(1233, 'The Worship Service', 'The Worship Service', 'It must be admitted, however, that in many of our evangelical churches our desire to see people reached with the gospel message has resulted in almost every church service being an evangelistic type of service. There is real danger that Christians in such churches receive little instruction in the Word of God for a growth in grace and in the \"graces\" for their individual lives.\r\n\r\nSo what is to be done?', '1329899081The Worship Service.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Worship-Service-1329899081The-Worship-Service.doc', '59392', 0, 1, 'doc', 135, 1, NULL, NULL, 1, 1, '2012-02-22 00:24:41', NULL),
(1234, 'Church Choir Application', 'Church Choir Application', 'A sample copy of a Church Choir Application form.', '1329899215Church Choir Application.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Church-Choir-Application-1329899215Church-Choir-Application.doc', '31744', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 00:26:55', NULL),
(1235, 'Requirements for Singing in Choir', 'Requirements for Singing in Choir', 'These are some of the standards to be upheld in a Music Ministry.', '1329899511Requirements for Singing in Choir.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Requirements-for-Singing-in-Choir-1329899511Requirements-for-Singing-in-Choir.doc', '26624', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 00:31:51', NULL),
(1236, 'Chorale Members Qualifications', 'Chorale Members Qualifications', 'Chorale Members qualifications list.', '1329899704Chorale Members Qualifications.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Chorale-Members-Qualifications-1329899704Chorale-Members-Qualifications.doc', '25600', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 00:35:04', NULL),
(1237, 'Church Choir Policy', 'Church Choir Policy', 'Sample copy of Church policy.', '1329899829Church Choir Policy.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Church-Choir-Policy-1329899829Church-Choir-Policy.doc', '28672', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 00:37:09', NULL),
(1238, 'Can Your Sound be Heard?', 'Can Your Sound be Heard?', 'Learn all about the Loudspeakers.', '1329900225Can Your Sound be Heard.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Can-Your-Sound-be-Heard?-1329900225Can-Your-Sound-be-Heard.doc', '38400', 0, 1, 'doc', 136, 1, NULL, NULL, 1, 1, '2012-02-22 00:43:45', NULL),
(1239, '3 Ways to Improve Inferior Sound', '3 Ways to Improve Inferior Sound', 'Feed back is something you want from thoughtful church members, not from your speaker system during it.\r\n\r\nGood news: You don\'t have to put up with bad sound. Good audio equipment set properly will eliminate many sound problems. And skilled sound system operation is not as difficult as it may look. Here are some professional tips to know for yourself and to pass along to your sound technicians.\r\n', '13299003923 Ways to Improve Inferior Sound.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/3-Ways-to-Improve-Inferior-Sound-13299003923-Ways-to-Improve-Inferior-Sound.doc', '34304', 0, 1, 'doc', 137, 1, NULL, NULL, 1, 1, '2012-02-22 00:46:32', NULL),
(1240, 'Making the Most of Your Microphones', 'Making the Most of Your Microphones', 'This article teaches us to make the most out of our microphones.', '1329900992Making the Most of Your Microphones.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Making-the-Most-of-Your-Microphones-1329900992Making-the-Most-of-Your-Microphones.doc', '31232', 0, 1, 'doc', 139, 1, NULL, NULL, 1, 1, '2012-02-22 00:56:32', NULL),
(1241, 'Sound Team Tactics', 'Sound Team Tactics', 'You don\'t hear much from them on a Sunday morning, but if it wasn\'t for them, you wouldn\'t hear anything. They are your church\'s audio team-the ones who connect the mikes, run the sound system, and oversee myriad technical and acoustical details most of us never consider.\r\n\r\nProblem:  Let a mike screech or a recorded service turn up blank, and\r\nthese unsung servants become the sudden focus of criticism.\r\n\r\nWhat can be done to equip these technicians - many of whom may be volunteers - for an effective audio ministry?\r\n', '1329901199Sound Team Tactics.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Sound-Team-Tactics-1329901199Sound-Team-Tactics.doc', '30720', 0, 1, 'doc', 140, 1, NULL, NULL, 1, 1, '2012-02-22 00:59:59', '2012-02-22 01:03:46'),
(1242, 'How to Choose a Sound Consultant', 'How to Choose a Sound Consultant', 'Before you make a major investment, get the ear of an expert.\r\n', '1329901397How to Choose a Sound Consultant.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Choose-a-Sound-Consultant-1329901397How-to-Choose-a-Sound-Consultant.doc', '30208', 0, 1, 'doc', 141, 1, NULL, NULL, 1, 1, '2012-02-22 01:03:17', NULL),
(1243, 'A Summary on \'Developing the Leader Within You\'', 'A Summary on \'Developing the Leader Within You\'', '', '1329927547Summary of \'Developing the Leader within you\'.doc', 'http://apostolictoolbox.s3.amazonaws.com/cheryl.actsperience/A-Summary-on-\'Developing-the-Leader-Within-You\'-1329927547Summary-of-\'Developing-the-Leader-within-you\'.doc', '29184', 18, 1, 'doc', 105, 1, NULL, NULL, 1, 1, '2012-02-22 08:19:07', '2012-02-22 08:22:23'),
(1244, 'Solving Discipline Problems in the Classroom', 'Solving Discipline Problems in the Classroom', 'Are you having difficulties handling the kids? How do you solve your discipline problems in the classroom? This article might help with the solutions.', '1329972064Solving Discipline Problems in the Classroom.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Solving-Discipline-Problems-in-the-Classroom-1329972064Solving-Discipline-Problems-in-the-Classroom.doc', '37888', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 20:41:04', NULL),
(1245, 'How to Handle Over-Active Students', 'How to Handle Over-Active Students', 'Every teacher meets a hard-to-handle pupil now and then. \r\n', '1329976234How to Handle Over-Active Students.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Handle-Over-Active-Students-1329976234How-to-Handle-Over-Active-Students.doc', '32256', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 21:50:34', NULL),
(1246, 'Developing Discipline in the Classroom', 'Developing Discipline in the Classroom', 'Are you growing weary of trying to take charge of your classroom? How do you go about developing discipline in your classroom? ', '1329976696Developing Discipline in the Classroom.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Developing-Discipline-in-the-Classroom-1329976696Developing-Discipline-in-the-Classroom.doc', '36864', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 21:58:16', '2012-02-22 22:13:46'),
(1247, 'How to Lead a Child to Repentance', 'How to Lead a Child to Repentance', 'What will you answer when a child in you class asks, \"What does it mean to be \'saved\'?\" Do you know how to answer that? Are you able to lead a child to repentance? \r\n', '1329977078How to Lead a Child to Repentance.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Lead-a-Child-to-Repentance-1329977078How-to-Lead-a-Child-to-Repentance.doc', '35840', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 22:04:38', NULL),
(1248, 'Establishing a Monthly \"Holy Ghost Sunday\" in the Sunday School', 'Establishing a Monthly \"Holy Ghost Sunday\" in the Sunday School', 'When a child reaches their teenage years and have still not made a decision to live for the Lord, it becomes increasingly more difficult to reach them. It is no longer \"cool\" to go to Sunday School. Now they are \"grown-up\" and \"grown-ups\" don\'t go to Sunday School - \"just look at mom and dad,\" they say. \r\n\r\nThe opportunity to give their heart to the Lord and receive the baptism of the Holy Ghost needs to be offered and made available on a regular basis while they are still young. This is the concept of the monthly Holy Ghost Sunday.\r\n', '1329977935Establishing a Monthly Holy Ghost Sunday in the Sunday School.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Establishing-a-Monthly-\"Holy-Ghost-Sunday\"-in-the-Sunday-School-1329977935Establishing-a-Monthly-Holy-Ghost-Sunday-in-the-Sunday-School.doc', '33280', 0, 1, 'doc', 142, 1, NULL, NULL, 1, 1, '2012-02-22 22:18:55', NULL),
(1249, 'Sunday School Literature: An Effective Otreach Tool', 'Sunday School Literature: An Effective Otreach Tool', 'Sunday School worker, are you concerned about outreach? Discipleship? Cultivation of known prospects? Better teaching learning experiences?\r\n\r\nThen read on!\r\n', '1329978392Sunday School Literature, An Effective Otreach Tool.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Sunday-School-Literature:-An-Effective-Otreach-Tool-1329978392Sunday-School-Literature,-An-Effective-Otreach-Tool.doc', '32256', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 22:26:32', NULL),
(1250, 'Sample Letters for Reaching Unsaved Parents', 'Sample Letters for Reaching Unsaved Parents', 'Sample copies of Letters for reaching Unsaved Parents', '1329978649Sample Letters for Reaching Unsaved Parents.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Sample-Letters-for-Reaching-Unsaved-Parents-1329978649Sample-Letters-for-Reaching-Unsaved-Parents.doc', '33792', 0, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-02-22 22:30:49', NULL),
(1251, 'Developing a Double Session Sunday School', 'Developing a Double Session Sunday School', 'How would you like to have another education building, just like the one you have now, absolutely free?\r\n\r\nRidiculous, you say!\r\n\r\nYet, that is exactly what you do have. With a dual Sunday School, you can use your educational building twice on Sunday morning and double your Sunday School attendance.\r\n\r\nNot all churches, however, need a dual Sunday School. This article is intended to help you decide whether you need one; and, if so, how to go about starting it.\r\n', '1329979008Developing a Double Session Sunday School.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Developing-a-Double-Session-Sunday-School-1329979008Developing-a-Double-Session-Sunday-School.doc', '37376', 0, 1, 'doc', 143, 1, NULL, NULL, 1, 1, '2012-02-22 22:36:48', NULL),
(1252, 'A Sunday School Growth Evaluation Checklist', 'A Sunday School Growth Evaluation Checklist', 'This is a sample copy for sunday school growth evaluation checklist. ', '1329979229A Sunday School Growth Evaluation Checklist.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/A-Sunday-School-Growth-Evaluation-Checklist-1329979229A-Sunday-School-Growth-Evaluation-Checklist.doc', '29696', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 22:40:29', NULL),
(1253, 'Growth through Class Contests', 'Growth through Class Contests', 'What are some things that can improve or grow through class contests?', '1329979536Growth through Class Contests.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Growth-through-Class-Contests-1329979536Growth-through-Class-Contests.doc', '29696', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 22:45:36', NULL),
(1254, 'Planning a \"Dinner on the Ground\" Soulwinning Sunday', 'Planning a \"Dinner on the Ground\" Soulwinning Sunday', 'Here\'s how to plan for a great big festive Sunday that will attract\r\nyoung and old alike. Crowds of people will come from all over the\r\nneighborhood if you do it right!\r\n', '1329981132Planning a Dinner on the Ground Soulwinning Sunday.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Planning-a-\"Dinner-on-the-Ground\"-Soulwinning-Sunday-1329981132Planning-a-Dinner-on-the-Ground-Soulwinning-Sunday.doc', '26624', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 23:12:12', NULL),
(1255, 'How to Plan a Sunday School Contest to get Results', 'How to Plan a Sunday School Contest to get Results', 'Are we able to win many people to our church with contests? This method of evangelism has been used and has produced results!\r\n\r\nLet\'s take a look at how we can go about doing it...\r\n ', '1329981918How to Plan a Sunday School Contest to get Results.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Plan-a-Sunday-School-Contest-to-get-Results-1329981918How-to-Plan-a-Sunday-School-Contest-to-get-Results.doc', '31744', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 23:25:18', NULL),
(1256, 'Enroll to Grow: A Simple Formula That Works', 'Enroll to Grow: A Simple Formula That Works', 'Useful Tips for Church Growth', '1329982307Enroll to Grow, A Simple Formula That Works.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Enroll-to-Grow:-A-Simple-Formula-That-Works-1329982307Enroll-to-Grow,-A-Simple-Formula-That-Works.doc', '29184', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 23:31:47', NULL),
(1257, 'Growth in Your Sunday School', 'Growth in Your Sunday School', 'This article shares about growth in your Sunday School.', '1329982717Growth in your Sunday School.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Growth-in-Your-Sunday-School-1329982717Growth-in-your-Sunday-School.doc', '30208', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 23:38:37', NULL),
(1258, 'Sunday School Promo and Contest Ideas', 'Sunday School Promo and Contest Ideas', 'Churches all over America have found that promotion coupled with Bible based evangelism means progress. It means boys and girls hearing about God who otherwise would not. It means setting new goals and records. It means a mass outreach effort to get the crowds assembled so we can give them the word of God.\r\n\r\nPromotion does mean success and progress for the Lord, if a few rules are followed.\r\n', '1329983051Sunday School Promo and Contest Ideas.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Sunday-School-Promo-and-Contest-Ideas-1329983051Sunday-School-Promo-and-Contest-Ideas.doc', '34304', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 23:44:11', NULL),
(1259, '8 More Great Sunday School Promotions and Contests', '8 More Great Sunday School Promotions and Contests', 'This article shares with us 8 great Sunday School Promotions and Contests', '13299837338 More Great Sunday School Promotions and Contests.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/8-More-Great-Sunday-School-Promotions-and-Contests-13299837338-More-Great-Sunday-School-Promotions-and-Contests.doc', '33792', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-22 23:55:33', NULL),
(1260, 'Our Successful Sunday School Drive', 'Our Successful Sunday School Drive', 'An account of a successful Sunday school drive.', '1329984608Our Successful Sunday School Drive.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Our-Successful-Sunday-School-Drive-1329984608Our-Successful-Sunday-School-Drive.doc', '29184', 0, 1, 'doc', 144, 1, NULL, NULL, 1, 1, '2012-02-23 00:10:08', NULL),
(1261, 'It\'s Sunday', 'It\'s Sunday', 'It\'s Sunday its time to tell the Good News, to go into all the world and teach all nations. One thing consistent from the early church to the present church is that the first day of the week is the day to declare the resurrection. \r\n\r\nEvery Sunday morning a Pentecostal Church should ring with the declaration, \"HE IS RISEN and resurrection power is available to you today.\"', '1329988902Its Sunday.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/It\'s-Sunday-1329988902Its-Sunday.doc', '30208', 0, 1, 'doc', 145, 1, NULL, NULL, 1, 1, '2012-02-23 01:21:42', NULL),
(1262, 'Successful Ideas for A Big...Old Fashioned Rally Day', 'Successful Ideas for A Big...Old Fashioned Rally Day', 'This is the oldest and most widely used of all the special days in the history of Sunday school promotions. \r\n\r\nIt goes back farther than any of the unusual promotions that we see on many sides today. It remains as effective as any of them, when handled correctly. In hundreds of Sunday schools, Rally Day has always been the big day of the year. \r\n\r\nIt can be successful for you.\r\n\r\n', '1329989174Successful Ideas for A Big...Old Fashioned Rally Day.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Successful-Ideas-for-A-Big...Old-Fashioned-Rally-Day-1329989174Successful-Ideas-for-A-Big...Old-Fashioned-Rally-Day.doc', '29696', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-23 01:26:14', NULL),
(1263, 'Appreciation Day', 'Appreciation Day', 'How about taking time to have an Appreciation Day at church?', '1329989659Appreciation Day.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Appreciation-Day-1329989659Appreciation-Day.doc', '30720', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-23 01:34:19', NULL),
(1264, 'Baby Day!', 'Baby Day!', 'Since almost everyone loves a pretty little baby or small child, and since every parent wants to show off the baby, and since most people like a good parade, then why not have a BABY PARADE!', '1329990704Baby Day.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Baby-Day!-1329990704Baby-Day.doc', '32256', 0, 1, 'doc', 146, 1, NULL, NULL, 1, 1, '2012-02-23 01:51:44', NULL),
(1265, 'Every Member Sunday', 'Every Member Sunday', 'This special Sunday is all-important in its relationship to your total ministry. With a great host of the church membership present for this particular day, you have the opportunity to lay on their hearts the importance of faithful attendance in church and Sunday school.\r\n\r\nThere are a number of procedures that you can carry out to help with the success of this special day. Those procedures will be discussed in following article.\r\n\r\n', '1329991097Every Member Sunday.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Every-Member-Sunday-1329991097Every-Member-Sunday.doc', '30208', 0, 1, 'doc', 147, 1, NULL, NULL, 1, 1, '2012-02-23 01:58:17', NULL);
