(1266, 'A Call to Anguish', 'A Call to Anguish', 'By David Wilkerson\r\n\r\nA must-hear for those who wishes to walk closer to Him.', '1329991260A Call to Anguish by David Wilkerson - Full.mp3', 'http://apostolictoolbox.s3.amazonaws.com/choowl/A-Call-to-Anguish-1329991260A-Call-to-Anguish-by-David-Wilkerson---Full.mp3', '17483127', 53, 1, 'mp3', 0, 1, NULL, NULL, 1, 1, '2012-02-23 02:01:00', '2012-02-23 02:42:01'),
(1267, 'Surprise Sunday', 'Surprise Sunday', 'There seems to be nothing more delightful to adults, teens and children alike, than an enjoyable surprise. Why not let this element of wonder and intrigue work for you in building your Sunday School attendance. \r\n\r\nWe call it SURPRISE SUNDAY. ', '1329991410Surprise Sunday.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Surprise-Sunday-1329991410Surprise-Sunday.doc', '27648', 0, 1, 'doc', 147, 1, NULL, NULL, 1, 1, '2012-02-23 02:03:30', NULL),
(1268, 'A Call to Build', 'A Call to Build', 'Since the Bible is inspired of God, we conclude that this lack of specificity is intentional. While God has given principles to guide us in being the church and doing church, He has given us broad discretion and liberty to operate in ways that are most suited to our own social, economic, political, and cultural context. In Godâ€™s plan, the precise form of doing church can vary with circumstances, preferences, and pragmatic considerations. This diversity extends across both time and space and even to the local level.', '1329994293A CALL TO BUILD.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/A-Call-to-Build-1329994293A-CALL-TO-BUILD.docx', '32177', 0, 1, 'docx', 23, 1, NULL, NULL, 1, 1, '2012-02-23 02:51:33', NULL),
(1269, 'Spiritual Warfare', 'Spiritual Warfare', 'RE-ESTABLISHING THE DOMINION OF GOD\'S KINGDOM ON THE EARTH\r\n', '1329996656SPIRITUAL WARFARE (NOTES) - Singapore.docx', 'http://apostolictoolbox.s3.amazonaws.com/pastortim/Spiritual-Warfare-1329996656SPIRITUAL-WARFARE-(NOTES)---Singapore.docx', '60116', 3, 1, 'docx', 18, 1, NULL, NULL, 1, 1, '2012-02-23 03:30:56', '2012-02-23 03:31:49'),
(1270, 'Dream big', 'Dream big', 'This is a chapter from Mark Batterson\'s book entitled \"The Circle Maker\". Batterson writes about the need to dream big, for dreaming is a form of praying, and praying is a form of dreaming.', '1330001455The Circle Maker - Mark Batterson - Dream Big.docx', 'http://apostolictoolbox.s3.amazonaws.com/hulilin/Dream-big-1330001455The-Circle-Maker---Mark-Batterson---Dream-Big.docx', '13821', 70, 1, 'docx', 148, 1, NULL, NULL, 1, 1, '2012-02-23 04:50:55', '2012-02-23 05:14:16'),
