(1275, '15 Ways to Double Your Sunday School Class', '15 Ways to Double Your Sunday School Class', 'This article shares 15 ways to double your Sunday school attendance.', '133005365715 Ways to Double Your Sunday School Class.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/15-Ways-to-Double-Your-Sunday-School-Class-133005365715-Ways-to-Double-Your-Sunday-School-Class.doc', '25600', 0, 1, 'doc', 149, 1, NULL, NULL, 1, 1, '2012-02-23 19:20:57', '2012-02-23 19:44:08'),
(1276, 'Beating the Summer Slump, 13 Special Days', 'Beating the Summer Slump, 13 Special Days', 'The Summer months seem to take their toll on most churches, mostly in attendance. There are ways to combat this slump. Here in this literature, are some suggestions that may help you create an interest that can help span this normal dry spell and give you a boost going into the Fall season.\r\n\r\nSome of these special days may not work for you but many of them will. Use all or pick and choose from the list. You can easily enlarge on these brief suggestions.\r\n', '1330056160Beating the Summer Slump, 13 Special Days.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Beating-the-Summer-Slump,-13-Special-Days-1330056160Beating-the-Summer-Slump,-13-Special-Days.doc', '34304', 0, 1, 'doc', 150, 1, NULL, NULL, 1, 1, '2012-02-23 20:02:40', NULL),
(1277, 'Yes We Can! Save Our Children', 'Yes We Can! Save Our Children', 'It is clear to us the importance of fathers and teachers in the process of educating the children properly. We need to be aware of the absence of the father in many homes of our society today, and because of this lack of family leadership, our society daily reaps the harvest of children who wander aimlessly, looking for direction in their lives, both spiritually and physically. \r\n\r\nAs Christian educators, we must realize that the tremendous task of saving our children is more than a program. ', '1330056859Yes We Can! Save Our Children.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Yes-We-Can!-Save-Our-Children-1330056859Yes-We-Can!-Save-Our-Children.doc', '32768', 0, 1, 'doc', 151, 1, NULL, NULL, 1, 1, '2012-02-23 20:14:19', NULL),
(1278, 'Know Your P\'s and Q\'s', 'Know Your P\'s and Q\'s', 'The Do\'s and Dont\'s of Teaching a Sunday School lesson.', '1330057894Know Your P\'s and Q\'s.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Know-Your-P\'s-and-Q\'s-1330057894Know-Your-P\'s-and-Q\'s.doc', '25088', 0, 1, 'doc', 152, 1, NULL, NULL, 1, 1, '2012-02-23 20:31:34', '2012-02-23 22:30:15'),
(1279, 'How Do I Prepare My Bible Lesson?', 'How Do I Prepare My Bible Lesson?', 'Your attitude makes a big difference as you teach. How can you become excited about the lesson? \r\n\r\nThe following articles shares seven steps to guide you. \r\n', '1330058156How Do I Prepare My Bible Lesson.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-Do-I-Prepare-My-Bible-Lesson?-1330058156How-Do-I-Prepare-My-Bible-Lesson.doc', '38400', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-23 20:35:56', '2012-02-23 22:30:02'),
