(2479, 'Ministry of Care (Student Notes)', 'Ministry of Care (Student Notes).rar', 'Ministry of Care is a 6 Lesson series that expounds on Spiritual maturity. It highlights the importance of growing up in the Kingdom of God, understanding who we are in Christ and to care for others. Some of the topics covered will be: The Challenges of Growing Up, What is Care Ministry About, The Shepherd & You, Understanding Who You Are, Respecting Yourself, Co-Dependency and the Spirit of Manipulation.', '1333088926MOC.rar', 'http://apostolictoolbox.s3.amazonaws.com/admin/Ministry-of-Care-(Student-Notes)-1333088926MOC.rar', '3482289', 0, 1, 'rar', 16, 1, '', '', 1, 1, '2012-03-29 23:28:46', '2012-03-30 00:19:11'),
