(1324, 'Team Teaching Techniques', 'Team Teaching Techniques', 'The team approach to teaching calls for two or more persons to guide the learning, growth, cooperation and evaluating of classroom experience. Sharing of responsibility is vital to the team approach.\r\n\r\nNo one person can or should be responsible for the spiritual life of a child. Several teachers should pray, teach, visit, guide and direct the pupil. These teachers form a team.\r\n', '1330075325Team Teaching Techniques.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Team-Teaching-Techniques-1330075325Team-Teaching-Techniques.doc', '27648', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-24 01:22:05', NULL),
(1314, 'Kids Church in the Sanctuary', 'Kids Church in the Sanctuary', 'ARE YOU TRULY INTERESTED IN developing a family-friendly church? If you are, consider transforming your main sanctuary into most kid-energizing, Dad-and Mom-surprising, Grandpa-and Grandma-pleasing place in your neighborhood. Hold a Kids Church service in the sanctuary during your main service.\r\n\r\nDon\'t Panic! This isn\'t a time for a senior pastor panic attack. What I\'m about to describe is an opportunity for the senior pastor and everyone else in the church to be intimately aware of what the kids are learning.\r\n', '1330064927Kids Church in the Sanctuary.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Kids-Church-in-the-Sanctuary-1330064927Kids-Church-in-the-Sanctuary.doc', '30720', 0, 1, 'doc', 155, 1, NULL, NULL, 1, 1, '2012-02-23 22:28:47', NULL),
(1315, 'Sunday School: A Vital Link between Church and Our Family', 'Sunday School: A Vital Link between Church and Our Family', 'Sunday School provides one of the most effective ways of reaching people who need God; nearly 85% of the people in our churches today are products of Sunday School. Some came through bus ministries, with a friend, or through the efforts of a dedicated Sunday School teacher. For the most part, people will visit Sunday School before attending any other service; thus, Sunday School growth should be an important goal for a growing church.', '1330067634Sunday School, A Vital Link between Church and Our Family.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Sunday-School:-A-Vital-Link-between-Church-and-Our-Family-1330067634Sunday-School,-A-Vital-Link-between-Church-and-Our-Family.doc', '27136', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-23 23:13:54', NULL),
(1316, '10 Tools for Effective Story Telling', '10 Tools for Effective Story Telling', 'This article shares 10 effective tools for Story Telling.', '133006878610 Tools for Effective Story Telling.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/10-Tools-for-Effective-Story-Telling-133006878610-Tools-for-Effective-Story-Telling.doc', '37376', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-23 23:33:06', NULL),
(1317, 'Bring It To Life By Story-Telling/The Right Ending', 'Bring It To Life By Story-Telling/The Right Ending', 'This articles explores the art of story-telling.', '1330069615Bring It To Life By Story-Telling, The Right Ending.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Bring-It-To-Life-By-Story-Telling/The-Right-Ending-1330069615Bring-It-To-Life-By-Story-Telling,-The-Right-Ending.doc', '37376', 0, 1, 'doc', 156, 1, NULL, NULL, 1, 1, '2012-02-23 23:46:55', NULL),
(1318, 'Puppet Power!', 'Puppet Power!', 'Jesus, and puppets, and me--what a wonderful way to teach Christ. Puppets bring new emphases to familiar stories.\r\n', '1330069817Puppet Power!.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Puppet-Power!-1330069817Puppet-Power!.doc', '36864', 0, 1, 'doc', 157, 1, NULL, NULL, 1, 1, '2012-02-23 23:50:17', NULL),
(1319, 'Making Memory Work Interesting', 'Making Memory Work Interesting', 'There is no greater honor than to endow a spiritually poverty stricken child with precious nuggets of God\'s word which shall never grow dim. Psalm 119:11 says, \"Thy word have I hid in mine heart that I might not sin against thee.\" \r\n\r\nIn this changing world we need something to which we may cling, something which is sure and steadfast, something which never changes. Children need the sure word of God in their hearts.\r\n', '1330070387Making Memory Work Interesting.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Making-Memory-Work-Interesting-1330070387Making-Memory-Work-Interesting.doc', '34304', 0, 1, 'doc', 158, 1, NULL, NULL, 1, 1, '2012-02-23 23:59:47', NULL),
(1320, 'Student Involvement In Lessons', 'Student Involvement In Lessons', 'How do we involve our students in your lessons?', '1330073361Student Involvement In Lessons.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Student-Involvement-In-Lessons-1330073361Student-Involvement-In-Lessons.doc', '28160', 0, 1, 'doc', 160, 1, NULL, NULL, 1, 1, '2012-02-24 00:49:21', NULL),
(1321, 'Teaching With Flannelgraph', 'Teaching With Flannelgraph', 'Visual Aids can play an important role in our teaching. The greatest teacher, Jesus, in the world used visuals. \r\n\r\nFlannelgraph will arouse curiosity and hold the students attention. It also enables the pupils to see what is being taught. Flannelgraph can bring events to life!\r\n \r\n', '1330074244Teaching With Flannelgraph.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Teaching-With-Flannelgraph-1330074244Teaching-With-Flannelgraph.doc', '28160', 0, 1, 'doc', 161, 1, NULL, NULL, 1, 1, '2012-02-24 01:04:04', NULL),
(1322, 'Using Games in the Sunday School Class', 'Using Games in the Sunday School Class', 'This lesson shares about how we go about using games in Sunday school and what are some of these games .', '1330074461Using Games in the Sunday School Class.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Using-Games-in-the-Sunday-School-Class-1330074461Using-Games-in-the-Sunday-School-Class.doc', '31232', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-24 01:07:42', NULL),
(1323, 'Ventriloquism, It\'s Easy', 'Ventriloquism, It\'s Easy', 'Do you want to use Ventriloquism in your Sunday school? Why not learn more about it first?', '1330074904Ventriloquism, It\'s Easy.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Ventriloquism,-It\'s-Easy-1330074904Ventriloquism,-It\'s-Easy.doc', '30720', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-24 01:15:04', NULL),
(1325, 'Effective Chalkboard Teaching', 'Effective Chalkboard Teaching', 'The most flexible instrument of instruction available next to the voice is the chalkboard. It is also perhaps the most widely-used training aid. During World War II the newspapers carried a picture of General Montgomery right in the front lines explaining a plan of attack on a portable chalkboard to his officers. It is felt that if this teaching aid was important enough to carry to the battlefield, we ought to consider its importance.\r\n', '1330075618Effective Chalkboard Teaching.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Effective-Chalkboard-Teaching-1330075618Effective-Chalkboard-Teaching.doc', '31744', 0, 1, 'doc', 162, 1, NULL, NULL, 1, 1, '2012-02-24 01:26:58', NULL),
(1326, '3 Letters from Teddy', '3 Letters from Teddy', '3 Personal Letters from a Student to a Teacher.', '13300761493 Letters from Teddy.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/3-Letters-from-Teddy-13300761493-Letters-from-Teddy.doc', '43008', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-24 01:35:49', NULL),
(1327, 'Teaching Young People', 'Teaching Young People', 'Are we trying to save our youth? Or, are we just holding class periods? If all we are doing is holding our own young people, we are losing ground fast.\r\n\r\nThe years of adolescence are 13 years through 21 years. In\r\nthe United Pentecostal Church, we include 12 years olds.\r\n\r\nThis age is the back door to the Sunday School, and the church as a whole. This also, is one of our most needy fields.\r\n', '1330076575Teaching Young People.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Teaching-Young-People-1330076575Teaching-Young-People.doc', '32768', 0, 1, 'doc', 163, 1, NULL, NULL, 1, 1, '2012-02-24 01:42:55', NULL),
(1328, 'Room Decorations', 'Room Decorations', 'You can recognize an effective teacher\'s classroom the moment you enter. Their walls speak to you.\r\n\r\nGreat teachers make it easy - Behind every well-decorated classroom are hours of careful planning and research for ideas. Even the veteran teacher must spend time researching and planning to make their room attractive and an effective teaching atmosphere.\r\n', '1330076980Room Decorations.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Room-Decorations-1330076980Room-Decorations.doc', '35840', 0, 1, 'doc', 164, 1, NULL, NULL, 1, 1, '2012-02-24 01:49:40', NULL),
(1329, 'How Children Learn', 'How Children Learn', 'This article shares about how are some of the ways children learn.', '1330077811How Children Learn.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-Children-Learn-1330077811How-Children-Learn.doc', '28160', 0, 1, 'doc', 165, 1, NULL, NULL, 1, 1, '2012-02-24 02:03:31', NULL),
(1330, 'Teaching Techniques for Juniors', 'Teaching Techniques for Juniors', 'Learn some of the teaching techniques for the junior kids in your Sunday school.', '1330077983Teaching Techniques for Juniors.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Teaching-Techniques-for-Juniors-1330077983Teaching-Techniques-for-Juniors.doc', '27136', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-24 02:06:23', NULL),
(1331, 'You Too Can Be Creative!', 'You Too Can Be Creative!', 'To teach or preach without the touch of God is to teach or preach without life! Lessons and sermons, if rightly prepared and presented with power will create something in the lives of your listeners. \r\n\r\nFor the lesson to live in others it must first be a living reality in the teacher.', '1330078181You Too Can Be Creative!.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/You-Too-Can-Be-Creative!-1330078181You-Too-Can-Be-Creative!.doc', '28672', 0, 1, 'doc', 166, 1, NULL, NULL, 1, 1, '2012-02-24 02:09:41', NULL),
(1332, 'Teacher\'s Responsibilities Outside of Class', 'Teacher\'s Responsibilities Outside of Class', 'This article expounds on the responsibilities of a teacher outside of class based on Acts 15:36.', '1330078345Teacher\'s Responsibilities Outside of Class.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Teacher\'s-Responsibilities-Outside-of-Class-1330078345Teacher\'s-Responsibilities-Outside-of-Class.doc', '28672', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-24 02:12:25', NULL),
(1333, 'How to Teach a Child After Salvation', 'How to Teach a Child After Salvation', 'When a pupil under your teaching has received Christ, your \r\nresponsibility as a teacher has only begun. Young Christians must be nourished in the Word and taught how to grow spiritually in their new life. They need to know that the heavenly Father who has done so much for them through the Lord Jesus Christ wants ALL of them, which is only right, their \"reasonable service\" (Rom. 12:1,2).\r\n', '1330078493How to Teach a Child After Salvation.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Teach-a-Child-After-Salvation-1330078493How-to-Teach-a-Child-After-Salvation.doc', '34816', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-02-24 02:14:53', NULL),
(1334, 'What Makes Teachers Effective?', 'What Makes Teachers Effective?', 'This question has puzzled educators for centuries. The answer is \r\ndiscussed in both Christian and secular educational institutions. \r\nThe purpose here is not to settle the question but to propose some \r\nprinciples by which teachers can evaluate themselves.\r\n', '1330078676What Makes Teachers Effective.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/What-Makes-Teachers-Effective?-1330078676What-Makes-Teachers-Effective.doc', '37376', 0, 1, 'doc', 167, 1, NULL, NULL, 1, 1, '2012-02-24 02:17:56', NULL),
(1335, 'Jesus Knew The ABC\'s of Teaching', 'Jesus Knew The ABC\'s of Teaching', 'What does it mean to teach with authority?  How did Jesus do it?', '1330078950Jesus Knew The ABC\'s of Teaching.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Jesus-Knew-The-ABC\'s-of-Teaching-1330078950Jesus-Knew-The-ABC\'s-of-Teaching.doc', '32768', 0, 1, 'doc', 168, 1, NULL, NULL, 1, 1, '2012-02-24 02:22:30', NULL),
(1336, 'For Sunday School Teachers', 'For Sunday School Teachers', 'As Sunday school teachers we take many souls under our care every week. What are we doing to insure that they are not lost to God? What influences are we casting in their direction that lights a spark of hope within them? Are they just numbers that occupy the chairs in our classrooms? Are we concerned only with how many or how few there are? Are we diligent in planting something of tremendous value within them that will stick with them, that will help them fashion correctly the direction their lives will take?', '1330079105For Sunday School Teachers.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/For-Sunday-School-Teachers-1330079105For-Sunday-School-Teachers.doc', '28160', 0, 1, 'doc', 169, 1, NULL, NULL, 1, 1, '2012-02-24 02:25:05', NULL),
(1337, 'Spiritual Warfare Prayer', 'Spiritual Warfare Prayer', 'Jesus received his instructions each day to do the will of God, can you and I do less? This booklet is to be used to help you in-crease and direct your prayers. It is a collection of ideas from everyone weâ€˜ve read (Larry Lea, Peter Wagner, Bill Gothard and others), many of the praying people in our church who have con-tributed thoughts and ideas, and through applying the principles of prayer. Our prayer teams have used this tool to help them and hope it will help you.', '1330106711Spiritual Warfare Prayer by Judy Doughtyb5.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Spiritual-Warfare-Prayer-1330106711Spiritual-Warfare-Prayer-by-Judy-Doughtyb5.pdf', '460504', 0, 1, 'pdf', 170, 1, NULL, NULL, 1, 1, '2012-02-24 10:05:11', NULL),
(1338, 'How to pray for your loved ones', 'How to pray for your loved ones', 'Prayer Guide', '1330107119How to pray for love ones.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-pray-for-your-loved-ones-1330107119How-to-pray-for-love-ones.pdf', '23320', 0, 1, 'pdf', 11, 1, NULL, NULL, 1, 1, '2012-02-24 10:11:59', NULL),
(1339, 'Lust of the Eyes', 'Lust of the Eyes', 'The eyes of man have gotten him in trouble ever since the beginning of time. (Genesis 3:6).', '1330107853Our eyes.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Lust-of-the-Eyes-1330107853Our-eyes.doc', '50176', 0, 1, 'doc', 11, 1, NULL, NULL, 1, 1, '2012-02-24 10:24:13', NULL),
