(1349, 'Hooked', 'Hooked: New Science on How Casual Sex is Affecting Our Children.epub', 'What does a three-pound brain have to do with oneâ€™s sex life? A lot, actually.\r\nBreakthroughs in the burgeoning field of neuroscience explain the impact having sex has on the developing brains of adolescents and young adults. Through the mounds of scientific data this book simply demonstrates that:Sexual activity releases chemicals in the brain, creating emotional bonds between partners.\r\nBreaking these bonds can cause depression and make it harder to bond with someone else in the future.\r\nChemicals released in the brain during sex can become addictive. \r\nThe human brain is not fully developed until a person reaches their mid-20s. Until then, it is harder to make wise relationship decisions. Parents and others who care about young people now have the facts to steer them away from making life-changing mistakes, and lead them toward reaching their full potential.', '1330363380Hooked__New_Science_On_How_Casual_Sex_Is_Affecti.epub', 'http://apostolictoolbox.s3.amazonaws.com/admin/Hooked-1330363380Hooked__New_Science_On_How_Casual_Sex_Is_Affecti.epub', '2557294', 0, 1, 'epub', 171, 1, '', '', 1, 1, '2012-02-27 09:23:00', '2012-09-20 10:08:28'),
(1355, 'Breaking Out of the Debt Trap', 'Breaking Out Of The Debt Trap - Part 3 - Handout.doc', '', '1330364198Breaking Out Of The Debt Trap - Part 3 - Handout.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Breaking-Out-of-the-Debt-Trap-1330364198Breaking-Out-Of-The-Debt-Trap---Part-3---Handout.doc', '69120', 0, 1, 'doc', 15, 1, NULL, NULL, 1, 1, '2012-02-27 09:36:38', NULL),
