(1361, 'The Anointing Series', 'Lesson 4 Who God anoints.docx', 'What does it mean to be anointed? And what is the process of being anointed.', '1330398632Lesson 4 Who God anoints.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Anointing-Series-1330398632Lesson-4-Who-God-anoints.docx', '34177', 0, 1, 'docx', 11, 1, NULL, NULL, 1, 1, '2012-02-27 19:10:32', NULL),
(1366, 'Pastoral Counseling', 'Counseling, Its Uniqueness (Part 1).doc', 'Counseling is the act of verbally helping another person find the proper solution to a particular problem. The problem may be conceptual: intellectual help is wanted. It may be dispositional: how can I change? It may be situational: what should I do!', '1330404164Counseling, Its Uniqueness (Part 1).doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Pastoral-Counseling-1330404164Counseling,-Its-Uniqueness-(Part-1).doc', '56320', 0, 1, 'doc', 101, 1, NULL, NULL, 1, 1, '2012-02-27 20:42:44', '2012-02-28 19:44:12'),
(1365, 'Pastoral Counseling', 'Counseling, Its Perils (Part 2).doc', 'Counseling is the act of verbally helping another person find the proper solution to a particular problem. The problem may be conceptual: intellectual help is wanted. It may be dispositional: how can I change? It may be situational: what should I do!', '1330404164Counseling, Its Perils (Part 2).doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Pastoral-Counseling-1330404164Counseling,-Its-Perils-(Part-2).doc', '54272', 0, 1, 'doc', 101, 1, NULL, NULL, 1, 1, '2012-02-27 20:42:44', NULL),
(1367, 'A Pastor\'s First-Aid Kit', 'A Pastor\'s First-Aid Kit.doc', 'The following list of categorical notes are some of the things which the Lord gave to Don Chapman when he was under attack in the ministry. I trust this doctrine will help all those communicators who are under the same pressure that he was.', '1330404596A Pastor\'s First-Aid Kit.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/A-Pastor\'s-First-Aid-Kit-1330404596A-Pastor\'s-First-Aid-Kit.doc', '31232', 0, 1, 'doc', 173, 1, NULL, NULL, 1, 1, '2012-02-27 20:49:56', '2012-02-28 19:43:54'),
(1368, 'Say Yes to No Smoking', 'Say Yes to No Smoking.doc', 'An article on overcoming Smoking.', '1330417303Say Yes to No Smoking.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Say-Yes-to-No-Smoking-1330417303Say-Yes-to-No-Smoking.doc', '26624', 0, 1, 'doc', 174, 1, NULL, NULL, 1, 1, '2012-02-28 00:21:43', '2012-02-28 19:43:27'),
(1369, 'Weed Control', 'Weed Control.doc', 'You have to be an ostrich with its head in the sand not to acknowledge that cigarette smoking is the greatest single preventable cause of death, implicated in lung cancer, heart disease and a slew of other respiratory diseases from emphysema to bronchitis. If that doesn\'t make you want to quit, it also ages your skin, fouls your breath and is anti-social to boot. In light of all this, quitting smoking is a smart, healthy thing to do. \r\n\r\nBut how? \r\n\r\nLatest research suggests that knowing yourself, and how the \"enemy\" affects you, may be your most important strategy for beating the weed.\r\n', '1330417590Weed Control.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Weed-Control-1330417590Weed-Control.doc', '27648', 0, 1, 'doc', 175, 1, NULL, NULL, 1, 1, '2012-02-28 00:26:30', '2012-02-28 19:42:58'),
(1370, 'Counseling The Pink Slip Blues', 'Counseling The Pink Slip Blues.doc', 'What do you do when you are out of job? This article might just help with sound advices.', '1330418323Counseling The Pink Slip Blues.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Counseling-The-Pink-Slip-Blues-1330418323Counseling-The-Pink-Slip-Blues.doc', '28160', 0, 1, 'doc', 176, 1, NULL, NULL, 1, 1, '2012-02-28 00:38:43', '2012-02-28 19:42:41'),
(1371, 'Leting Go of Painful Memories', 'Leting Go of Painful Memories.doc', 'This article shares about a journey on letting go of painful memories.', '1330418984Leting Go of Painful Memories.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Leting-Go-of-Painful-Memories-1330418984Leting-Go-of-Painful-Memories.doc', '68096', 0, 1, 'doc', 177, 1, NULL, NULL, 1, 1, '2012-02-28 00:49:44', '2012-02-28 19:42:26'),
(1372, 'Low Self-Esteem Among Adults', 'Low Self-Esteem Among Adults.doc', 'Parents and teachers have been preoccupied with the self-esteem needs of their children in recent years, and for good reason. Feelings of inferiority are rampant among the young today. But the problem of self-doubt extends beyond childhood and adolescence. Many adults, and especially young women, also struggle with great feelings of worthlessness and inadequacy.\r\n', '1330419383Low Self-Esteem Among Adults.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Low-Self-Esteem-Among-Adults-1330419383Low-Self-Esteem-Among-Adults.doc', '47104', 0, 1, 'doc', 178, 1, NULL, NULL, 1, 1, '2012-02-28 00:56:23', '2012-02-28 19:42:09'),
(1373, 'Coping with Anger', 'Coping with Anger.doc', 'What Is Anger? When Is It Sinful?\r\nLet\'s begin with the question, Is all anger sinful?\r\n\r\nObviously, not everything that can be identified under the heading of anger is violation of God\'s law, for Ephesians 4:26 instructs us, \"Be angry but do not sin\". That verse shows that there is a difference between strong feeling and the seething hostility which is consistently condemned in the Scripture. We have to then, clarify that distinction.\r\n', '1330419754Coping with Anger.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Coping-with-Anger-1330419754Coping-with-Anger.doc', '58368', 0, 1, 'doc', 178, 1, NULL, NULL, 1, 1, '2012-02-28 01:02:34', '2012-02-28 19:41:54'),
(1374, 'AIDS: Facts Vs Fiction', 'AIDS, Facts Vs Fiction.doc', 'When NBA superstar Magic Johnson announced he had the virus that \r\ncauses AIDS, health clinic hotlines went crazy. After all, if a \r\nsports hero like Magic could get this disease, people assumed \r\nanybody could get it. But when Magic was named MVP at the NBA All-star game a few months later, a lot of people probably relaxed. After all, if an infected person could look so good and play so well, AIDS must not be all that bad.\r\n\r\nSo who\'s telling the truth about this frightening disease?\r\n', '1330420632AIDS, Facts Vs Fiction.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/AIDS:-Facts-Vs-Fiction-1330420632AIDS,-Facts-Vs-Fiction.doc', '27648', 0, 1, 'doc', 179, 1, NULL, NULL, 1, 1, '2012-02-28 01:17:12', '2012-02-28 19:41:38'),
(1375, 'Dueling with Depression', 'Dueling with Depression.doc', 'Somewhere in the black distance above, you hear muffled sounds. \r\nLife is going on as normal - laughter, love. You\'re not a part of it anymore.\r\n\r\nThe suffocating, still blackness is slowly squeezing you to death. It is so lonely. Hopeless. Empty. The more you struggle to climb out, the farther back you slide, coming ever closer to that last fatal fall into the black abyss.\r\n\r\nYou\'re afraid of that fall, yet you would welcome it. You\'re so \r\ncold. So lonely. There\'s no way out.\r\n\r\nThis is life for millions of people who struggle with serious \r\ndepression. Perhaps you may be one of them.\r\n', '1330421255Dueling with Depression.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Dueling-with-Depression-1330421255Dueling-with-Depression.doc', '47104', 0, 1, 'doc', 180, 1, NULL, NULL, 1, 1, '2012-02-28 01:27:35', '2012-02-28 19:41:23'),
(1376, 'Depression: Help for Those Who Hurt', 'Depression, Help for Those Who Hurt.doc', 'While in many confrontations the weapons and strategies of the struggle are developed and sharpened in the battle itself, the nature of depression is such that it dampens our energies in those directions. A mild depression may motivate us to develop ways of resolving it, but the deeper depressions seem to suck all ambition from us and leave us with a growing difficulty in maintaining any sense of perspective on our problem.\r\n\r\nThe questions and answers in this article include some potent \r\nweapons in your struggle with depression. \r\n', '1330421986Depression, Help for Those Who Hurt.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Depression:-Help-for-Those-Who-Hurt-1330421986Depression,-Help-for-Those-Who-Hurt.doc', '152576', 0, 1, 'doc', 181, 1, NULL, NULL, 1, 1, '2012-02-28 01:39:46', '2012-02-28 19:41:08'),
(1377, 'Change Your Thoughts', 'Change Your Thoughts.doc', 'Thought patterns that have troubled you for years can be changed \r\nby the power of God beginning right now. And since the Bible \r\nindicates you are the sum total of your thought patterns, your \r\nlife-style can be radically changed when Jesus controls your life. \r\nFor whom the Son sets free is free indeed. \r\n', '1330422198Change Your Thoughts.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Change-Your-Thoughts-1330422198Change-Your-Thoughts.doc', '31744', 0, 1, 'doc', 182, 1, NULL, NULL, 1, 1, '2012-02-28 01:43:18', '2012-02-28 19:40:52'),
(1378, 'Understanding Depression', 'Understanding Depression.doc', 'What is depression?\r\n\r\nIt\'s the most complicated of all our emotions and yet so common that it\'s even called the \"common cold\" of the emotions.\r\n\r\n', '1330422441Understanding Depression.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Understanding-Depression-1330422441Understanding-Depression.doc', '37376', 0, 1, 'doc', 181, 1, NULL, NULL, 1, 1, '2012-02-28 01:47:21', '2012-02-28 19:40:36'),
(1379, 'Ways Churches Fight', 'Ways Churches Fight.doc', 'The ways people handle conflict in other spheres of their lives is generally the way they will deal with it in the church arena.  Psychologists have identified several typical modes of responding to threatening situations.\r\n\r\nAre you a Shark, Fox, Turtle, Teddy Bear or an Owl when it comes to confrontations?', '1330423006Ways Churches Fight.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Ways-Churches-Fight-1330423006Ways-Churches-Fight.doc', '27136', 0, 1, 'doc', 183, 1, NULL, NULL, 1, 1, '2012-02-28 01:56:46', '2012-02-28 19:40:22'),
(1380, 'Overcoming Loneliness', 'Overcoming Loneliness.doc', 'Loneliness, like depression, is one of the plagues of contemporary \r\nsociety. Few escape it altogether. In its chronic form it is a killer.\r\n\r\nSo how do you overcome it?', '1330423178Overcoming Loneliness.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Overcoming-Loneliness-1330423178Overcoming-Loneliness.doc', '33280', 0, 1, 'doc', 184, 1, NULL, NULL, 1, 1, '2012-02-28 01:59:38', '2012-02-28 19:39:56'),
(1381, 'Overcoming Depression by Changing Thoughts and Feelings', 'Overcoming Depression by Changing Thoughts and Feelings.doc', 'Most of us, if not all, have gone through periods of depression, however brief. So how do we battle depression and its effects?\r\n\r\nWe must first challenge our distorted thinking to get at root cause of the depression.  \r\n', '1330423428Overcoming Depression by Changing Thoughts and Feelings.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Overcoming-Depression-by-Changing-Thoughts-and-Feelings-1330423428Overcoming-Depression-by-Changing-Thoughts-and-Feelings.doc', '36352', 0, 1, 'doc', 106, 1, NULL, NULL, 1, 1, '2012-02-28 02:03:48', '2012-02-28 19:39:37'),
(1382, 'Personal Purity Seven Lust-Busters ', 'Personal Purity Seven Lust-Busters.doc', 'Sexual sin is on the rampage not only in America but world wide. \r\nThese seven \"lust busters\" have been proven solutions for beginning the journey of healing from sexual sin.\r\n', '1330486753Personal Purity Seven Lust-Busters.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Personal-Purity-Seven-Lust-Busters--1330486753Personal-Purity-Seven-Lust-Busters.doc', '28160', 0, 1, 'doc', 185, 1, NULL, NULL, 1, 1, '2012-02-28 19:39:13', '2012-02-28 19:57:23'),
(1383, 'Let\'s Stop Avoiding \'The M Word\'', 'Let\'s Stop Avoiding \'The M Word\'.doc', 'For too long the church has been afraid to address the subject of masturbation.\r\n\r\nFor some reason, the church has never found it easy to talk about sex. The Bible, on the other hand, has no problem talking about it. But God\'s people seem to believe it\'s a subject best not mentioned especially that \"dirty little habit\" called masturbation.\r\n\r\nBut our silence about \"the M word\" actually helps Satan\'s cause. In darkness he keeps people isolated, ignorant, afraid, shameful and bound.\r\n\r\nSo, does God\'s Word say anything specifically about masturbation? \r\n\r\nMany of us think not.\r\n', '1330487810Let\'s Stop Avoiding \'The M Word\'.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Let\'s-Stop-Avoiding-\'The-M-Word\'-1330487810Let\'s-Stop-Avoiding-\'The-M-Word\'.doc', '30208', 0, 1, 'doc', 186, 1, NULL, NULL, 1, 1, '2012-02-28 19:56:50', NULL),
(1384, 'The Tresure of Lay Counselors', 'The Tresure of Lay Counselors.doc', 'IN EVERY CONGREGATION THERE IS A TREASURE of people resources \r\navailable, some more apparent than others. We easily recognize the gifts of those working with children or in music ministry. \r\n\r\nBut there is a gem in this treasure that is often overlooked though just as valuable as the others, the lay counselor.\r\n', '1330488436The Tresure of Lay Counselors.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Tresure-of-Lay-Counselors-1330488436The-Tresure-of-Lay-Counselors.doc', '30208', 0, 1, 'doc', 187, 1, NULL, NULL, 1, 1, '2012-02-28 20:07:16', NULL),
(1385, 'Depression', 'Depression.doc', 'Depression is America\'s number one mental health problem. The \r\naverage age of onset for major depression has decreased every decade since World War. Young people in their teens and the 20\'s are 10 times more likely to suffer from major depression than were their grandparents 50 years ago.\r\n', '1330489245Depression.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Depression-1330489245Depression.doc', '34304', 0, 1, 'doc', 188, 1, NULL, NULL, 1, 1, '2012-02-28 20:20:45', NULL);
INSERT INTO `atb_document_uploaded_s3` (`id`, `document_heading`, `name`, `details`, `file_path`, `new_filepath`, `file_size`, `user_id`, `language_id`, `document_type`, `author_id`, `file_type`, `embedded_code`, `embedded_code_name`, `document_status`, `upload_status`, `created_date`, `modified_date`) VALUES
(1386, 'Change Me, O Lord', 'Change Me, O Lord.doc', 'Lately its discouraging to see what we Christians call counseling. Right now there are more trained Christian counselors than in all of church history. And there are multitudes of \"how to\" books and relationship manuals available, offering spiritual advice on every subject, from marriage to physical fitness to child-rearing.\r\n\r\nYet, tragically, there are more troubled individuals, marriages \r\nand families in the church than ever before. The turmoil in Christian homes today is unspeakable and, beloved, this ought not to be so.\r\n\r\n', '1330491705Change Me, O Lord.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Change-Me,-O-Lord-1330491705Change-Me,-O-Lord.doc', '56832', 0, 1, 'doc', 189, 1, NULL, NULL, 1, 1, '2012-02-28 21:01:45', NULL),
(1387, 'Before You Say \"I Do\"', 'Before You Say I Do.doc', 'Courtship is like a fire. Whether it will warm your house, or burn it down depends entirely on how it is handled. Here is a list of \"helps\" to make your courtship happy, healthy, and Holy!\r\n', '1330492366Before You Say I Do.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Before-You-Say-\"I-Do\"-1330492366Before-You-Say-I-Do.doc', '33792', 0, 1, 'doc', 190, 1, NULL, NULL, 1, 1, '2012-02-28 21:12:46', NULL),
(1388, 'When Couples Say I Don\'t', 'When Couples Say I Don\'t.doc', 'These articles share about the effects of Divorce.', '1330493205When Couples Say I Don\'t.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/When-Couples-Say-I-Don\'t-1330493205When-Couples-Say-I-Don\'t.doc', '44544', 0, 1, 'doc', 191, 1, NULL, NULL, 1, 1, '2012-02-28 21:26:45', NULL),
(1389, 'Living Through Divorce', 'Living Through Divorce.doc', 'Here are seven principles that will help someone live through a divorce.\r\n', '1330493628Living Through Divorce.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Living-Through-Divorce-1330493628Living-Through-Divorce.doc', '35840', 0, 1, 'doc', 192, 1, NULL, NULL, 1, 1, '2012-02-28 21:33:48', NULL),
(1390, 'Restoring Romance to Your Marriage', 'Restoring Romance to Your Marriage.doc', 'At first glance romantic love seems to be a controversial subject. For instance...\r\n\r\nSome cynics scoff at romantic love as a myth invented by Hollywood.\r\n\r\nSome sincere Christians consider romantic love the whipped cream on the sundae of marriage - decorative, but unnecessary. They see this as a lower form of love that husbands and wives should disregard in their search for higher ground.\r\n\r\nSome individuals feel uncertain about the value of romantic love because they confuse the genuine article with that frothy substitute known as temporary infatuation.\r\n\r\nSome try to suppress all thought of romantic love because they are not experiencing it. They rationalize, \"I don\'t have it; it must not exist,\" or think, \"It\'s not possible in my marriage.\"\r\n\r\nIn spite of all this, just about everyone inwardly longs for a thrilling love relationship involving oneness, a deep intimacy with another person, joy and optimism, spice and excitement, and that wonderful, euphoric, almost indescribable sensation known as \"being in love.\" \r\n', '1330494050Restoring Romance to Your Marriage.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Restoring-Romance-to-Your-Marriage-1330494050Restoring-Romance-to-Your-Marriage.doc', '60416', 0, 1, 'doc', 193, 1, NULL, NULL, 1, 1, '2012-02-28 21:40:50', NULL),
(1391, 'Living With An Unsaved Spouse', 'Living With An Unsaved Spouse.doc', 'Many dedicated Christians have unsaved mates. This is usually \r\nbecause of a wife or husband becoming a Christian after the \r\nmarriage ceremony, while the spouse remains an unbeliever.\r\n\r\nSo how then does the believing spouse conduct himself/herself?\r\n', '1330494304Living With An Unsaved Spouse.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Living-With-An-Unsaved-Spouse-1330494304Living-With-An-Unsaved-Spouse.doc', '65536', 0, 1, 'doc', 194, 1, NULL, NULL, 1, 1, '2012-02-28 21:45:04', NULL),
(1392, 'Divorce: Coping With the Pain', 'Divorce, Coping With the Pain.doc', 'In spite of your religious convictions and your commitment to \r\nmarriage, you may find yourself involved in a divorce suit - \r\neither by your own choice or completely against your will.\r\n\r\nThere is a naive notion, especially among Christians, that having strong religious convictions against divorce and wanting a marriage to work are enough to make it work. But that just isn\'t true. For any marriage to succeed, both spouses must be committed to the relationship and willing to do whatever is necessary to maintain it. Willingness on the part of one is not enough.\r\n\r\nThis is written for those who, though they may have desired to remain married, have been forced by the actions of their spouse to separate or divorce. Their mental health and physical safety \r\ndepended on such a decision.\r\n', '1330494579Divorce, Coping With the Pain.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Divorce:-Coping-With-the-Pain-1330494579Divorce,-Coping-With-the-Pain.doc', '77824', 0, 1, 'doc', 195, 1, NULL, NULL, 1, 1, '2012-02-28 21:49:39', NULL),
(1393, 'When Sex Becomes An Addiction', 'When Sex Becomes An Addiction.doc', '', '1330494794When Sex Becomes An Addiction.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/When-Sex-Becomes-An-Addiction-1330494794When-Sex-Becomes-An-Addiction.doc', '97792', 0, 1, 'doc', 196, 1, NULL, NULL, 1, 1, '2012-02-28 21:53:14', NULL),
(1394, 'Fighting For Your Marriage', 'Fighting For Your Marriage.doc', 'This article shares about protecting your marriage.', '1330495788Fighting For Your Marriage.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Fighting-For-Your-Marriage-1330495788Fighting-For-Your-Marriage.doc', '40960', 0, 1, 'doc', 197, 1, NULL, NULL, 1, 1, '2012-02-28 22:09:48', NULL),
(1395, 'Victims of Divorce: The Children', 'Victims of Divorce the Children.doc', 'It\'s caring people - not programs - that can make a difference in providing for a child\'s emotional needs.\r\n\r\nChildren whose parents are divorced are a fast growing segment of our society. They are all around us - not only in our communities, but also in our churches.\r\n\r\nWhat about these children?  Do they and their families face distinct problems in the Christian community?  Who is responsible to meet their needs?  What can we, as Christians, do to help?\r\n', '1330495982Victims of Divorce the Children.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Victims-of-Divorce:-The-Children-1330495982Victims-of-Divorce-the-Children.doc', '37376', 0, 1, 'doc', 198, 1, NULL, NULL, 1, 1, '2012-02-28 22:13:02', NULL),
(1396, 'Our Friends are Getting a Divorce, what can We Do?', 'Our Friends are Getting a Divorce, What Can We Do.doc', 'What do you do when your close friends going through or getting a divorce?', '1330499189Our Friends are Getting a Divorce, What Can We Do.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Our-Friends-are-Getting-a-Divorce,-what-can-We-Do?-1330499189Our-Friends-are-Getting-a-Divorce,-What-Can-We-Do.doc', '31744', 0, 1, 'doc', 200, 1, NULL, NULL, 1, 1, '2012-02-28 23:06:29', NULL),
(1397, 'Living with a Controller', 'Living With a Controller.doc', 'What do you do when you live with a spouse deemed to be a \"controller\" ?', '1330499707Living With a Controller.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Living-with-a-Controller-1330499707Living-With-a-Controller.doc', '38912', 0, 1, 'doc', 199, 1, NULL, NULL, 1, 1, '2012-02-28 23:15:07', NULL),
(1398, 'Discipling the Divorced', 'Discipling the Divorced.doc', 'How do you pastor the Divorced or \"Single\" again saints?', '1330503709Discipling the Divorced.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Discipling-the-Divorced-1330503709Discipling-the-Divorced.doc', '48640', 0, 1, 'doc', 201, 1, NULL, NULL, 1, 1, '2012-02-29 00:21:49', NULL),
(1399, 'Halloween, Is It for Christians', 'Halloween, Is It for Christians.doc', '', '1330504246Halloween, Is It for Christians.doc', 'http://apostolictoolbox.s3.amazonaws.com/alex_tss/Halloween,-Is-It-for-Christians-1330504246Halloween,-Is-It-for-Christians.doc', '54784', 75, 1, 'doc', 0, 1, NULL, NULL, 1, 1, '2012-02-29 00:30:46', '2012-02-29 02:01:23'),
(1400, 'Victims of Violence', 'Violence in Media, Fantasy Life (Part 1).doc', 'What you allow your fantasies to feed on creates \r\nappetites in your mind from which come the choices, \r\nactivities and reality of your daily life. \r\n\r\nSo, this whole idea that what the media feeds our \r\nfantasies on TV, in the movies, in video and computer games \r\nhas no impact on our activities, is nonsense! \r\n', '1330504478Violence in Media, Fantasy Life (Part 1).doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Victims-of-Violence-1330504478Violence-in-Media,-Fantasy-Life-(Part-1).doc', '34816', 0, 1, 'doc', 188, 1, NULL, NULL, 1, 1, '2012-02-29 00:34:38', '2012-02-29 00:44:53'),
(1401, 'Victims of Violence', 'Steps to Recovery (Part 2).doc', 'What you allow your fantasies to feed on creates \r\nappetites in your mind from which come the choices, \r\nactivities and reality of your daily life. \r\n\r\nSo, this whole idea that what the media feeds our \r\nfantasies on TV, in the movies, in video and computer games \r\nhas no impact on our activities, is nonsense! \r\n', '1330504478Steps to Recovery (Part 2).doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Victims-of-Violence-1330504478Steps-to-Recovery-(Part-2).doc', '33792', 0, 1, 'doc', 188, 1, NULL, NULL, 1, 1, '2012-02-29 00:34:38', NULL),
(1402, 'Victims of Violence ', 'When Evil Things Happen (Part 4).doc', 'What you allow your fantasies to feed on creates \r\nappetites in your mind from which come the choices, \r\nactivities and reality of your daily life. \r\n\r\nSo, this whole idea that what the media feeds our \r\nfantasies on TV, in the movies, in video and computer games \r\nhas no impact on our activities, is nonsense! \r\n', '1330505065When Evil Things Happen (Part 4).doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Victims-of-Violence--1330505065When-Evil-Things-Happen-(Part-4).doc', '36352', 0, 1, 'doc', 188, 1, NULL, NULL, 1, 1, '2012-02-29 00:44:25', '2012-02-29 00:45:09'),
(1403, 'When Adultery Strikes Your Marriage', 'When Adultery Strikes Your Marriage.doc', 'At one time or another over 60 percent of American marriages will suffer from an affair. In the vast majority of cases, the couple is better by taking their marriage to Calvary.\r\n\r\nIn fact, the crisis of an affair brings many spouses to Christ. \r\nAnd, when couples take their marriage to Calvary they never have to take it to court. However, in a few cases drug abuse, wife abuse, child abuse, child sexual abuse, or a series of adulterous affairs make it impossible for the marriage to survive.\r\n\r\nAlthough each couple is unique, the questions they \r\npresent are very similar. This article discusses the five questions most frequently asked by couples whose marriage is suffering from adultery.\r\n\r\n', '1330505406When Adultery Strikes Your Marriage.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/When-Adultery-Strikes-Your-Marriage-1330505406When-Adultery-Strikes-Your-Marriage.doc', '34304', 0, 1, 'doc', 188, 1, NULL, NULL, 1, 1, '2012-02-29 00:50:06', NULL),
(1404, 'When a Child Dies', 'When a Child Dies.doc', 'Death, when it strikes a child, seems especially absurd. The young are just not supposed to die. This, rather than a lack of compassion, is what makes it difficult for clergy to help bereaved families, whose loss often brings \r\nfeelings of neglect and abandonment.\r\n\r\nDuring the past seven years the writer has had contact with some 225 families whose child had died. Based on his experiences, he offers several suggestions for ministers who worry about saying or doing the wrong thing in such situations.\r\n', '1330505660When a Child Dies.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/When-a-Child-Dies-1330505660When-a-Child-Dies.doc', '27648', 0, 1, 'doc', 202, 1, NULL, NULL, 1, 1, '2012-02-29 00:54:20', NULL),
(1405, 'Euthanasia: Dioethics of Dying', 'Euthanasia, Dioethics of Dying.doc', 'Euthanasia is the granting of a painless death to a hopelessly \r\nill patient with an incurable disease. It also means the act of putting to death the incurable and terminally ill. \r\n\r\nIt conveys the idea that death is positive and that to allow death or shorten the dying process is a benevolent act. Mercy for the hopelessly ill and suffering patient who seeks death has been a primary justification given by advocates of legalizing voluntary euthanasia.\r\n\r\nSo, should this take place?\r\n', '1330506144Euthanasia, Dioethics of Dying.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Euthanasia:-Dioethics-of-Dying-1330506144Euthanasia,-Dioethics-of-Dying.doc', '110080', 0, 1, 'doc', 203, 1, NULL, NULL, 1, 1, '2012-02-29 01:02:24', NULL),
(1406, 'Identifying and Overcoming Post-Abortion Syndrome', 'Identifying and Overcoming Post-Abortion Syndrome.doc', 'This article shares about how to identify and minister to saints who have post-abortion syndrome.', '1330506423Identifying and Overcoming Post-Abortion Syndrome.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Identifying-and-Overcoming-Post-Abortion-Syndrome-1330506423Identifying-and-Overcoming-Post-Abortion-Syndrome.doc', '103424', 0, 1, 'doc', 204, 1, NULL, NULL, 1, 1, '2012-02-29 01:07:03', '2012-02-29 01:07:52'),
(1407, 'Responding to a Woman with a Crisis Pregnancy', 'Responding to a Woman with a Crisis Pregnancy.doc', 'Every crisis pregnancy involves a unique set of circumstances, and the variety of problems that can occur is endless. The 16-year-old in Beverly Hills will deal with different issues than her counterpart in the inner city. The concerns of a 40-year-old house wife with four children will not be the same as those of a 20-year-old college student. The pregnant runaway \r\non drugs will see her life differently from the honor student who \"went too far\" once or twice with her boyfriend. \r\n\r\nNevertheless, certain emotions and patterns occur often enough that they should be taken into account by anyone who knows and cares about a woman who feels any conflict about her pregnancy.\r\n\r\nThis article shares further...', '1330506702Responding to a Woman with a Crisis Pregnancy.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Responding-to-a-Woman-with-a-Crisis-Pregnancy-1330506702Responding-to-a-Woman-with-a-Crisis-Pregnancy.doc', '56320', 0, 1, 'doc', 204, 1, NULL, NULL, 1, 1, '2012-02-29 01:11:42', NULL),
(1408, 'Help for Pregnant Teens', 'Help for Pregnant Teens.doc', 'If you are pregnant and unmarried, a teenager living at home or perhaps away at school, right now you are probably afraid, confused and torn by many emotions. Where do you go from here? To whom can you turn? Don\'t despair. Your future is changed, but not finished. With careful thought and some help, opportunities still lie ahead.\r\n', '1330507222Help for Pregnant Teens.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Help-for-Pregnant-Teens-1330507222Help-for-Pregnant-Teens.doc', '51712', 0, 1, 'doc', 205, 1, NULL, NULL, 1, 1, '2012-02-29 01:20:22', NULL),
(1409, 'Escaping Anorexia and Bulimia', 'Escaping Anorexia and Bulimia.doc', 'The scene is all to common: A woman at the health club looks at herself in the mirror and thinks, I\'m such a blimp! I\'ve got to do something. I\'ve got to lose more weight. To other people, however, she looks skinny, even emaciated. Her clothes hang on her, and she seems wispy as a feather. She looks like she hasn\'t eaten in months!\r\n\r\nHow do we handle such situations?\r\n', '1330507960Escaping Anorexia and Bulimia.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Escaping-Anorexia-and-Bulimia-1330507960Escaping-Anorexia-and-Bulimia.doc', '42496', 0, 1, 'doc', 206, 1, NULL, NULL, 1, 1, '2012-02-29 01:32:40', NULL),
