(1412, 'Two Kinds of Wisdom', 'Two Kinds of Wisdom.docx', 'Wisdom was the key to prosperity, success and living to a ripe old age. In those days if you survived to old age, you must have been wise to avoid death because people usually died early. Wisdom was so sought after in the ancient world that when Solomon was asked by God in 1 Kings 4 of all thing in this world what do want, Solomon said â€œwisdom.â€ ', '1330538992Two Kinds of Wisdom.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Two-Kinds-of-Wisdom-1330538992Two-Kinds-of-Wisdom.docx', '21455', 0, 1, 'docx', 11, 1, NULL, NULL, 1, 1, '2012-02-29 10:09:52', NULL),
