(1423, 'Tidbits to Remember about Prison Ministry', 'Tidbits to Remember about Prison Ministry.docx', 'When you plan to start a Prison Ministry, what are some of things you need to take into consideration? ', '1331007904Tidbits to Remember about Prison Ministry.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Tidbits-to-Remember-about-Prison-Ministry-1331007904Tidbits-to-Remember-about-Prison-Ministry.docx', '15877', 0, 1, 'docx', 208, 1, NULL, NULL, 1, 1, '2012-03-05 20:25:04', NULL),
(1467, 'Training Altar Workers', 'Training Altar Workers.doc', 'These are Tips for Training Altar Workers.', '1331277258Training Altar Workers.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Training-Altar-Workers-1331277258Training-Altar-Workers.doc', '50176', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-08 23:14:18', NULL),
(1465, 'Soul Winning at Church', 'Soul Winning at Church.doc', 'Soul winning is not one of the nine gifts of the spirit. In fact, soul winning is not a gift at all. It is the responsibility and the purpose of the church to win souls. The promise of heaven is not the only reason we are saved. We are saved to win the lost. One of the most important, easiest and yet most forgotten ways of soul winning, is still our local church!', '1331276861Soul Winning at Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Soul-Winning-at-Church-1331276861Soul-Winning-at-Church.doc', '38400', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-08 23:07:41', NULL),
(1426, 'Altar Worker\'s Seminar', 'Altar Worker\'s Seminar.docx', 'This article shares with us some of the things Altar workers need to take note of.', '1331009298Altar Worker\'s Seminar.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Altar-Worker\'s-Seminar-1331009298Altar-Worker\'s-Seminar.docx', '12353', 0, 1, 'docx', 210, 1, NULL, NULL, 1, 1, '2012-03-05 20:48:18', '2012-03-09 09:05:12'),
(1469, 'Leading at the Altar', 'Leading at the Altar.doc', 'Leading at the altar\", is it really that important? If you feel the altar is a vital part of Apostolic church services, and meetings, then you must see the importance of trained, spiritually mature leaders, who can effectively assist the seeker in his quest for God. If God is concerned enough to be at the altar with the seeker, shouldn\'t we be? Isn\'t Christian leadership leading people to Jesus Christ? Enough said on the importance of our subject. Let\'s deal with some practical helps that can assist you.', '1331277839Leading at the Altar.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Leading-at-the-Altar-1331277839Leading-at-the-Altar.doc', '40448', 0, 1, 'doc', 31, 1, NULL, NULL, 1, 1, '2012-03-08 23:23:59', NULL),
(1468, 'Counselors Class', 'Counselors Class.doc', 'The Altar is a special place, where God does some marvelous things in the lives of hungry individuals. What takes place around the altar is crucial to their experience, good or bad, and we as counselors have a great deal to do with that experience. Think for a moment, 99% of those who pray around the altar are greatly encouraged or discouraged by PEOPLE!!! Remember back when you first came to the altar, did you save someone there to pray with you and to help, or did you find the Lord all by yourself? I dare say that almost without exception someone was there for you as you prayed. What we want to do, as counselors, is to be a help and not a hinderance, To make their stay at the altar a profitable one, and to lead them to all that God has for them IN THE MOST EFFECTIVE WAY!\r\n', '1331277671Counselors Class.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Counselors-Class-1331277671Counselors-Class.doc', '44032', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-08 23:21:11', NULL),
(1466, 'Altar Worker\'s Seminar', 'Altar Worker\'s Seminar.doc', 'This article shares with us some of the things Altar workers need to take note of.', '1331277082Altar Worker\'s Seminar.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Altar-Worker\'s-Seminar-1331277082Altar-Worker\'s-Seminar.doc', '25600', 0, 1, 'doc', 210, 1, NULL, NULL, 1, 1, '2012-03-08 23:11:22', NULL),
(1463, 'Helping People Receive the Holy Ghost', 'Helping People Receive the Holy Ghost.doc', 'Receiving the Holy Ghost is a crucial part of God\'s plan of salvation. So how do we assist people in receiving the Holy Ghost?', '1331276190Helping People Receive the Holy Ghost.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Helping-People-Receive-the-Holy-Ghost-1331276190Helping-People-Receive-the-Holy-Ghost.doc', '28672', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-08 22:56:30', NULL),
(1470, 'The Methodology for Establishing an Altar Evangelism Ministry', 'The Methodology for Establishing an Altar Evangelism Ministry.doc', '\"Let all things be done decently and in order.\" (I Corin. 14:40) \"The Order\" is our admonishment in setting forth any operation within the church. Order must be kept about functions, meetings, schedules, and data records of the individuals who have been ministered to. \"GO YE THEREFORE...\" (St. Matthew 28:19) This familiar scripture is significant to us in the operative words, GO, TEACH, and BAPTIZE. These are all action words. Altar evangelists have been called to work! It is noteworthy to understand that you have not been called to a ministry, but rather you have been called to work in a ministry. The work of the Altar Evangelist is to aid in the birthing of souls into God\'s kingdom. It requires sensitivity to meet the needs of individuals who come to the altar. You become an extension of the pastor or minister, and work as \"agents of mobility\" as the Spirit of God so directs.', '1331278024The Methodology for Establishing an Altar Evangelism Ministry.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Methodology-for-Establishing-an-Altar-Evangelism-Ministry-1331278024The-Methodology-for-Establishing-an-Altar-Evangelism-Ministry.doc', '58880', 0, 1, 'doc', 211, 1, NULL, NULL, 1, 1, '2012-03-08 23:27:04', NULL),
(1471, 'The Cell Chuch', 'The Cell Church.doc', 'Ralph Neighbour, whose book, Where Do We Go From Here? (Touch Publications), has had a profound impact on the thinking of many church leaders (including Finto), defines a \"cell church\" as one that \"is built on the principle that all Christians are ministers.\" In Cell Church Magazine, Neighbour explains the cell concept this way: \"According to Ephesians 4:8, God has provided gifts to men to equip \'believers who are gifted\' to do the work of ministry. Such a church is not built around the assembly of all its members but the clustering of believers to become \'basic Christian communities\' which do the work of ministry from cell groups that meet in homes. These cells then cluster for area congregation activities, and assemble regionally for \'celebration\' times. The life of the church is in its cells, not in a building.\"', '1331278204The Cell Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Cell-Chuch-1331278204The-Cell-Church.doc', '64000', 0, 1, 'doc', 213, 1, NULL, NULL, 1, 1, '2012-03-08 23:30:04', NULL),
(1431, 'test file', 'Sample.docx', '', '1331019764Sample.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/test-file-1331019764Sample.docx', '15309', 0, 0, 'docx', 0, 1, NULL, NULL, 1, 1, '2012-03-05 23:42:44', NULL),
(1432, 'How to be a Christian in the workplace', 'How to be a Christian in the workplace.pdf', '', '1331043977How to be a Christian in the workplace.pdf', 'http://apostolictoolbox.s3.amazonaws.com/kewalpradhan/How-to-be-a-Christian-in-the-workplace-1331043977How-to-be-a-Christian-in-the-workplace.pdf', '4613972', 73, 1, 'pdf', 212, 1, NULL, NULL, 1, 1, '2012-03-06 06:26:17', '2012-03-06 06:44:50'),
(1473, 'Developing a Successful Hospital Ministry', 'Developing a Successful Hospital Ministry.doc', 'Developing a Successful Hospital Ministry', '1331278576Developing a Successful Hospital Ministry.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Developing-a-Successful-Hospital-Ministry-1331278576Developing-a-Successful-Hospital-Ministry.doc', '69632', 0, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-03-08 23:36:16', NULL),
(1472, 'Why American Cell Churches Fail', 'Why American Cell Churches Fail.doc', 'Can American churches ever achieve the same evangelistic impact on their cities as Yoido Full Gospel Church has in Seoul? Is this kind of church growth possible in our nation? Is the Korean phenomenon some kind of socio-religious fluke? Like advice, speculation is free and plentiful. Why do cell group systems struggle and fail? This article lists five reasons-and what Christian leaders can do to beat them.', '1331278429Why American Cell Churches Fail.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Why-American-Cell-Churches-Fail-1331278429Why-American-Cell-Churches-Fail.doc', '39424', 0, 1, 'doc', 214, 1, NULL, NULL, 1, 1, '2012-03-08 23:33:49', NULL),
(1474, 'Absentee Contact Program', 'Absentee Contact Program.doc', 'Q: So what is an Absentee Contact Program? \r\n\r\nA: A program to lend a hand, to establish friendship, to show someone cares. To target problem areas that will assist in other outreach programs and may include the involvement of other outreach programs. To target weaknesses within the body which will allow us to build and develop the church as a whole. To encourage regular attendance.\r\n', '1331278760Absentee Contact Program.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Absentee-Contact-Program-1331278760Absentee-Contact-Program.doc', '33792', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-08 23:39:20', NULL),
(1479, 'The Church Growth Spiral', 'The Church Growth Spiral.doc', 'Growth comes as the result of sowing the Gospel seed. If you sow it abundantly, your harvest will be abundant. But the adverse of that is true also. Meager sowing brings meager results. The key lies in a pastor being able to motivate his people to sow seed (the Word of God)on a regular, consistent basis. The word \"consistency\" is the true focus here. It has been said that a leaking faucet will put out more water than a fire hydrant . . . if the faucet drips all year long and the hydrant is turned on full blast for only an hour. Too often we sow seed by the \"fire hydrant\" method.', '1331280876The Church Growth Spiral.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Church-Growth-Spiral-1331280876The-Church-Growth-Spiral.doc', '86528', 0, 1, 'doc', 61, 1, NULL, NULL, 1, 1, '2012-03-09 00:14:36', NULL),
(1478, 'Ten Most Wanted', 'Ten Most Wanted.doc', 'What if every believer in our group got excited about seeing their Ten Most Wanted come to Christ... What difference would it make in our church, in our community, in our country... in ETERNITY? How do I actually think/feel about Heaven... Hell... Personally sharing my faith... attracting people to Christ?', '1331280749Ten Most Wanted.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Ten-Most-Wanted-1331280749Ten-Most-Wanted.doc', '33792', 0, 1, 'doc', 217, 1, NULL, NULL, 1, 1, '2012-03-09 00:12:29', NULL),
(1477, 'How to Double Your Attendance', 'How to Double Your Attendance.doc', '\"YOU CAN DOUBLE THIS YEAR!\" It really isn\'t a dream or something someone else can do and not you, Your church can grow!!! There are spiritual requirements, of course, but we realize you know that so no time will be taken to bear that out. But what can be done then?', '1331280586How to Double Your Attendance.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Double-Your-Attendance-1331280586How-to-Double-Your-Attendance.doc', '45568', 0, 1, 'doc', 216, 1, NULL, NULL, 1, 1, '2012-03-09 00:09:46', NULL),
(1476, 'Church Growth Through Outreach Methods', 'Church Growth Through Outreach Methods.doc', 'The key to church growth is known as \"Saturation Evangelism\". We must and will saturate our city with this message. Business firms must know of us. Every home must hear of us. Our city must be aware of our presence. The following methods will help us to saturate the city \"For His Name\'s Sake\".', '1331280377Church Growth Through Outreach Methods.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Church-Growth-Through-Outreach-Methods-1331280377Church-Growth-Through-Outreach-Methods.doc', '32768', 0, 1, 'doc', 215, 1, NULL, NULL, 1, 1, '2012-03-09 00:06:17', NULL),
(1475, 'Total Church Outreach Involvement Night', 'Total Church Outreach Involvement Night.doc', 'Every pastor feels the prime goal of his church must be to grow. He\'s right, for God\'s greatest plan is to save the lost. Therefore, the pastor must plan to put soul-winning in the highest regard and ambition of each local member. It dare not be relegated to secondary,spare time, sporadic emphasis or do as you feel led. He must lead here, as in nothing else, if he wants and expects his church to grow, there are many ways to do this. However it is done, it must be emphasized, regular and involve every member of the church. One plan is to have a regular night for Outreach. It must be so set up to involve every member of the family, There can be no excuse. The church is to do the Lord\'s work; reaching out for souls in the by-ways and hedges. It is the church that will bear children and save the lost.', '1331278989Total Church Outreach Involvement Night.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Total-Church-Outreach-Involvement-Night-1331278989Total-Church-Outreach-Involvement-Night.doc', '28672', 0, 1, 'doc', 80, 1, NULL, NULL, 1, 1, '2012-03-08 23:43:09', NULL),
(1480, '	Launching a \"Constant Contact Consciousness\" Ministry in the Local Church', 'Launching a Constant Contact Consciousness Ministry in the Local Church.doc', 'Constant Contact Consciousness means exactly what the name implies: being constantly conscience of the need to contact people for the Lord. It is a simple, yet highly effective method to encourage your people to give their personal testimony and share the word of God. Personal witnessing is a powerful method of outreach. It will give a church more home Bible studies, visitors, and prospects than any other ministry.', '1331281212Launching a Constant Contact Consciousness Ministry in the Local Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/	Launching-a-\"Constant-Contact-Consciousness\"-Ministry-in-the-Local-Church-1331281212Launching-a-Constant-Contact-Consciousness-Ministry-in-the-Local-Church.doc', '36352', 0, 1, 'doc', 61, 1, NULL, NULL, 1, 1, '2012-03-09 00:20:12', NULL),
(1481, '	How to Develop An Effective \"Saturday Door Knocking\" Ministry', 'How to Develop An Effective Saturday Door Knocking Ministry.doc', 'For years, door knocking was about the only type of consistent outreach - outside of occasional street services - that you would find in most Pentecostal churches. \"Outreach\" and \"door knocking\" were pretty much synonymous terms: where you found the one, you would normally find the other. Today, except for a handful of die-hard adherents, few churches walk the neighbourhoods and ring the doorbells. We have seemingly surrendered the entire program over to the Mormons and Jehovah\'s Witnesses. Most pastors see little profit to this \"cold turkey\" approach of evangelism. However, even though traditional door knocking and canvassing has not reaped a great amount of results in the past, several new approaches have given greater productivity to this type of ministry, bringing a re-evaluation in the hearts of many. Not only are churches seeing greater results, but many pastors have come to realize that there is a large percent of people in their churches that will become involved - and even enjoy - the Saturday Door Knocking ministry. Perhaps this is because such a heavy emphasis has been placed here in the past. Or maybe it\'s because that\'s what Mom and Dad always did. But whatever the reason, the doorbells are ringing again and the churches doing so are singing it\'s praises as new converts are being won to Jesus Christ. What has brought about this change? Simply this: A realization that for any outreach to be effective, it must meet people\'s needs.', '1331281364How to Develop An Effective Saturday Door Knocking Ministry.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/	How-to-Develop-An-Effective-\"Saturday-Door-Knocking\"-Ministry-1331281364How-to-Develop-An-Effective-Saturday-Door-Knocking-Ministry.doc', '38400', 0, 1, 'doc', 61, 1, NULL, NULL, 1, 1, '2012-03-09 00:22:44', NULL),
(1482, 'Bearing Fruit: A Ministry of Evangelism & Growt', 'Bearing Fruit, A Ministry of Evangelism & Growth.doc', 'The \"Bearing Fruit\" program focuses upon this principle of evangelism. The following outline is designed to assist you in implementing this simple ministry within your local church and I am sure you will find, as others have, that the results are substantial and consistent.', '1331281575Bearing Fruit, A Ministry of Evangelism & Growth.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Bearing-Fruit:-A-Ministry-of-Evangelism-&-Growt-1331281575Bearing-Fruit,-A-Ministry-of-Evangelism-&-Growth.doc', '31744', 0, 1, 'doc', 61, 1, NULL, NULL, 1, 1, '2012-03-09 00:26:15', NULL),
(1495, '6 Ideas for Making Your Revivals More Effective', '6 Ideas for Making Your Revivals More Effective.doc', 'This article shares 6 ideas on how to make \"Revival\" events more effective.', '13312845756 Ideas for Making Your Revivals More Effective.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/6-Ideas-for-Making-Your-Revivals-More-Effective-13312845756-Ideas-for-Making-Your-Revivals-More-Effective.doc', '30720', 0, 1, 'doc', 226, 1, NULL, NULL, 1, 1, '2012-03-09 01:16:15', NULL),
(1496, 'How to Organize a Four-Church Revival Crusade', 'How to Organize a Four-Church Revival Crusade.doc', 'A revival crusade provides an evangelistic stimulus that helps men and women overcome barriers of apathy and indifference. Some of these methods can be used to organize a four-church revival crusade.\r\n', '1331284730How to Organize a Four-Church Revival Crusade.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-to-Organize-a-Four-Church-Revival-Crusade-1331284730How-to-Organize-a-Four-Church-Revival-Crusade.doc', '33792', 0, 1, 'doc', 227, 1, NULL, NULL, 1, 1, '2012-03-09 01:18:50', NULL),
(1483, 'Saturation Visitation', 'Saturation Visitation.doc', 'The following outline is not designed to be a \"visitation\" program only. It is, however, intended as a plan of witnessing saturation of your area with complete records, organization, follow-up and review. Study it carefully and implement it in detail. It works!', '1331281684Saturation Visitation.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Saturation-Visitation-1331281684Saturation-Visitation.doc', '56320', 0, 1, 'doc', 102, 1, NULL, NULL, 1, 1, '2012-03-09 00:28:04', NULL),
(1484, 'Door-to-Door Visitation', 'Door-to-Door Visitation.doc', 'Polls show that 80 percent of Americans describe themselves as Christians but that only about 50 percent attend church regularly. The rest are unchurched-at least one hundred million people. Others stress that many more millions are only nominally churched, so that the number of the unchurched in America should be put at 150 million. The unchurched share many basic beliefs with the churched. Many believe that Christ is fully God and fully human. More than 60 percent of all Americans believe Christ will return to earth some day. Thirty percent of Americans have had a \"born again\" conversion experience. There are very few atheists; 98 percent of all Americans profess to believe in God. However, some say that the importance of religion is declining for them. So what can be done?', '1331281861Door-to-Door Visitation.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Door-to-Door-Visitation-1331281861Door-to-Door-Visitation.doc', '65536', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-09 00:31:01', NULL),
(1485, 'A Total Balanced Plan of Outreach', 'A Total Balanced Plan of Outreach.doc', 'Every church needs a total program to involve every person in soul-winning outreach. Often different plans concerning various phases of soul-winning are presented and we become very thrilled over these. Sometimes other effective methods are abandoned to concentrate upon a new and exciting way. However, each church needs a balanced program to involve the entire church at all times in some form of soul-winning. There is a place for everyone in personal Evangelism, soul-winning outreach. Though we cannot assume that every person in the church is suited to do every type of evangelism, yet everyone can do something. A home Bible study course may be too difficult for the new convert to conduct, but he can do Sunday school invitation and other types of soul-winning outreach and give his testimony. This is the most concise plan for a total and balanced soul-winning outreach ever presented.', '1331282035A Total Balanced Plan of Outreach.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/A-Total-Balanced-Plan-of-Outreach-1331282035A-Total-Balanced-Plan-of-Outreach.doc', '41472', 0, 1, 'doc', 102, 1, NULL, NULL, 1, 1, '2012-03-09 00:33:55', NULL),
(1486, 'Harvest Campaign Bible Study', 'Harvest Campaign Bible Study.doc', 'By the reference of \"two or three\" the Doctrine of Jesus Christ was established. It is with this same scriptural principle we compiled this Home Bible Study. We do not want to teach denominationalism, but let the Scriptures speak for themselves. By the reference of \"two of three witnesses\" from the Scriptures we hope to show the Doctrine of Jesus Christ.', '1331282209Harvest Campaign Bible Study.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Harvest-Campaign-Bible-Study-1331282209Harvest-Campaign-Bible-Study.doc', '34304', 0, 1, 'doc', 218, 1, NULL, NULL, 1, 1, '2012-03-09 00:36:49', NULL),
(1487, 'Tips for Passing Out Tracts', 'Tips for Passing Out Tracts.doc', 'We should use every means possible to get the gospel out. Among the various media of communication, the tract remains as one of the most effective. During the past few years it has been sadly neglected. However, at the time of this great ENDTIME REVIVAL, the tract, again, should be brought into play. This article is furnished for your information and designed to be helpful to you in instructing soul-winners in the proper method of tract distribution.', '1331282342Tips for Passing Out Tracts.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Tips-for-Passing-Out-Tracts-1331282342Tips-for-Passing-Out-Tracts.doc', '49152', 0, 1, 'doc', 102, 1, NULL, NULL, 1, 1, '2012-03-09 00:39:02', NULL),
(1488, 'Plan of Implementation for Total Church Growth', 'Plan of Implementation for Total Church Growth.doc', 'This article shares a Plan of Implementation for Total Church Growth.', '1331282540Plan of Implementation for Total Church Growth.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Plan-of-Implementation-for-Total-Church-Growth-1331282540Plan-of-Implementation-for-Total-Church-Growth.doc', '35840', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-09 00:42:20', NULL),
(1489, 'Are Home Cell Groups A New Fad?', 'Are Home Cell Groups A New Fad.doc', 'Almost every major renewal in the Christian church has brought with it a return to small groups and a rapid increase of such groups in individual homes for prayer, Bible study and a sharing of faith. And it\'s happening again. Small groups were a common ingredient in the important movements of the Holy Spirit throughout church history. They characterized early Pietism, the Wesleyan Revival and the Holiness Revival of the late 1800s.', '1331282709Are Home Cell Groups A New Fad.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Are-Home-Cell-Groups-A-New-Fad?-1331282709Are-Home-Cell-Groups-A-New-Fad.doc', '36864', 0, 1, 'doc', 219, 1, NULL, NULL, 1, 1, '2012-03-09 00:45:09', NULL),
(1490, 'Evangelism in Small Towns and Rural Areas', 'Evangelism in Small Towns and Rural Areas.doc', 'How does the small town or rural church reach out and grow? This is a question of increasing urgency to many Christian Reformed churches.', '1331282910Evangelism in Small Towns and Rural Areas.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Evangelism-in-Small-Towns-and-Rural-Areas-1331282910Evangelism-in-Small-Towns-and-Rural-Areas.doc', '39424', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-09 00:48:30', NULL),
(1491, 'The Inviting Church', 'The Inviting Church.doc', 'Attracting and keeping visitors is a major concern of growing churches and presents both an opportunity and a challenge.\r\n\r\nGrowing churches that are effectively attracting and keeping visitors have good ideas to share, but not many books have been written on the subject.\r\n\r\nA survey of growing, inviting Assemblies of God congregations in 11 states (the East, North, South, and Midwest) indicates that all are using the same basic methods, which are usually omitted by non-growing churches. These methods fall into three categories: invitations, welcoming, and follow-up.\r\n', '1331283252The Inviting Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Inviting-Church-1331283252The-Inviting-Church.doc', '33792', 0, 1, 'doc', 220, 1, NULL, NULL, 1, 1, '2012-03-09 00:54:12', NULL),
(1492, 'Filled to Speak', 'Filled to Speak.doc', 'What people pray for is sometimes an indication of their priorities. It can help them know if the kingdom of God or personal concerns come first (Matthew 6:33). In the early days of the Church, when believers were persecuted, they prayed not for protection but for confidence in witnessing (Acts 4:29). Jesus\' last instruction became their priority: \"But ye shall receive power, after that the Holy Ghost is come upon you: and ye shall be witnesses\" (Acts 1:8). Witnessing should be a priority activity for the Church.', '1331283426Filled to Speak.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Filled-to-Speak-1331283426Filled-to-Speak.doc', '30208', 0, 1, 'doc', 221, 1, NULL, NULL, 1, 1, '2012-03-09 00:57:06', NULL),
(1493, 'Some Myths of Evangelism', 'Some Myths of Evangelism.doc', 'A positive attitude in witnessing is very important. Before we ever meet with the person to whom we are going to witness, we must overcome some defeatist myths that may prevent us from being effective communicators of spiritual truth.\r\n\r\n', '1331283691Some Myths of Evangelism.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Some-Myths-of-Evangelism-1331283691Some-Myths-of-Evangelism.doc', '30720', 0, 1, 'doc', 224, 1, NULL, NULL, 1, 1, '2012-03-09 01:01:31', NULL),
(1494, 'Remember...You Can Be A Good Witness for Jesus', 'Remember You Can Be A Good Witness for Jesus.doc', 'How can you be a good witness for Jesus?', '1331284384Remember You Can Be A Good Witness for Jesus.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Remember...You-Can-Be-A-Good-Witness-for-Jesus-1331284384Remember-You-Can-Be-A-Good-Witness-for-Jesus.doc', '35840', 0, 1, 'doc', 225, 1, NULL, NULL, 1, 1, '2012-03-09 01:13:04', NULL),
(1455, 'Do everything with excellence', 'DO EVERYTHING WITH EXCELLENCE.doc', 'Perfection is the act of being perfect while excellence is striving to be perfect. \r\nPerfection is being absolutely flawless, without error, never making any mistakes. Excellence is allowing our God-given talents to express themselves to the max.\r\n\r\nPerfection is a fear of mistakes while excellence sees opportunities for improvement. \r\nPerfection is attempting to be in control while excellence is allowing god to be in control. \r\nPerfection is setting unreasonably standards will beyond reach. Excellence is setting high and perhaps difficult to attain, but attainable standards. \r\nPerfection can lead to misery and failure - itâ€™s simply not attainable here on Earth. Excellence, however, leads to fulfillment and greatness. \r\n', '1331132192DO EVERYTHING WITH EXCELLENCE.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Do-everything-with-excellence-1331132192DO-EVERYTHING-WITH-EXCELLENCE.doc', '79360', 0, 1, 'doc', 11, 1, NULL, NULL, 1, 1, '2012-03-07 06:56:32', NULL),
(1456, 'The Ministry of the Teacher', 'The Ministry of the Teacher (Teacher).docx', 'The ministry of the Teacher is mentioned in all three of the lists of ministries and gifts and functions in the Body of Christ by the apostle Paul.\r\nThe Lord Jesus mentioned \"apostles, prophets and scribes\" also in Matthew 23:34 as ministries which He would send to His people.\r\nThere is certainly not the problem of understanding the ministry of the Teacher as there is with that of the Apostle and Prophet.\r\n', '1331137075The Ministry of the Teacher (Teacher).docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Ministry-of-the-Teacher-1331137075The-Ministry-of-the-Teacher-(Teacher).docx', '109046', 0, 1, 'docx', 21, 1, NULL, NULL, 1, 1, '2012-03-07 08:17:55', NULL),
(1457, 'The Ministry of the Teacher', 'The Minstry of Teacher Student Notes with Blanks.doc', 'The ministry of the Teacher is mentioned in all three of the lists of ministries and gifts and functions in the Body of Christ by the apostle Paul.\r\nThe Lord Jesus mentioned \"apostles, prophets and scribes\" also in Matthew 23:34 as ministries which He would send to His people.\r\nThere is certainly not the problem of understanding the ministry of the Teacher as there is with that of the Apostle and Prophet.\r\n', '1331137075The Minstry of Teacher Student Notes with Blanks.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Ministry-of-the-Teacher-1331137075The-Minstry-of-Teacher-Student-Notes-with-Blanks.doc', '144384', 0, 1, 'doc', 21, 1, NULL, NULL, 1, 1, '2012-03-07 08:17:55', NULL);
