(1458, 'Search for Truth', 'SFT2Man.pdf', 'The Bible and the Search For Truth #2 Teacherâ€™s\r\nManual will be your most valuable tools.\r\nGlancing through your new Teacherâ€™s Manual,\r\nyou will discover many exciting concepts\r\ndesigned to aid your lesson preparation.\r\nRemember, the Teacherâ€™s Manual is an aidâ€”\r\nnot a script to be read. Neverâ€”NEVERâ€”read\r\nfrom the manual during a session. This shows an\r\nevident lack of preparation.\r\nYou will also discover that the twelve lesson\r\ntexts are very lengthy. The wealth of information\r\nincluded in each lesson is designed for you to\r\nread, digest, and retain. Please understand that\r\ntime will not permit you to teach all the material\r\ngiven in a single lesson. The writers have purposely\r\nincluded additional material for your benefit', '1331143645SFT2Man.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Search-for-Truth-1331143645SFT2Man.pdf', '18841992', 0, 1, 'pdf', 21, 1, NULL, NULL, 1, 1, '2012-03-07 10:07:25', NULL),
