(1462, 'Altar Counsellor\'s Guide', 'AltarCounselorsGuide.doc', '', '1331224441AltarCounselorsGuide.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Altar-Counsellor\'s-Guide-1331224441AltarCounselorsGuide.doc', '162304', 0, 1, 'doc', 16, 1, NULL, NULL, 1, 1, '2012-03-08 08:34:01', NULL),
(1464, 'Okios Evangelism: The Biblical Pattern', 'Okios Evangelism.doc', 'The motto of many churches for evangelism has become: doing it more but enjoying it less. Eyes roll when the bus ministry is mentioned,fear seizes the stomach when door to door visitation is hinted at, and general apathy reigns over attempts to involve members in another exciting, dynamic, life changing, $23 weekend witnessing clinic. Why is it that in the New Testament outreach seems so much fun, so vibrant and natural, while today\'s evangelism often suits out as forced, dutiful and (to the laymen if not the officials) unnatural?', '1331276552Okios Evangelism.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Okios-Evangelism:-The-Biblical-Pattern-1331276552Okios-Evangelism.doc', '41984', 0, 1, 'doc', 209, 1, NULL, NULL, 1, 1, '2012-03-08 23:02:32', '2012-03-08 23:04:20'),
(1497, 'How You Can Be More Effective', 'How You Can Be More Effective.doc', 'This article shares about how you can be more effective in your social outreach.', '1331285147How You Can Be More Effective.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/How-You-Can-Be-More-Effective-1331285147How-You-Can-Be-More-Effective.doc', '41984', 0, 1, 'doc', 228, 1, NULL, NULL, 1, 1, '2012-03-09 01:25:47', NULL),
(1498, 'Can Advertising Help Your Church?', 'Can Advertising Help Your Church.doc', 'First, let\'s look at what advertising cannot do...\r\n\r\n* Advertising cannot win people. Research found long ago that mass media campaigns are ineffective for \"conversion growth.\" People become Christians through the influence of trusted others, and because the Christian lifestyle and community responds to a felt need.\r\n\r\n* Advertising cannot stop decline. If a church has been plateaued or in decline for some time, the most effective advertising strategy will not turn it around. The decline is most likely due to other factors.\r\n\r\n* Advertising cannot change reality. People ultimately respond to the experience they have in your church - not the experience that is promised. Be sure first-time visitors leave with a positive memory and desire to return for more.\r\n\r\nSo what can advertising do for your church?\r\n\r\n* Advertising can help attract first-time visitors. Growing churches average 4-5% of their morning worship attendance as first or second time visitors. Some churches are not growing simply because they don\'t have enough people coming in the \"top end of the funnel.\"\r\n\r\n* Advertising can communicate what you want people to know about your church. A good advertising strategy informs the community of your desire to reach out in love, and of your desire to meet their needs. Advertising can also inform your community of Christ\'s love for them, and of the opportunity for a personal and rewarding relationship with the living God.\r\n\r\n* Advertising can raise congregational self-esteem. Advertising that is a cut above the norm over most church promotion will give members a sense of pride about \"my church.\" And they\'ll be more conscious of living up to the promises made.\r\n', '1331285377Can Advertising Help Your Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Can-Advertising-Help-Your-Church?-1331285377Can-Advertising-Help-Your-Church.doc', '38400', 0, 1, 'doc', 78, 1, NULL, NULL, 1, 1, '2012-03-09 01:29:37', NULL),
(1499, 'Reaching the Unreachable Through Direct Mail', 'Reaching the Unreachable Through Direct Mail.doc', 'Each year in the United States, more than one hundred billion dollars worth of goods and services are sold by direct mail. Direct mail is used by the business community to sell all sorts of products and services. Direct mail also is an ideal way for the local church to reach the motivated prospect. \r\n', '1331285558Reaching the Unreachable Through Direct Mail.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Reaching-the-Unreachable-Through-Direct-Mail-1331285558Reaching-the-Unreachable-Through-Direct-Mail.doc', '37888', 0, 1, 'doc', 229, 1, NULL, NULL, 1, 1, '2012-03-09 01:32:38', NULL),
(1500, 'The \"Love Loaf League\"', 'The Love Loaf League.doc', '\"Love Loaf League\" ministry, which delivers homemade bread to newcomers and visitors and also visits nursing homes, shut-ins, and hospitals. Over 2,000 calls were made last year with over 58 won to Jesus Christ.\r\n', '1331285761The Love Loaf League.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-\"Love-Loaf-League\"-1331285761The-Love-Loaf-League.doc', '29696', 0, 1, 'doc', 230, 1, NULL, NULL, 1, 1, '2012-03-09 01:36:01', NULL),
