(1506, 'Confrontation', 'Confrontation.docx', '\"Adam, Eve, where are you?\" The probing voice of God pierces the evening air, confronting the two pounding hearts hiding in the vegetation. Just hours before, all was so perfect, so peaceful... but when they ate the forbidden fruit, everything changed. They chose to disobey Godâ€”they chose to defy His authorityâ€”and now they shy away in fear as they hear His voice come nearer and nearer.\r\nAs they step out of their hiding, how will God confront the guilty couple? Things could have been so different. He created this first man and first woman and placed them in a perfect environment where He planned to meet all of their needs. If only they had listened to Him! If only they had trusted Him! If only they had obeyed Him! But, because of their fatal choice, they forfeited His perfect plan. Now what will He say to them... and what will be His approach? How will He confront their sin?\r\n', '1331395760Confrontation.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Confrontation-1331395760Confrontation.docx', '61351', 0, 1, 'docx', 21, 1, '', '', 1, 1, '2012-03-10 08:09:20', '2012-09-15 10:27:48'),
