(1939, 'The Usborne Book of Puppets', 'The Usborne Book of Puppets', 'Using a wide variety of inexpensive materials and tricks of the trade, this book describes in step-by-step detail how to make a whole range of puppets, from finger-puppets to glove-puppets and simple string-puppets. Ideas are provided on how to make all kinds of characters and animals and there are tips on costumes, decoration and how to put on your own puppet show. There are both very simple and also more professional and challenging projects.\r\n', '1332228783the usborne books of puppets.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Usborne-Book-of-Puppets-1332228783the-usborne-books-of-puppets.pdf', '6786456', 0, 1, 'pdf', 236, 1, NULL, NULL, 1, 1, '2012-03-20 00:33:03', '2012-03-20 00:43:55'),
(1940, 'Mission 4:12', 'Mission 4:12', 'Mission 4:12, a five lesson series based on 1 Timothy 4:12, teaches children how they can lead by example. Using a fun space camp theme, this curriculum teaches kids how to dream of being more than they could ever imagine. Kids will learn that right now, at their age, they can make a difference in the world through their speech, actions, love, faith and purity.\r\n\r\n \r\n\r\n \r\n\r\n\r\n \r\n\r\n\r\n ', '1332229342mission 412.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Mission-4:12-1332229342mission-412.pdf', '5653912', 0, 1, 'pdf', 237, 1, NULL, NULL, 1, 1, '2012-03-20 00:42:22', '2012-03-20 00:42:45'),
