(2342, 'Why I Stayed: Ministering to the Battered Spirit', 'Why I Stayed.pdf', 'This is a book on ministering to those who have been abused. It takes you into the mind of the battered spirit and offers advice and tips for reaching them so that you can help them draw closer to God.', '1332790960Why I Stayed.pdf', 'http://apostolictoolbox.s3.amazonaws.com/stephanie/Why-I-Stayed:-Ministering-to-the-Battered-Spirit-1332790960Why-I-Stayed.pdf', '451770', 59, 1, 'pdf', 242, 1, '', '', 1, 1, '2012-03-26 12:42:40', '2012-03-26 13:07:28'),
(2335, 'This is a TEST', 'Why I Hate Religion But Love Jesus - A Catholic Response ', 'This is a TEST', '<iframe width=\"560\" height=\"315\" src=\"http://www.youtube.com/embed/8dqnfz4y8uA\" frameborder=\"0\" allowfullscreen></iframe>', '', '', 0, 1, 'embed', 202, 3, NULL, NULL, 1, 0, '2012-03-23 23:23:43', NULL),
(2340, 'More Valuable than Sparrows: Healing for the Battered Spirit', 'More Valuable than Sparrows.pdf', 'Abuse is not a part of God\'s plan, but because we live in a sin-sick world, there are times when we may experience it.\r\n\r\nThis is a book about healing from abuse.\r\n\r\nChristian author and domestic violence survivor, Stephanie Mayberry, takes you through a spiritual exploration. Her seven part Bible study is appropriate for individual as well as group use. \r\n\r\nFind the healing that Jesus has for you. \r\n\r\n', '1332783183More Valuable than Sparrows.pdf', 'http://apostolictoolbox.s3.amazonaws.com/stephanie/More-Valuable-than-Sparrows:-Healing-for-the-Battered-Spirit-1332783183More-Valuable-than-Sparrows.pdf', '461139', 59, 1, 'pdf', 242, 1, '', '', 1, 1, '2012-03-26 10:33:03', '2012-03-26 12:44:00'),
(2341, '7 Steps to a Godly Marriage: A Bible Study', '7 Steps to a Godly Marriage - 5.25 x 8.pdf', 'Whether you are about to get married, been married for years or hope someday to get married, this book can help you build a marriage that is solid and sure. Within these pages are seven simple steps that will help your marriage grow stronger based on the marriage that God wants you to have.\r\n\r\nBiblically based, 7 Steps to a Godly Marriage provides relevant scripture that will help couples navigate the sometimes joyful, sometimes frustrating, path of the marital relationship. Learn how the enemy wants nothing more than to destroy your union and what God wants from it. Find out how selfishness can sneak in and drive a wedge between you and your partner before either of you realize what it is. Discover the blessings that God bestows upon couples who commit to keep Him at the center of their marriage.\r\n\r\nThis book will help you build a strong, Christian marriage or help repair a broken one. It can be used as a Bible study, great for groups as well as couples.\r\n\r\nThere are \"Reflection\" sections at the end of each chapter, allowing you to apply the teachings of Christ to your own marriage.\r\n\r\nA Godly marriage honors God and benefits husband, wife and children. Build your marriage on the Rock, on Jesus Christ. These 7 steps will make your marriage more resilient and enduring. Find out what God has to say about how you can make your marriage last a lifetime.\r\n', '13327833457 Steps to a Godly Marriage - 5.25 x 8.pdf', 'http://apostolictoolbox.s3.amazonaws.com/stephanie/7-Steps-to-a-Godly-Marriage:-A-Bible-Study-13327833457-Steps-to-a-Godly-Marriage---5.25-x-8.pdf', '482396', 59, 1, 'pdf', 242, 1, '', '', 1, 1, '2012-03-26 10:35:45', '2012-03-26 12:43:23'),
(2343, 'Upgrade!', 'Upgrade.docx', 'For New Wine you need a new wineskin.', '1332807552Upgrade.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Upgrade!-1332807552Upgrade.docx', '20545', 0, 1, 'docx', 11, 1, '', '', 1, 1, '2012-03-26 17:19:12', NULL),
(3222, 'Building Antioch Project Proposal (ep3 Workshop)', 'Building Antioch Project Proposal.pdf', '', '13377572921332810585Building Antioch Project Proposal.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Building-Antioch-Project-Proposal-(ep3-Workshop)-13377572921332810585Building-Antioch-Project-Proposal.pdf', '8479223', 0, 1, 'pdf', 21, 1, '', '', 1, 1, '2012-05-23 00:14:52', '2012-09-15 10:26:29'),
(2346, 'Life', 'Life.docx', 'I would like to tell what Jesus has for us. Why He came. The Bible says, \"In Him was life...\" If this Bible tells us anything about the mission of Jesus; it\'s wrapped in this Word that we don\'t understand properly, or rely on enough. \"He that hath the Son hath life.\"', '1332825996Life.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Life-1332825996Life.docx', '20177', 0, 1, 'docx', 243, 1, '', '', 1, 1, '2012-03-26 22:26:36', NULL),
(2347, 'To Cross A River', 'To Cross A River.docx', 'This lesson provides us with an insight into Baptism of Spirit and Water and peoples\' views on them.', '1332827614To Cross A River.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/To-Cross-A-River-1332827614To-Cross-A-River.docx', '18049', 0, 1, 'docx', 244, 1, '', '', 1, 1, '2012-03-26 22:53:34', NULL),
(2349, 'Coming Under the Knife!', 'Coming Under the Knife.docx', '\"And it came to pass, when all the kings of the Amorites, which were by the sea, heard that the Lord had dried up the waters of Jordan from before the children of Israel, until we were passed over, that their heart melted, neither was there spirit in them any more, because of the children of Israel. At that time the Lord said unto Joshua, Make thee sharp knives, and circumcise... the children of Israel.... And Joshua made him sharp knives, \r\nand circumcised the children of Israel at the hill of the foreskins.... And it came to pass, when they had done circumcising all the people, that they abode in their places in the camp, till they were whole. And the Lord said unto Joshua, this day have I rolled away the reproach of Egypt from off you. Wherefore the name of the place is called Gilgal unto this day\"(Joshua 5:1-3,8-9).\r\n\r\nThe event at Gilgal serves as a vividly illustrated sermon for last-day Christians. It illustrates for us how to break the power of sin so we might enter into the glorious liberty of Christ Jesus!\r\n\r\n\r\n', '1332828667Coming Under the Knife.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Coming-Under-the-Knife!-1332828667Coming-Under-the-Knife.docx', '29499', 0, 1, 'docx', 189, 1, '', '', 1, 1, '2012-03-26 23:11:07', NULL),
(2350, 'He Loves You Too Much To Leave You Like You Are', 'He Loves You Too Much To Leave You Like You Are.docx', 'The love of God is not just a passive feeling, but it\'s a powerful force. There is no force in this world that is stronger than the love of God - to take a man, to take a woman, to take a wretch and to be able to transform that individual into the likeness of Almighty God!', '1332829867He Loves You Too Much To Leave You Like You Are.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/He-Loves-You-Too-Much-To-Leave-You-Like-You-Are-1332829867He-Loves-You-Too-Much-To-Leave-You-Like-You-Are.docx', '28199', 0, 1, 'docx', 245, 1, '', '', 1, 1, '2012-03-26 23:31:07', NULL),
(2351, 'When God Builds You A Prayer Room', 'When God Builds You A Prayer Room.docx', 'The scripture says that God Almighty created man in his own image. He breathed the breath of life in him and gave him a living soul. When he created man he left a void. He left an emptiness on the inside of mankind that could only be filled by God Almighty himself. Man has continually sought to fill that void and to fill that emptiness with everything other than Almighty God.  The world makes a call and a pull for you but there is nothing but emptiness, sorrow, heartache and sadness out there. You belong in the church of the living God. So often as God tenderly calls young people, they mistake his tenderness and his long-suffering for weakness. They feel that judgement will never come.', '1332830587When God Builds You A Prayer Room.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/When-God-Builds-You-A-Prayer-Room-1332830587When-God-Builds-You-A-Prayer-Room.docx', '17042', 0, 1, 'docx', 246, 1, '', '', 1, 1, '2012-03-26 23:43:07', NULL),
(2352, 'The Heart of Man', 'The Heart of Man.docx', 'There are many people with troubled hearts in the world today. There are many reasons why these hearts are troubled. Whatever the reason, we can be assured that God knows and stands waiting to give peace to every troubled heart who will come to Him in faith. God loves you and wants to live in your heart.\r\n', '1332834174The Heart of Man.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Heart-of-Man-1332834174The-Heart-of-Man.docx', '30339', 0, 1, 'docx', 16, 1, '', '', 1, 1, '2012-03-27 00:42:54', NULL),
(2353, 'Thirty-Three Things', 'Thirty-Three Things.docx', 'What will be covered here is the thirty-three things that happen\r\nto the believer the moment he is saved.  These are sometimes referred to theologically as positional truth. What is true of the believer because of his position in Christ. It is also known as the believer\'s identification with Christ. Perhaps the best way to see this is that these things are true because of the believer\'s position of being in Christ and the believer has been identified as being with Christ as a result of his salvation.\r\n', '1332834750Thirty Three Things.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Thirty-Three-Things-1332834750Thirty-Three-Things.docx', '42790', 0, 1, 'docx', 16, 1, '', '', 1, 1, '2012-03-27 00:52:30', '2012-03-27 03:28:16'),
(2354, 'It\'s Never Too Late', 'Its Never Too Late.docx', 'It is never too late for God\'s saving grace to take effect in your life.', '1332836237Its Never Too Late.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/It\'s-Never-Too-Late-1332836237Its-Never-Too-Late.docx', '18982', 0, 1, 'docx', 247, 1, '', '', 1, 1, '2012-03-27 01:17:17', NULL),
(2355, 'The Sudden Moves of God', 'The Sudden Move of God.docx', 'These are sermon notes on the sudden moves of God by Bishop Willoughby.', '1332838974The Sudden Move of God.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Sudden-Moves-of-God-1332838974The-Sudden-Move-of-God.docx', '35911', 0, 1, 'docx', 30, 1, '', '', 1, 1, '2012-03-27 02:02:54', NULL),
(2356, 'Contrary to Human Expectations', 'Contrary to Human Expectations.docx', 'This article shares on human expectations and what we think or expect of God.', '1332841543Contrary to Human Expectations.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Contrary-to-Human-Expectations-1332841543Contrary-to-Human-Expectations.docx', '23966', 0, 1, 'docx', 248, 1, '', '', 1, 1, '2012-03-27 02:45:43', NULL),
(2357, 'Our Glorious Know-So Salvation', 'Our Glorious Know So Salvation.docx', 'There are many in our days that trust in their wisdom, riches, and feel absolute secure without the Lord God in their lives. Wisdom will fail you and your own might will someday be depleted. \"If you gain the whole world and lose your soul, what doth it profit.\" If anyone is going to glory, it should be that we know and understand God.', '1332843061Our Glorious Know So Salvation.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Our-Glorious-Know-So-Salvation-1332843061Our-Glorious-Know-So-Salvation.docx', '14904', 0, 1, 'docx', 248, 1, '', '', 1, 1, '2012-03-27 03:11:01', NULL),
