(2364, 'History of ecclesiastical unity', 'Joshua Ng U083176H - Ecclesiastical Unity.docx', 'A University level essay in a course on Christianity in World History in Singapore. PI students can have a view on how slightly longer, standard length, 1500-2000 word essays can be written and thought through. Ecclesiastical unity essentially refers to unity among church leaders based on various things depending on a group\'s persuasion, including subscribing to specific doctrine. This essay discusses and problematizes the idea of \"breaking away\" from a \"centre\" point (i.e. Catholicism). Is such a concept even valid, from the point of view of the earliest versions of Christianity? \r\n\r\nThis essay was marked by a professor of Baptist persuasion, a committed denominational Christian himself, who is famous in the local history student community as a mentor figure.\r\n\r\nIt received the highest possible grade that the professor gives out. \r\n\r\nThe essay starts with a quote that the student is supposed to simply \"discuss\". \r\n\r\nNote that this essay is extremely light on referencing and is intentionally so.', '1332861947Joshua Ng U083176H - Ecclesiastical Unity.docx', 'http://apostolictoolbox.s3.amazonaws.com/joshux/History-of-ecclesiastical-unity-1332861947Joshua-Ng-U083176H---Ecclesiastical-Unity.docx', '36374', 78, 1, 'docx', 0, 1, '', '', 1, 1, '2012-03-27 08:25:47', '2012-03-27 14:10:52'),
(2365, 'Thanksgiving Project Proposal', 'FINAL.pdf', 'Group members: Dennis Tan, Darrel Lim, Fu Shi Yuan, Tan Wen Qi, Stellar Hiu, Cheryl Wong, Angeline Kee.', '1332862821FINAL.pdf', 'http://apostolictoolbox.s3.amazonaws.com/stellarhiu/Thanksgiving-Project-Proposal-1332862821FINAL.pdf', '281001', 93, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-27 08:40:21', '2012-03-27 14:12:21'),
(2366, 'History: Bridging Acts to Current Day (A reading package, pt1)', '7 - Morris - Northern Europe Invades the Mediterranean - History of Medieval Europe pt2.pdf', 'This is a set of academic history readings from a course at the National University of Singapore on Christianity in World History. These help reconstruct the position of Christianity first in the Mediterranean, then moving to Europe, and the Americas (South and North), Africa and to what we know today as \"Asia\" (including China, and Southeast Asia). These readings as a whole will help the student grapple with the places and issues that historical Christianity (Catholicism, Protestantism, Eastern Orthodox Christianity, and buried in the midst of these -- people who adhered to doctrines that sounded stunningly close to \"Oneness\" type beliefs and \"Full immersion\" type baptismal formulas. Especially interesting to me was R. Hsia\'s \"Holy Women, beatas, demoniacs\" which describes in chapter nine - Catholic nuns, of all people (and of course there were no \"Apostolics\" as we know them at the time), who had visions. I will reproduce one here:\r\n\r\nThen at the age of thirty four or thirty five [1633-1634], I entered into that state...This was an outpouring of apostolic spirit...My body was in our monastery but my spirit, united to that of Jesus, could not remain shut up there. This apostolic spirit carried me in thought to the Indies, to Japan, to America, to the East, and to the West, to parts of Canada, to the country of the Hurons - in short, to every part of the inhabited world where there were human souls who belonged by right to Jesus Christ. In spirit I roamed through the vast stretches of the Indies, of Japan and China, and kept company with those labouring to spread the Gospel there. I felt closely united to these workers because I felt that I was one with them in spirit.', '13328634287 - Morris - Northern Europe Invades the Mediterranean - History of Medieval Europe pt2.pdf', 'http://apostolictoolbox.s3.amazonaws.com/joshux/History:-Bridging-Acts-to-Current-Day-(A-reading-package,-pt1)-13328634287---Morris---Northern-Europe-Invades-the-Mediterranean---History-of-Medieval-Europe-pt2.pdf', '3469464', 78, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-27 08:50:28', '2012-03-27 14:23:12'),
(2367, 'History: Bridging Acts to Current Day (A reading package, pt1)', '4 - Huskinson - Pagan and Christian - religion in history.pdf', 'This is a set of academic history readings from a course at the National University of Singapore on Christianity in World History. These help reconstruct the position of Christianity first in the Mediterranean, then moving to Europe, and the Americas (South and North), Africa and to what we know today as \"Asia\" (including China, and Southeast Asia). These readings as a whole will help the student grapple with the places and issues that historical Christianity (Catholicism, Protestantism, Eastern Orthodox Christianity, and buried in the midst of these -- people who adhered to doctrines that sounded stunningly close to \"Oneness\" type beliefs and \"Full immersion\" type baptismal formulas. Especially interesting to me was R. Hsia\'s \"Holy Women, beatas, demoniacs\" which describes in chapter nine - Catholic nuns, of all people (and of course there were no \"Apostolics\" as we know them at the time), who had visions. I will reproduce one here:\r\n\r\nThen at the age of thirty four or thirty five [1633-1634], I entered into that state...This was an outpouring of apostolic spirit...My body was in our monastery but my spirit, united to that of Jesus, could not remain shut up there. This apostolic spirit carried me in thought to the Indies, to Japan, to America, to the East, and to the West, to parts of Canada, to the country of the Hurons - in short, to every part of the inhabited world where there were human souls who belonged by right to Jesus Christ. In spirit I roamed through the vast stretches of the Indies, of Japan and China, and kept company with those labouring to spread the Gospel there. I felt closely united to these workers because I felt that I was one with them in spirit.', '13328634284 - Huskinson - Pagan and Christian - religion in history.pdf', 'http://apostolictoolbox.s3.amazonaws.com/joshux/History:-Bridging-Acts-to-Current-Day-(A-reading-package,-pt1)-13328634284---Huskinson---Pagan-and-Christian---religion-in-history.pdf', '2883364', 78, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-27 08:50:28', '2012-03-27 14:21:20');
