(2368, 'History: Bridging Acts to Current Day (A reading package, pt1)', '2 - Kee, Christianity, a social and cultural history - from alexader to augustus.pdf', 'This is a set of academic history readings from a course at the National University of Singapore on Christianity in World History. These help reconstruct the position of Christianity first in the Mediterranean, then moving to Europe, and the Americas (South and North), Africa and to what we know today as \"Asia\" (including China, and Southeast Asia). These readings as a whole will help the student grapple with the places and issues that historical Christianity (Catholicism, Protestantism, Eastern Orthodox Christianity, and buried in the midst of these -- people who adhered to doctrines that sounded stunningly close to \"Oneness\" type beliefs and \"Full immersion\" type baptismal formulas. Especially interesting to me was R. Hsia\'s \"Holy Women, beatas, demoniacs\" which describes in chapter nine - Catholic nuns, of all people (and of course there were no \"Apostolics\" as we know them at the time), who had visions. I will reproduce one here:\r\n\r\nThen at the age of thirty four or thirty five [1633-1634], I entered into that state...This was an outpouring of apostolic spirit...My body was in our monastery but my spirit, united to that of Jesus, could not remain shut up there. This apostolic spirit carried me in thought to the Indies, to Japan, to America, to the East, and to the West, to parts of Canada, to the country of the Hurons - in short, to every part of the inhabited world where there were human souls who belonged by right to Jesus Christ. In spirit I roamed through the vast stretches of the Indies, of Japan and China, and kept company with those labouring to spread the Gospel there. I felt closely united to these workers because I felt that I was one with them in spirit.', '13328634282 - Kee, Christianity, a social and cultural history - from alexader to augustus.pdf', 'http://apostolictoolbox.s3.amazonaws.com/joshux/History:-Bridging-Acts-to-Current-Day-(A-reading-package,-pt1)-13328634282---Kee,-Christianity,-a-social-and-cultural-history---from-alexader-to-augustus.pdf', '1273589', 78, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-27 08:50:28', '2012-03-27 14:19:25'),
