o-Current-Day-(A-reading-package,-pt3)-133286396824---McManners---Expansion-of-Christianity-1500-1800-pt1.pdf', '2565911', 78, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-27 08:59:28', '2012-03-27 14:16:36'),
