(2416, 'History: Bridging Acts to Current Day (A reading package, pt4 -- primary sources)', '23 - Tierney - Struggle_with_Henry_IV -- Crisis of Church & State 1050-1300.pdf', 'This is a set of academic history readings from a course at the National University of Singapore on Christianity in World History.\r\n\r\nThis is a set of documents (varyingly) that historians call \"primary documents\". I will explain what these are if you come speak to me! I will also endeavor to upload some materials on what these \"primary documents\" mean to historians, as opposed to \"secondary documents\".\r\n\r\nThis is just something about the practices and methodology of \"doing\" history. As in, how to properly read, and write history. Yes, there can be \"better\" ways and \"less than optimum\" ways to read history, and to produce it.', '133286456323 - Tierney - Struggle_with_Henry_IV -- Crisis of Church & State 1050-1300.pdf', 'http://apostolictoolbox.s3.amazonaws.com/joshux/History:-Bridging-Acts-to-Current-Day-(A-reading-package,-pt4----primary-sources)-133286456323---Tierney---Struggle_with_Henry_IV----Crisis-of-Church-&-State-1050-1300.pdf', '1725072', 78, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-27 09:09:23', '2012-03-27 14:08:08'),
