(2422, 'History: Bridging Acts to Current Day (A reading package, pt4 -- primary sources)', '27 - Hsia_Holy_Women,_Beates,_Demoniacs - World of Catholic Renewal 1540-1770.pdf', 'This is a set of academic history readings from a course at the National University of Singapore on Christianity in World History.\r\n\r\nThis is a set of documents (varyingly) that historians call \"primary documents\". I will explain what these are if you come speak to me! I will also endeavor to upload some materials on what these \"primary documents\" mean to historians, as opposed to \"secondary documents\".\r\n\r\nThis is just something about the practices and methodology of \"doing\" history. As in, how to properly read, and write history. Yes, there can be \"better\" ways and \"less than optimum\" ways to read history, and to produce it.', '133286456427 - Hsia_Holy_Women,_Beates,_Demoniacs - World of Catholic Renewal 1540-1770.pdf', 'http://apostolictoolbox.s3.amazonaws.com/joshux/History:-Bridging-Acts-to-Current-Day-(A-reading-package,-pt4----primary-sources)-133286456427---Hsia_Holy_Women,_Beates,_Demoniacs---World-of-Catholic-Renewal-1540-1770.pdf', '1042029', 78, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-27 09:09:24', '2012-03-27 14:07:38'),
(2423, 'Mary Abbott - History Skills (read: Researching and Writing Essays)', 'Mary Abbott - History Skills.pdf', 'This is a primer for the student archivist or historian on how to \"do\" history. There is an important section that describes the differences between \"primary\" and \"secondary\" sources. One would be wise to read that and to use the right sources at the right places in academic essays. \r\n\r\nAlso very useful is the section on how to research for, and write essays. This is a crucial skill for all university undergraduates and PI students -- and big hint, you can learn how to write well by reading \"self help\" books like this one.', '1332864911Mary Abbott - History Skills.pdf', 'http://apostolictoolbox.s3.amazonaws.com/joshux/Mary-Abbott---History-Skills-(read:-Researching-and-Writing-Essays)-1332864911Mary-Abbott---History-Skills.pdf', '1594056', 78, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-27 09:15:11', '2012-03-27 14:07:09'),
(2424, 'The Widowâ€™s Mite ', 'Money.doc', 'This is a Purpose Institute essay on financial stewardship from the module \"Pastoral Studies 2(6703)\".\r\n\r\nThesis statement:\r\nJesus said, â€œOf a truth I say unto you, that this poor widow hath cast in more than they all: For all these have of their abundance cast in unto the offerings of God: but she of her penury hath cast in all the living that she had.â€ (Luke 21:3-4) \r\n\r\nWhile theologians debate away on whether or not the passage was an encouragement to live in poverty, the clear meaning of this Scripture lies in its call for us to give generously to Godâ€™s kingdom. By faithfully giving away all that she had, the unnamed widowâ€™s act of generosity is a sterling example of financial stewardship that underscored the tenets of trust in God and contentment in His provisions. ', '1332903777Money.doc', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/The-Widowâ€™s-Mite--1332903777Money.doc', '36352', 35, 1, 'doc', 0, 1, '', '', 1, 1, '2012-03-27 20:02:57', '2012-09-20 09:12:50'),
(2425, 'The Presentation Genius of Steve Jobs', 'the_presentation_genius_of_steve_jobs_carmine_gallo_business_week-1.pdf', 'Steve Jobs was a master of the presentation. Here are 11 tips we can learn from him.', '1332907860the_presentation_genius_of_steve_jobs_carmine_gallo_business_week-1.pdf', 'http://apostolictoolbox.s3.amazonaws.com/pjsilvercross/The-Presentation-Genius-of-Steve-Jobs-1332907860the_presentation_genius_of_steve_jobs_carmine_gallo_business_week-1.pdf', '1218078', 5, 1, 'pdf', 253, 1, '', '', 1, 1, '2012-03-27 21:11:00', '2012-03-28 01:18:50'),
