(2452, 'Throne Room!', '25.3.2012 MESSAGE PAS.RUBAN HOBDAY-01.mp3', 'John writes about the throne in Revelation 4 which he was impacted on - He first shows us the Person on the Throne - The person is one, He is the high priest who is the first & the last (which is proved by the mention of Jasper & Sardin stones), he knows all, all understanding, all knowledge his eyes midst of the throne, around about the throne, front of the throne and back of the throne - secondly the power at the throne - all the 24 little thrones bow down to him throwing away their crowns and lastly the Promise around about the throne through the \"rainbow\". We cannot reach the throne without going through the promises, same way God sees us through his promises given to us!', '133304213325.3.2012 MESSAGE PAS.RUBAN HOBDAY-01.mp3', 'http://apostolictoolbox.s3.amazonaws.com/ruban/Throne-Room!-133304213325.3.2012-MESSAGE-PAS.RUBAN-HOBDAY-01.mp3', '40848637', 81, 1, 'mp3', 254, 1, '', '', 1, 1, '2012-03-29 10:28:53', '2012-03-29 10:38:42'),
