(2455, 'Christianity in Singapore: The Voice of Moral Conscience to the State', 'Christianity in Singapore.pdf', 'Abstract:\r\n\r\nChristianity has historically been influential in shaping morality, a project\r\nwhich still continues. While substantial literature has addressed the question how\r\nconservative Christians in America attempt to maintain moral control, there is little\r\nresearch on the way in which Christianity influences morality in other societies. This study examines the case of Singapore where conservative Christianity dominates the Christian landscape. The first part of this article discusses Christian groups which have become intricately involved in the production and policing of morality in\r\nSingapore and the state patronage which this attempt enjoys. This is based on evidence of state support for various Christian based initiatives which focus on the family and sexuality. Also, the recent sites of discord are considered which result from the stateâ€™s increased tolerance of homosexuality and gambling. Interview data, public speeches, and writings of local church leaders are used to show that the Christian church wants to be the stateâ€™s voice of conscience. However, while opposing moral degradation, the â€˜well disciplinedâ€™ Singaporean Christian leaders have carefully negotiated their strategies and tried to avoid being labelled by the state as undesirable voices of conscience.', '1333077932Christianity in Singapore.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/Christianity-in-Singapore:-The-Voice-of-Moral-Conscience-to-the-State-1333077932Christianity-in-Singapore.pdf', '115240', 35, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-03-29 20:25:32', '2012-03-29 23:37:18'),
