(2493, 'Under Cover Series (Video)', 'Under Cover Lesson Lesson 8 - What if Authority Tells Me?', 'John Bevere effectively uses his personal mistakes to illustrate riveting truths about repentance and forgiveness. As he focuses on the true authority of God, he is careful to explain by example the important difference between \"submission\" and \"obedience.\" The same struggle with divine authority is also represented through the lives of John the Baptist, the Apostle Paul, and other biblical figures. An especially helpful lesson for Christians who want to develop a serious pursuit of God.', 'http://media.tabjoy.org/media2/UnderCover/L8.mp4', 'http://apostolictoolbox.s3.amazonaws.com/admin/Under-Cover-Series-(Video)-L8.mp4', '109579005', 0, 1, 'mp4', 14, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=NjY=\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Lesson 8 - What if Authority Tells Me?', 1, 1, '2012-03-30 01:08:55', '2012-05-08 00:02:41'),
