(2503, 'The Ministry of Healing ', 'How people become sick -Lesson 2', 'The ministry of healing is a key aspect of the Gospel of the Kingdom.\r\nThe great truth that God is a healing God runs like a scarlet thread of promise all through the Bible. \r\n', '1333125969Lesson 2 How people become sick.docx', 'http://apostolictoolbox.s3.amazonaws.com/pastortim/The-Ministry-of-Healing--1333125969Lesson-2-How-people-become-sick.docx', '21161', 3, 1, 'docx', 11, 1, '', '', 1, 1, '2012-03-30 09:46:09', '2013-01-10 00:00:24'),
