(2507, 'All I Need Is A Seed!', 'All I Need Is A Seed!', 'To remove my mountain whatever it may be \"all you need is a seed\"... literally mustard seed was spread on the floor at the altar and those you believed stepped out to pick up \"a grain of mustard seed\" and built their faith to remove their certain mountain during the preaching ! NOTHING SHALL BE IMPOSSIBLE UNTO YOU!- Praise Goes to God alone.4.3.2012 Message byPas.Ruban Hobday', '13331766764.3.2012 Message byPas.Ruban Hobday.mp3', 'http://apostolictoolbox.s3.amazonaws.com/ruban/All-I-Need-Is-A-Seed!-13331766764.3.2012-Message-byPas.Ruban-Hobday.mp3', '21792833', 81, 1, 'mp3', 254, 1, '', '', 1, 1, '2012-03-30 23:51:16', '2013-01-09 23:58:42'),
(2508, 'Prodigal (a song and thoughts)', 'Prodigal (Key of C)', 'Personal thoughts, inspiration, lyrics and chords to a song.', '1333273231Prodigal (Key of C).docx', 'http://apostolictoolbox.s3.amazonaws.com/silver_mamba/Prodigal-(a-song-and-thoughts)-1333273231Prodigal-(Key-of-C).docx', '18216', 96, 1, 'docx', 0, 1, '', '', 1, 1, '2012-04-01 02:40:31', '2013-01-09 23:58:03'),
(2509, 'For couples: Getting the message through in a tensed discussion', 'For couples: Getting the message through in a tensed discussion', 'In this document are suggestions for specific words to use to de-escalate tensions in a relationship. By using them when arguments get too negative, youâ€™ll be able to keep your discussions from spiraling out of control. Some couples even copy this list and stick it on their refrigerator for handy reference. \r\n\r\nTaken from the book, â€œThe Seven Principles for making marriage workâ€ by John Gottman & Nan Silver\r\n', '1333354324Getting the message through in a tensed discussion.docx', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/For-couples:-Getting-the-message-through-in-a-tensed-discussion-1333354324Getting-the-message-through-in-a-tensed-discussion.docx', '17006', 35, 1, 'docx', 0, 1, '', '', 1, 1, '2012-04-02 01:12:04', '2013-01-09 23:57:44'),
(2510, 'How to Study the Bible', 'How to Study the Bible', 'As believers, we are often inspired by the preaching of the Word of God. However, many new converts come to God with a desire to be equipped with the \"How-tos\" of the Christian relationship with God.\r\n\r\nThis article will give readers the simple tools and tips of starting out in reading, and studying God\'s Word. Suitable for both youths and new converts.\r\n', '1333381527How to Study the Bible (Version 2).docx', 'http://apostolictoolbox.s3.amazonaws.com/samuel/How-to-Study-the-Bible-1333381527How-to-Study-the-Bible-(Version-2).docx', '254633', 27, 1, 'docx', 251, 1, '', '', 1, 1, '2012-04-02 08:45:27', '2013-01-09 23:56:00'),
(2511, 'How to Plan Daily Time Alone with God', 'How to Plan a Daily Time Alone with God.docx', 'As believers, we are often inspired by the preaching of the Word of God. However, many new converts come to God with a desire to be equipped with the \"How-tos\" of the Christian relationship with God.\r\n\r\nThis article will give readers the simple tools and tips of starting out in planning a personal time alone with God. Suitable for both teens and new converts\r\n', '1333381606How to Plan a Daily Time Alone with God (Version 2).docx', 'http://apostolictoolbox.s3.amazonaws.com/samuel/How-to-Plan-Daily-Time-Alone-with-God-1333381606How-to-Plan-a-Daily-Time-Alone-with-God-(Version-2).docx', '251857', 27, 1, 'docx', 251, 1, '', '', 1, 1, '2012-04-02 08:46:46', '2012-04-03 10:16:24'),
(2512, 'Brief Gospel Tract', 'Gospel Tract', 'This Gospel Tract is very brief and is in a 1-page format. A Bible teacher is needed to expound the full Gospel message.', '1333418735gospel tract v14.doc', 'http://apostolictoolbox.s3.amazonaws.com/wes_56/Brief-Gospel-Tract-1333418735gospel-tract-v14.doc', '2078208', 134, 1, 'doc', 21, 1, '', '', 1, 1, '2012-04-02 19:05:35', '2013-01-09 23:57:05'),
(2513, 'Animal Test', 'Animal Test Explanation', 'Personality test', '1333436971animal test explanation.docx', 'http://apostolictoolbox.s3.amazonaws.com/suwern/Animal-Test-1333436971animal-test-explanation.docx', '56590', 7, 1, 'docx', 127, 1, '', '', 1, 1, '2012-04-03 00:09:31', '2013-01-09 23:56:43'),
(2514, 'The Prince of Peace', 'The Prince of Peace', 'Against a world background of international strife, political intrigue, racial tension, and social disorder, this lesson will reemphasize the fact that HE SHALL BE CALLED THE PRINCE OF PEACE.\r\n', '1333437956The Prince of Peace.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Prince-of-Peace-1333437956The-Prince-of-Peace.docx', '16148', 0, 1, 'docx', 259, 1, '', '', 1, 1, '2012-04-03 00:25:56', '2013-01-09 23:55:06'),
(2515, 'Power to Save', 'Power to Save', 'There are many things in the Word of God over which men are stumbling and walking in darkness. When they meet people who are supposed to know and enquire of them concerning the meaning of the scriptures, they get no satisfactory answer and therefore decide that there is nothing to it. But we are glad to know that there is power in Jesus Christ, and that there is a God in heaven that revealeth the deep and secret things. Nothing but\r\nthe power of God can save a man. \r\n', '1333442619Power to Save.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Power-to-Save-1333442619Power-to-Save.docx', '14779', 0, 1, 'docx', 260, 1, '', '', 1, 1, '2012-04-03 01:43:39', '2013-01-09 23:54:41'),
(2516, 'The Glory of the Son of Man', 'The Glory of the Son of Man', 'The Day of Redemption is surely near. All creation bears witness to this glorious event. Note what Luke says of this day. (chap. 21:25-28.) Can we find time for strife, envy, prejudice, bigotry and worldly honour at such a time as this? Now is the time for God to be glorified in His saints. WATCH and PRAY.', '1333445480The Glory of the Son of Man.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Glory-of-the-Son-of-Man-1333445480The-Glory-of-the-Son-of-Man.docx', '17410', 0, 1, 'docx', 260, 1, '', '', 1, 1, '2012-04-03 02:31:20', '2013-01-09 23:53:53'),
(2517, 'God Has Already Begun to Desolate America!', 'God Has Already Begun to Desolate America!', '\"For I will lay the land most desolate, and the pomp of her strength shall cease; and the mountains of Israel shall be desolate... \r\n\"Then shall they know that I am the Lord, when I have laid the land most desolate because of all their abominations which they have committed\" (Ezekiel 33:28-29).\r\n\r\nThis is a warning from the mouth of almighty God - and its fulfilment is found throughout the Bible. God has made it perfectly clear: \"If any nation corrupts itself and becomes hopelessly wicked, I will desolate that nation until they know I am God!\"\r\n\r\nThe meaning of the word \"desolate\" is awesome indeed. To desolate means to desert - to render unfit for habitation. to strip of friends and hope, to forsake, abandon, ruin and devastate. And that is exactly what God had begun to do to America!\r\n', '1333445968God Has Already Begun to Desolate America.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/God-Has-Already-Begun-to-Desolate-America!-1333445968God-Has-Already-Begun-to-Desolate-America.docx', '29752', 0, 1, 'docx', 189, 1, '', '', 1, 1, '2012-04-03 02:39:28', '2013-01-09 23:54:15');
