(2518, 'This Is Your Year For Deliverance!', 'This Is Your Year For Deliverance!', 'Dear saint, in the trial you\'re going through right now, would Moses say of you, \"You\'ve known God\'s deliverance. You\'ve seen His power at work. Yet in your present trial you don\'t trust Him or see Him -- you don\'t believe in Him as your Deliverer!\"\r\n', '1333446480This Is Your Year For Deliverance.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/This-Is-Your-Year-For-Deliverance!-1333446480This-Is-Your-Year-For-Deliverance.docx', '30693', 0, 1, 'docx', 189, 1, '', '', 1, 1, '2012-04-03 02:48:00', '2013-01-09 23:53:28'),
(2519, 'Turn to Jesus', 'Turn to Jesus', 'A few years ago behavioral scientists conducted an experiment with a fresh water pike. They placed it in an aquarium where once a day they fed it minnows. Then they slipped a glass tube in the tank. The next feeding time they dropped the minnows in the tube. They had conditioned the pike to see minnows and think food, so he immediately darted for the minnows. However, every time he tried to snatch a minnow he bumped his nose on the glass. Eventually, he quit trying to eat the minnows.\r\n\r\nThen the scientist lifted the tube out of the aquarium and the \r\nminnows swam free. But, now the pike was conditioned that if he \r\ntried to eat one it would bring a mysterious pain to his nose. So, he starved to death with food only inches away.\r\n\r\nSociety has tried to condition us as well. They project the image that success is the ability to take care of yourself. Then \r\nproblems rise we do the best we can and put on a show that \r\neverything is just great. However, as Christians, our first \r\nreaction in all things should be to turn to Jesus. John 1:45-50 \r\nreveals three reasons why we should turn to Jesus.\r\n', '1333448274Turn to Jesus.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Turn-to-Jesus-1333448274Turn-to-Jesus.docx', '19084', 0, 1, 'docx', 261, 1, '', '', 1, 1, '2012-04-03 03:17:54', '2013-01-09 23:53:04'),
(2520, 'How to Hear the Voice of God', 'How to Hear the Voice of God', 'As believers, we are often inspired by the preaching of the Word of God. However, many new converts come to God with a desire to be equipped with the \"How-tos\" of the Christian relationship with God.\r\n\r\nThis article will give readers the simple tools and tips on how to hear and recognize the voice of God.\r\n', '1333473160How to Hear the Voice of God.docx', 'http://apostolictoolbox.s3.amazonaws.com/samuel/How-to-Hear-the-Voice-of-God-1333473160How-to-Hear-the-Voice-of-God.docx', '255304', 27, 1, 'docx', 251, 1, '', '', 1, 1, '2012-04-03 10:12:40', '2013-01-09 23:52:39'),
