(2525, 'Angels (Lee StoneKing)', 'Angels', 'A sermon on angels by Rev. Lee StoneKing.', '1333529672Angels.mp3', 'http://apostolictoolbox.s3.amazonaws.com/sherilynchow/Angels-(Lee-StoneKing)-1333529672Angels.mp3', '32851121', 97, 1, 'mp3', 76, 1, '', '', 1, 1, '2012-04-04 01:54:32', '2013-01-09 23:51:41'),
(2526, 'How Can I Find Satisfaction In My Work?', 'How Can I Find Satisfaction In My Work?', 'Most people seek meaning in their work. With more than 40 hours spent at work, we hope to find satisfaction in it. \r\n\r\nThe 32-page Discovery Series booklet How Can I Find Satisfaction In My Work? seeks to provide biblical answers to questions such as . . .\r\n-    Is there any way that I can find significance in a job that seems to be going nowhere?\r\n-    What if I feel overworked and underappreciated?\r\n-    Do I care too much or not enough about my job?\r\n-    What does God think about my work? Does my job really matter to Him?', '1333592495how-can-i-find-satisfaction-in-my-work.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/How-Can-I-Find-Satisfaction-In-My-Work?-1333592495how-can-i-find-satisfaction-in-my-work.pdf', '158987', 35, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-04-04 19:21:35', '2013-01-09 23:51:23'),
(2527, 'Singapore Population in Brief 2011', 'Singapore Population in Brief 2011', 'Population in Brief is an annual collation of key population\r\nindicators and provides a snapshot of Singaporeâ€™s current population\r\nlandscape.\r\n\r\nLike many developed countries, Singaporeâ€™s key population\r\nchallenges are our low fertility and an ageing population.\r\nOur aim is to achieve a sustainable population that supports\r\nboth economic growth and social cohesion, so that Singapore remains\r\nvibrant and liveable.\r\n\r\nSimilar to major cities such as New York and London, Singapore\r\nis a place where people of different cultures live and work. We need to\r\nensure that Singapore remains a globally attractive destination with an\r\nopen and competitive economy. This creates job opportunities and\r\nimproves the livelihood of Singaporeans. At the same time, Singapore\r\nmust be home to all Singaporeans, one that we feel a strong sense of\r\nbelonging to.\r\n\r\nPrinted on September 2011', '1333593752Singapore population in brief 2011.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/Singapore-Population-in-Brief-2011-1333593752Singapore-population-in-brief-2011.pdf', '680991', 35, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-04-04 19:42:32', '2013-01-09 23:51:04'),
(2528, 'Chinese Gospel Tract', 'Chinese Gospel Tract', 'A brief (and cool!) Gospel tract in Chinese. A conversation starter and witnessing tool for bringing the Gospel to the streets.', '1333597160Chinese Gospel Tract.pdf', 'http://apostolictoolbox.s3.amazonaws.com/wes_56/Chinese-Gospel-Tract-1333597160Chinese-Gospel-Tract.pdf', '456502', 134, 2, 'pdf', 21, 1, '', '', 1, 1, '2012-04-04 20:39:20', '2013-01-09 23:50:30'),
(2529, 'Eternal Judgment', 'Eternal Judgment', 'We have noted in our study of \"basic fundamentals of the Christian faith\" that the first three, namely. Repentance from dead works, faith toward God and the doctrine of baptisms, involve the experience of salvation. The fourth (laying on of hands) was demonstration and the last two are motivations. They are incentives to the Christian to serve the Lord. They are yet to come so we are propelled by the fact of the resurrection and \r\njudgment, to be prepared. It is a horrible thought that we should stand before the Lord unprepared.\r\n', '1333602381Eternal Judgment.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/Eternal-Judgment-1333602381Eternal-Judgment.docx', '17028', 0, 1, 'docx', 262, 1, '', '', 1, 1, '2012-04-04 22:06:21', '2013-01-09 23:50:08'),
