(2565, 'The Truth about Responsibility', 'truth about responsibility.docx', 'Responsibility is not a difficult concept to grasp, nor is irresponsibility. \r\n\r\nIrresponsibility is when I donâ€™t take responsibility for the things I am responsible for. \r\n\r\nAnd irresponsibility, a bit like greed and some other subtle sins, is almost impossible to see in the mirror. \r\n\r\nI can see it in other people quickly, but irresponsibility is almost impossible to see in myself, and it is all around us. \r\n\r\nI feel like in some ways our whole culture is becoming less and less responsibleâ€”that more and more, irresponsibility is almost celebrated. \r\n\r\nOur affluence as a culture has something to do with that. But there is also a strange confusion around the issue of love and our rights in our culture.\r\n', '1334583998truth about responsibility.docx', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Truth-about-Responsibility-1334583998truth-about-responsibility.docx', '27213', 0, 1, 'docx', 0, 1, '<iframe src=\"http://www.ustream.tv/embed/recorded/21853954\" width=\"480\" height=\"270\" scrolling=\"no\" frameborder=\"0\" style=\"border: 0px none transparent;\"></iframe>', 'iResponsible', 1, 1, '2012-04-16 06:46:38', NULL),
