(2607, 'The Bait Of Satan (Video)', 'The Bait Of Offense (Lesson 1)', 'Escape the enemy\'s deadly trap! The Bait of Satan exposes one of the most deceptive snares Satan uses to get believers out of the will of God-offense. Most people who are ensnared by the bait of Satan don\'t even realize it. Don\'t be fooled! You will encounter offense, and it\'s up to you how it will affect your relationship with God. Your response will determine your future. If offense is handled correctly, you will become stronger rather than bitter. In this lesson, John Bevere shows you how to stay free from offense and escape the victim mentality. You will find answers to tough questions like these: Why am I compelled to tell \"my side\" of the story? How can I fight thoughts of suspicion or distrust? What can I do to stop rehearsing past hurts? How can I regain trust after someone deeply offends me? This lesson will help you escape the enemy\'s \"offensive trap\" as well as empower you to stay free of offense, enabling you to have an unhindered relationship with God.', 'http://media.tabjoy.org/media2/BaitofSatan/L1.mp4', 'http://apostolictoolbox.s3.amazonaws.com/admin/The-Bait-Of-Satan-(Video)-L1.mp4', '108788059', 0, 1, 'mp4', 14, 2, '', '', 1, 1, '2012-04-24 03:42:30', '2012-05-08 00:22:11'),
