(2643, 'Driven by Eternity: Making Your Life Count Today & Forever (Video)', 'Hour I (Lesson 1)', 'Most people would be left destitute if they planned their futures as carelessly as they\'ve prepared for eternity. Drawing on the principles in 2 Corinthians 5:9-11, John Bevere reminds us that all believers will stand before God and receive what they have earned in life. In building their lives to be ready for that day, and maintaining an eternal frame of reference, readers will develop significant lives. In keeping sight of the goal, viewers will learn to labor for rewards that endurefor timeless eternity.', 'http://media.tabjoy.org/media2/Driven by Eternity/L1.mp4', '', '', 0, 1, 'mp4', 14, 2, '', '', 1, 0, '2012-04-24 21:45:33', '2012-04-24 22:12:11'),
