(2717, 'Becoming A Great Staff (Video)', 'Becoming A Great Staff', 'What makes a great staff . . . great? What causes people to look at your organization and think, â€œNow thereâ€™s a team that knows how to work togetherâ€? Whatâ€™s the secret to becoming a productive, relationally healthy organization? The answers to these questions are found in one simple habit that every leader and organization can embrace immediately.\r\n\r\nIn this DVD, Andy Stanley unpacks this powerful dynamic and explains how to build your organizationâ€™s culture around it. Using real-life examples, he uncovers several best practices (and several not-so-great practices) for becoming a great staff.\r\n\r\n', 'http://media.tabjoy.org/media2/Andy Stanley/Great Staff/512k-Complete Message.wmv', '', '', 0, 1, 'wmv', 22, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=NDEx\" frameborder=\"0\" allowfullscreen></iframe>', 'Becoming A Great Staff', 1, 0, '2012-04-25 00:27:07', '2012-04-25 00:36:18'),
(2718, 'Conversation With Andy Stanley (Video)', 'Conversation With Andy Stanley', '', 'http://media.tabjoy.org/media2/Andy Stanley/Great Staff/512k-Conversation With Andy Stanley.wmv', '', '', 0, 1, 'wmv', 22, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=NDEy\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Conversation With Andy Stanley', 1, 0, '2012-04-25 00:33:06', '2012-04-25 00:33:48'),
(2731, 'Drawing Near: A Life of Intimacy with God (Video)', 'Drawing Near (Lesson 4)', 'It\'s hard to want something you don\'t know you are missing. Sadly, many believers have never experienced true intimacy with God because they don\'t understand what it is or how to achieve it. But we humans were created for intimate fellowship with God, and this has always been His deepest desire. Scripture clearly states that the Lord yearns for us and seeks those who pursue Him. Yet we must come to Jesus on His terms-not our own.\r\n\r\nIn Drawing Near, John Bevere invites viewers to explore a life of intimacy with God. Emphasizing the need for obedience, he urges us to practice-just as we would practice anything we hope to improve-our communication with the Holy Spirit. Understanding that prayer is a dialogue, not a monologue, Bevere encourages us to listen at the Father\'s feet. ', 'http://media.tabjoy.org/media2/Drawing near/Lesson 4.mp4', '', '', 0, 1, 'mp4', 14, 2, '', '', 1, 0, '2012-04-25 01:15:05', NULL),
