(2975, 'Asperger\'s - Spirit Filled Christian', 'Fringe.pdf', 'Fringe: My Life as a Spirit-Filled Christian with Aspergerâ€™s Syndrome\r\nâ€œLet your light so shine before men, that they may see your good works, and glorify your Father which is in heaven.â€ Matthew 5:16 \r\nSo begins the journey for Stephanie Mayberry in \"Fringe: My Life as a Spirit-Filled Christian with Asperger\'s Syndrome.\"\r\nThis is a first person account of one woman\'s relationship with God as He allows her to break through the barriers of Asperger\'s Syndrome (a form of autism). Within these pages she will welcome you into her world and share with you not only a powerful witness to God\'s power and glory, but also precious insight into the \"Aspie\" mind.\r\nThough written with the intent of witnessing to others on the autism spectrum, \"Fringe\" has touched many lives of people, from families touched by autism to spouses with an Aspie partner to even those who have no contact with autism at all. There is something for everyone here.\r\n', '1335743085Fringe.pdf', 'http://apostolictoolbox.s3.amazonaws.com/stephanie/Asperger\'s---Spirit-Filled-Christian-1335743085Fringe.pdf', '480978', 59, 1, 'pdf', 242, 1, '', '', 1, 1, '2012-04-29 16:44:45', '2012-04-30 08:14:45'),
