(2988, 'Dating: Keys to Dating Smart (Video)', 'Dating: Keys to Dating Smart', 'Unless you have been living under a rock in this country, it is very obvious how highly sexualized our society has become. Everywhere the eye can look from TV, magazines, Internet, and movies, to advertising, billboards and even texting on cell phones, we are living in sex saturated society. The ramifications and consequences to our culture â€“ especially the youth â€“ has yet to play out entirely.\r\n\r\nWhat once was talked about in private and looked at or kept a secret, not to mention hard to get your hands on is how flowing freely into our homes and into the eyes, hearts and minds of our young people. What used to be considered perverse is now very normal and mainstream to many. Many people, teens as well as adults, have bought into this cultureâ€™s value system and the ideas the media feeds us regarding sex and relationships. It is important to know that the myths and misinformation out there will lead to poor decisions that can have grave â€“ life-threatening consequences.\r\n\r\nIf we equip our students with the right information we should see better results and spend less time trying to untangle the train wrecks that happen because people continue to make the wrong choices.', 'http://media.tabjoy.org/media2/MarkGungor/Teen/MP4/markgungoronteendating.mp4', 'http://apostolictoolbox.s3.amazonaws.com/admin/Dating:-Keys-to-Dating-Smart-(Video)-markgungoronteendating.mp4', '320878845', 0, 1, 'mp4', 17, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=MTQ5Ng==\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Dating: Keys to Dating Smart', 1, 1, '2012-05-02 01:44:27', '2012-05-02 01:45:08'),
(2989, 'Sex: The Truth No One is Telling You (Video)', 'Sex: The Truth No One is Telling You ', 'Unless you have been living under a rock in this country, it is very obvious how highly sexualized our society has become. Everywhere the eye can look from TV, magazines, Internet, and movies, to advertising, billboards and even texting on cell phones, we are living in sex saturated society. The ramifications and consequences to our culture â€“ especially the youth â€“ has yet to play out entirely.\r\n\r\nWhat once was talked about in private and looked at or kept a secret, not to mention hard to get your hands on is how flowing freely into our homes and into the eyes, hearts and minds of our young people. What used to be considered perverse is now very normal and mainstream to many. Many people, teens as well as adults, have bought into this cultureâ€™s value system and the ideas the media feeds us regarding sex and relationships. It is important to know that the myths and misinformation out there will lead to poor decisions that can have grave â€“ life-threatening consequences.\r\n\r\nIf we equip our students with the right information we should see better results and spend less time trying to untangle the train wrecks that happen because people continue to make the wrong choices.', 'http://media.tabjoy.org/media2/MarkGungor/Teen/MP4/mark gungor on teen and sex.mp4', '', '', 0, 1, 'mp4', 17, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=MTQ5Nw==\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Sex: The Truth No One is Telling You ', 1, 0, '2012-05-02 01:49:23', NULL),
(2990, 'Sex Still Has A Price Tag (Video)', 'Sex Still Has A Price Tag', 'Unless you have been living under a rock in this country, it is very obvious how highly sexualized our society has become. Everywhere the eye can look from TV, magazines, Internet, and movies, to advertising, billboards and even texting on cell phones, we are living in sex saturated society. The ramifications and consequences to our culture â€“ especially the youth â€“ has yet to play out entirely. What once was talked about in private and looked at or kept a secret, not to mention hard to get your hands on is how flowing freely into our homes and into the eyes, hearts and minds of our young people. What used to be considered perverse is now very normal and mainstream to many. Many people, teens as well as adults, have bought into this cultureâ€™s value system and the ideas the media feeds us regarding sex and relationships. It is important to know that the myths and misinformation out there will lead to poor decisions that can have grave â€“ life-threatening consequences. If we equip our students with the right information we should see better results and spend less time trying to untangle the train wrecks that happen because people continue to make the wrong choices.', 'http://media.tabjoy.org/media2/MarkGungor/Teen/MP4/issues on sex.mp4', '', '', 0, 1, 'mp4', 17, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=MTQ5OA==\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Sex Still Has A Price Tag', 1, 0, '2012-05-02 01:51:01', NULL),
