(3044, 'Breaking Intimidation (Video)', 'Lesson 1: Your Place of Authority', 'Countless Christians battle intimidation, which is camouflaged and subtle. Many feel the effectsâ€”depression, confusion, lack of faithâ€”without knowing its root. Bevere guides viewers below the surface to see the roots of intimidation. Viewers will understand why it is hard to say no, why the fear confrontation and avoid conflict, and why they focus on pleasing others. Viewers will learn to identify intimidation and know how to break its hold. Bevere explains how the fear of God keeps us from a life of ungodliness and produces confidence and boldness. Bevere advises, \"Walk in your own God-given confidence and boldness. Bevere advises, \"Walk in your own God-given authority, or someone else will take it from you and use it against you.\"', 'http://media.tabjoy.org/media2/Breaking Intimidation/MP4/1. Your Place of Authority.mp4', '', '', 0, 1, 'mp4', 14, 2, '<iframe width=\"740\" height=\"500\" src=\"http://apostolichub.com/hub/share-video.php?id=OTU4\" frameborder=\"0\" allowfullscreen></iframe>\r\n', 'Lesson 1: Your Place of Authority', 1, 0, '2012-05-03 22:48:25', '2012-05-04 02:55:18'),
