(3052, 'The Case For Faith (Video)', 'The Case For Faith', 'Was God telling the truth when he said, \'You will seek me and find me when you seek me with all your heart\'? Lee Strobel examines the claims of Christ, reaching the hard-won verdict that Jesus is God\'s unique son. In The Case for Faith, Strobel turns his skills to the most persistent emotional objections to belief---the eight \'heart barriers\' to faith. This session is for those who may be feeling attracted to Jesus but who are faced with difficult questions standing squarely in their path. For Christians, it will deepen their convictions and give them fresh confidence in discussing Christianity with even their most skeptical friends. ', 'http://media.tabjoy.org/media2/Lee Strobel/case for faith.mp4', '', '', 0, 1, 'mp4', 284, 2, '', '', 1, 0, '2012-05-03 23:13:04', '2012-05-03 23:13:27'),
