(3483, 'Attitude of Great Leaders', 'Attitudes of Great Leaders', 'Attitudes such as loyality, perseverance, respect for the needs of your leader, prayer, trust, commitment, discernment,and wisdom are what make great spiritual leaders. Such leaders are people of valor and acclaim.\r\n\r\nCan attitudes be changed or developed? I believe the answer is yes. Godâ€™s Word teaches us about the principle of putting off the old and putting on the new. Attitudes are developed by parents, teachers, reading, the environment, lifestyles and life experiences. All of these can be changed as we put off the old man and put on the new man, which is created by God. When we allow the Spirit of God to develop His fruit in our lives and natures, our attitudes profoundly change.\r\n\r\nThese fruit can be seen in the lives of godly leaders: â€œBut the fruit of the Spirit is love, joy, peace, longsuffering, kindness,\r\ngoodness, faithfulness, gentleness, self-control. Against such there is no lawâ€ (Gal. 5:22-23 NKJV).\r\n\r\nThe fruit of the Spirit form the attitudes of great leaders. They will enable you to become like one of Davidâ€™s\r\nmighty men.\r\n', '1345123684Attitudes_of_Great_Leaders.pdf', 'http://apostolictoolbox.s3.amazonaws.com/admin/Attitude-of-Great-Leaders-1345123684Attitudes_of_Great_Leaders.pdf', '391075', 0, 1, 'pdf', 239, 1, '', '', 1, 1, '2012-08-16 06:28:04', '2013-01-08 00:09:02'),
