(3522, 'Team Building in the Local Church', 'Team Building in the Local Church', 'Churches are more effective when team leaders share leadership responsibilities with a specified key leader. Quality contributions and better decisions emerge from this mutual commitment to collaborative analysis and team building. Teams release more creative thinking, problem solving, wise decision making and make room for more leaderâ€™s involvement.', '1348851611Team-Building-in-the-Local-Church.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Team-Building-in-the-Local-Church-1348851611Team-Building-in-the-Local-Church.doc', '3044864', 0, 1, 'doc', 303, 1, '', '', 1, 1, '2012-09-28 10:00:11', '2013-01-07 22:50:38'),
(3523, 'Forming and Leading Leadership Teams', 'Forming and Leading Leadership Teams', 'The forming and leading of the leadership team is a vitally important aspect to growing a healthy church. In this set of notes, we will define the team and also the lead person who forms the teams. Churches are more effective when team leaders share leadership responsibilities with a specified key leader.  Quality contributions and better decisions emerge from this mutual commitment to collaborative analysis and team building.  Teams release more creative thinking, problem solving, wise decision making and make room for more leaderâ€™s involvement.', '1348851975Forming and Leading Leadership Teams.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Forming-and-Leading-Leadership-Teams-1348851975Forming-and-Leading-Leadership-Teams.doc', '1929728', 0, 1, 'doc', 303, 1, '', '', 1, 1, '2012-09-28 10:06:15', '2013-01-07 22:49:51'),
(3524, 'Building a Team of Teams Culture', 'Building a Team of Teams Culture', 'The culture of team leadership is layered with the values, beliefs, and behaviors of the leaders who are building and implementing a leadership culture. The leadership style and philosophy of the key leader and leaders will shape the culture of how leadership is applied. The team of teams culture is built from the core principles and philosophy of leadership embraced by all the leaders. If team is not in the heart of the leaders, it will be very difficultâ€”if not impossibleâ€”to build team culture into the heart of the church.', '1348852413Building a Team of Teams Culture.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Building-a-Team-of-Teams-Culture-1348852413Building-a-Team-of-Teams-Culture.doc', '1372160', 0, 1, 'doc', 303, 1, '', '', 1, 1, '2012-09-28 10:13:33', '2013-01-07 22:47:52'),
(3525, 'Leaders of the Future', 'Leaders of the Future', 'We know for certain that leaders today must have a firm grasp on history, the present culture, and the future of the world. The leaders who will lead the church in ten, twenty, and fifty years from now will have to build on what we as leaders do today. The strategic environment changes around us rapidly and we as leaders must remain relevant to the now and to the future. We do not lead ourselves by our own wisdom and ability. WE are not like other organizations that are made and led by men and women of astounding intelligence. We are not limited to whomever is the greatest leader, the best cultural analyst, or the most accurate  forecaster. We have the almighty God helping us. We are connected to the head of the church and as He leads we follow. We are in His hands and the future is in His hands.', '1348853228Leaders of the Future.doc', 'http://apostolictoolbox.s3.amazonaws.com/admin/Leaders-of-the-Future-1348853228Leaders-of-the-Future.doc', '752640', 0, 1, 'doc', 303, 1, '', '', 1, 1, '2012-09-28 10:27:08', '2013-01-07 22:47:03'),
(3526, 'How to pray for unreached groups/nations', 'How to pray for unreached groups and nations', 'Interested in praying for the nations? This is a short brochure on how to pray for unreached groups around the world.', '1349060000How to pray for unreached groups and nations.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/How-to-pray-for-unreached-groups/nations-1349060000How-to-pray-for-unreached-groups-and-nations.pdf', '70299', 35, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-09-30 19:53:20', '2013-01-07 22:24:06'),
(3527, 'Learning to Pray for Unengaged Unreached People Groups (UUPGs)', 'Learning to Pray', 'Have you ever wanted to pray for the nations but have no idea where to start? This document is for you! It provides practical tips on how to getting your prayer engine running and your prayer closet going. ', '1349060146learningtopray.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/Learning-to-Pray-for-Unengaged-Unreached-People-Groups-(UUPGs)-1349060146learningtopray.pdf', '865056', 35, 0, 'pdf', 0, 1, '', '', 1, 1, '2012-09-30 19:55:46', '2013-01-07 22:23:28'),
