(3547, 'Nothing much, just an introduction - new membe', 'Mercy and Justice Pg1', 'I just registered for Apostolic Toolbox. As abiding by the understanding that I upload something, and desiring to download from you folks, I obediently upload two pdf\'s. They are two pages of one story, perhaps to serve as an introduction as you have no idea of who I am, but I hope to remain a nobody from nowhere still. My children don\'t know the entire story, but my wife did before we married. She was at A.B.I. with the Willoughby\'s long before we met. As you read these two pages I pray that Bishop Willoughby will rise and take off his shoes and be healed. I have no idea why I send this, but felt like I should so do. The only other person who read these pages was my pastor who asked me to speak briefly before the evangelist on this topic. I did not relate the story in church but made sure he knew it beforehand. He is 300 km away, as we have no church in our town, and he is a great pastor.', '1352836175Mercy and Justice pg1.pdf', 'http://apostolictoolbox.s3.amazonaws.com/siouxsigns/Nothing-much,-just-an-introduction---new-membe-1352836175Mercy-and-Justice-pg1.pdf', '44014', 315, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-11-13 11:49:35', '2013-01-07 22:18:42'),
