(3554, 'No Longer a Slumdog', 'No Longer a Slumdog', 'Dr. K.P. Yohannanâ€™s newest book, No Longer a Slumdog, unveils the true-life accounts of many of South Asiaâ€™s children, like Nadish. The message hits hard. He speaks of â€œwinds of changeâ€ and a powerful move of God.\r\n\r\nThe childrenâ€™s stories tell of going from a life of heartache and poverty to finding joy, laughter and a bright future. Despite the affliction these children face, Yohannan shows us thereâ€™s opportunity for change as many find new life in Godâ€˜s redeeming love.\r\n\r\nNo Longer a Slumdog inspires faith that a better tomorrow is truly possible.', '1353134676no-longer-a-slumdog.pdf', 'http://apostolictoolbox.s3.amazonaws.com/hulilin/No-Longer-a-Slumdog-1353134676no-longer-a-slumdog.pdf', '10549902', 70, 1, 'pdf', 0, 1, '', '', 1, 1, '2012-11-16 22:44:36', '2013-01-07 22:12:56'),
