(3576, 'Practical Christian Counselling', 'Practical Christian Counselling', 'Counselling is a highly idiosyncratic activity. From the mine of belief, reading and experience each counsellor must quarry that which will meet the needs of those who come for help.\r\n\r\nWhile text books and manuals abound, this contribution is not â€˜just anotherâ€™ one. Geoff Bingham takes his readers behind the scenes of actual practice to get down to fundamental assumptions, beliefs and attitudes. This is unusual, but helpful in showing how they lead to the style of counselling which follows.\r\n\r\nThere is a strongly didactic approach here, in contrast to the recently-popular but now passing â€˜non-directiveâ€™ fashion in counselling. There is a blending of head and heart with primary emphasis on Biblical wisdom and true love. Hence, counselling becomes the communication of foundational Biblical truths to be received and accepted. This transmission of truth depends on the counsellor having a full experience, as well as clear understanding of theological principles.\r\n\r\nThis is a radical approach to counselling in the true sense of radicalâ€”getting to the root of the matter.', '1359360059Practical Christian Counselling.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/Practical-Christian-Counselling-1359360059Practical-Christian-Counselling.pdf', '503771', 35, 1, 'pdf', 0, 1, '', '', 1, 1, '2013-01-28 00:00:59', '2013-01-28 23:47:57'),
(3577, 'Biblical Counselling Manual ', 'Biblical Counseling Manual', 'Accordingly, the purpose of this manual is to provide a basic approach, and the tools to establish a foundation to assist one to deal progressively with his own problems from a biblical perspective. And then to teach and counsel others to live by Godâ€™s commandments; thereby, fulfilling our Lordâ€™s directive to make disciples of all nations.', '1359360594Biblical Counseling Manual.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/Biblical-Counselling-Manual--1359360594Biblical-Counseling-Manual.pdf', '1399525', 35, 1, 'pdf', 310, 1, '', '', 1, 1, '2013-01-28 00:09:54', '2013-01-28 23:48:10'),
(3578, 'A Sustainable Population for a Dynamic Singapore: Population White Paper (Jan 2013)', 'Singapore Population White Paper (Jan 2013).pdf', 'Singapore\'s citizen population reached a turning point in\r\n2012, as our first cohort of Baby Boomers turned\r\n65. Singapore will experience an unprecedented\r\nage shift between now and 2030. Over 900,000\r\nBaby Boomers, more than a quarter of the current\r\ncitizen population, will enter their silver years.\r\nFrom 2020 onwards, the number of working-age\r\ncitizens will decline, as older Singaporeans retiring\r\noutnumber younger ones starting work. At our\r\ncurrent low birth rate, our citizen population will\r\nage rapidly, and also start declining from 2025, if\r\nwe do not take in any new immigrants.\r\n\r\nThis White Paper sets out the key considerations\r\nand roadmap for Singaporeâ€™s population policies\r\nto address this demographic challenge. It outlines\r\nthe Governmentâ€™s policies to maintain a strong\r\nSingaporean core in the population, regulate\r\nhow many new Singapore citizens (SCs) and\r\npermanent residents (PRs) we take in, create jobs\r\nand opportunities for Singaporeans, build a high\r\nquality living environment, as well as strengthen\r\nour identity and society.', '1359517930Singapore Population White Paper (Jan 2013).pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/A-Sustainable-Population-for-a-Dynamic-Singapore:-Population-White-Paper-(Jan-2013)-1359517930Singapore-Population-White-Paper-(Jan-2013).pdf', '283130', 35, 1, 'pdf', 0, 1, '', '', 1, 1, '2013-01-29 19:52:10', NULL),
