(3587, 'Doing Life Together Magazine', 'Doing Lifetogether Magazine.pdf', 'This is an easy-to-read yet comprehensive magazine containing resources for small groups. \r\n\r\nThere are many articles relating to creating, sustaining and growing small groups. \r\n\r\nThese articles include \"Small Group Health Assessment/Group Covenant\", \"Leadership Core\", \"Power of Recovery\", \"What Constitutes a Meeting\", \"Finances\", etc. ', '1361519667Doing Lifetogether Magazine.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/Doing-Life-Together-Magazine-1361519667Doing-Lifetogether-Magazine.pdf', '8120701', 35, 1, 'pdf', 0, 1, '', '', 1, 1, '2013-02-21 23:54:27', NULL),
(3588, 'No Longer a Slumdog ', 'no-longer-a-slumdog.pdf', 'No Longer a Slumdog demonstrates Godâ€™s tender mercy at its best! Itâ€™s a story of redemption, a celebration of lives transformed from despair to hope.\r\n\r\nBe captivated by Godâ€™s powerful love as K.P. Yohannan leads you on a journey through the slums and villages of South Asia and into the hearts and lives of these precious children\r\n\r\nDr. K.P. Yohannanâ€™s newest book, No Longer a Slumdog, unveils the true-life accounts of many of South Asiaâ€™s children, like Nadish. The message hits hard. He speaks of â€œwinds of changeâ€ and a powerful move of God.\r\n\r\nThe childrenâ€™s stories tell of going from a life of heartache and poverty to finding joy, laughter and a bright future. Despite the affliction these children face, Yohannan shows us thereâ€™s opportunity for change as many find new life in Godâ€˜s redeeming love.\r\n\r\nNo Longer a Slumdog inspires faith that a better tomorrow is truly possible.', '1361865882no-longer-a-slumdog.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/No-Longer-a-Slumdog--1361865882no-longer-a-slumdog.pdf', '10549902', 35, 1, 'pdf', 311, 1, '', '', 1, 1, '2013-02-26 00:04:42', '2013-02-26 00:11:44'),
