(3598, 'My Utmost for His Highest (Devotional)', 'My-utmost-for-his-highest (Devotional) Oswald-Chambers.pdf', 'Oswald Chambers was a Scottish minister and teacher whose teachings on the life of faith and abandonment to God have endured to this day. He was born in Scotland and spent much of his boyhood there. His ministry of teaching and preaching took him for a time to the United States and Japan. The last six years of his life were spent as principal of the Bible Training College in London, and as a chaplain to the British Commonwealth troops in Egypt during World War I. After his death, the books which bear his name were compiled by his wife from her own verbatim shorthand notes of his talks. This daily devotional is a collection of his teachings compiled by his wife into a daily devotional format. It\'s presented here in the original English.', '1366770822My-utmost-for-his-highest (Devotional) Oswald-Chambers.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/My-Utmost-for-His-Highest-(Devotional)-1366770822My-utmost-for-his-highest-(Devotional)-Oswald-Chambers.pdf', '1206801', 35, 1, 'pdf', 313, 1, '', '', 1, 1, '2013-04-23 19:33:42', NULL),
(3599, 'Developing a devotional habit', 'developing.pdf', 'A Christian is one who has a personal relationship with God. Itâ€™s not about how much doctrine you know or how well you obey Godâ€™s law. Itâ€™s all about how well you know and love the Lord Jesus Christ. This is the essence of developing a devotional habitâ€”itâ€™s all about a personal relationship with the living God. This is a short write-up on developing personal devotional times.', '1366771082developing.pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/Developing-a-devotional-habit-1366771082developing.pdf', '51601', 35, 1, 'pdf', 0, 1, '', '', 1, 1, '2013-04-23 19:38:02', NULL),
(3600, 'The Pilgrim\'s Progress', 'Pilgrims Progress (John Bunyan).pdf', 'Pilgrim\'s Progress is among the greatest literary masterpieces in the world. Few books so captivate attention while provoking insight into Christian character. It is an epic worthy of placement on any required reading list.\r\n\r\n\"Christian\" is a man on an adventurous journey across rough terrain, over sunlit hills, and through dark valleys. His trek is an intriguing allegory for today--mixed with the chivalric adventure of yesterday--as the pilgrimage takes us from the City of Destruction to the Celestial City whose builder and maker is God.', '1366771603Pilgrims Progress (John Bunyan).pdf', 'http://apostolictoolbox.s3.amazonaws.com/bryan.is/The-Pilgrim\'s-Progress-1366771603Pilgrims-Progress-(John-Bunyan).pdf', '1472957', 35, 1, 'pdf', 314, 1, '', '', 1, 1, '2013-04-23 19:46:43', NULL),
