(3678, 'Is Jesus in the Godhead or vice versa?', 'Is Jesus in the Godhead or vice versa?', 'Only from the Bible can we make any final decisions or come to any absolute conclusions as to\r\nany idea or questions we may have about the Word of God. This work has been put together with\r\na desire to give Jesus the glory for who He really is concerning His relationship with God.\r\nIs Jesus only part of a Deity or is Deity a part of Jesus? Is Jesus just merely a part of the Godhead\r\nor is the fullness of the Godhead fully found in Jesus? The answer to this question will only be\r\nrevealed to a prayerful and open heart that is reaching to understand Him in a greater way. These\r\nare questions asked by many today who are confused because of the many different religious\r\ngroups and denominations that there are. Let&#39;s look into the Word and see what the Bible says\r\nabout this extremely important subject. It is eternally important to know from a Biblical\r\nstandpoint who Jesus really is! Remember Jesusâ€™ words when He said, â€œ..except ye believe that I\r\nam He, you shall die in your sins.â€ We must know the answer to this question and have a firm\r\ngrasp on this truth!', '1420653349Is_Jesus_in_the_Godhead.pdf', 'http://apostolictoolbox.s3.amazonaws.com/sealfren/Is-Jesus-in-the-Godhead-or-vice-versa?-1420653349Is_Jesus_in_the_Godhead.pdf', '126805', 13, 1, 'pdf', 15, 1, '', '', 1, 1, '2015-01-07 09:55:49', '2016-02-23 09:42:13');
