INSERT INTO `atb_static_pages` (`id`, `page_heading`, `slug`, `meta_title`, `meta_content`, `meta_key`, `content`, `status`, `created_at`, `updated_at`, `archived_at`) VALUES
(1, 'Welcome to Apostolic Toolbox', 'welcome-to-apostolic-toolbox', 'Welcome to Apostolic Toolbox123', 'Home &quot;hola&quot;', 'Home,God,Apostolictoolbox,&quot;Webgrity&quot;', '<h1>Welcome to <em>Apostolic Toolbox!</em></h1>\r\n<p>...And remember the words of the Lord Jesus, that He said, <span class=\"blue\">\"it is more blessed to give than to receive\"</span></p>\r\n<p>Apostolic Toolbox is built upon on that very principle.</p>\r\n<p>It is a site dedicated to sharing and receiving various materials. Our goal is to share resources to aid the furtherance of the Kingdom of God.</p>\r\n<p>So we encourage you to share your Original Teachings, Sermons, Ideas and Designs through various formats such as Word, Powerpoint, Audio and Video files.</p>\r\n<p>We also believe in the principle that the harvest is always greater than the seed planted. So for every 1 file you upload, you are able to download 6 files in return from other fellow patrons!</p>\r\n<p class=\"blue\">\'The more you sow, the greater you reap\'</p>\r\n<p>We hope to also store and streamline valuable data by enabling you to access content and easily send files anywhere using the Web.</p>\r\n<p>With Apostolic Toolbox, we hope to improve productivity in your area of ministry.</p>', 1, '2016-07-19 18:51:21', '2016-11-07 16:05:17', '0000-00-00 00:00:00'),
(3, 'About Us', 'about-us', NULL, '', '', '<p>&nbsp;We are a passionate group of people who want to help host this site for church planters/pastors/leaders who might not have the necessary resources to equip.</p>\r\n<p>For more information, kindly contact us at <span style=\"color: #0000ff;\"><span style=\"text-decoration: underline;\">admin@apostolictoolbox.org</span>. </span></p>', 1, '2016-11-07 01:01:00', '2016-07-20 10:52:49', '0000-00-00 00:00:00'),
(4, 'Privacy Policy', 'privacy-policy', 'Privacy Policy', '', '', '<p>Apostolictoolbox is the official trademark of Tabernacle of Joy. Your use of www.apostolictoolbox.org site is governed by Apostolictoolbox Terms of Use and this Privacy Policy. The purpose of this Privacy Policy is to disclose what services we provide, how the information you store at the Apostolictoolbox may be used, and how such information is both protected and made available on our Web site.</p>\r\n<p>This privacy policy may change from time to time, so you are encouraged to check the page regularly. Tabernacle of Joy will operate this Web site according to the Privacy Policy that is posted at the time</p>\r\n<hr />\r\n<h3>Information we Receive when you Register</h3>\r\n<p>Tabernacle of Joy stores your E-mail and Password you create for yourself when you register with Apostolictoolbox and First and Last Names if they are indicated in User Profile. We also use your IP address for internal purposes (for covering the download limitation and user sessions).</p>\r\n<hr />\r\n<h3>Your Virtual Drive</h3>\r\n<p>When you upload your files to the Apostolictoolbox server, we will provide you with a unique URL to download your file. Apostolictoolbox will not provide this URL to any other person or entity, but will provide your file to any web browser requesting your unique URL. Apostolictoolbox has the right to review your file contents for violations of our Terms of Use. If Apostolictoolbox determines your files are in violation of Apostolictoolbox Terms of Use we will ban your account and will attempt to contact you. We reserve the right to cancel your account and files from our systems.</p>\r\n<p>Apostolictoolbox will not attempt to access your files at any time unless explicitly instructed to do so by you. We do not own the contents of your virtual drive. Apostolictoolbox will only have access to your files for purposes of troubleshooting. When Apostolictoolbox receives your files, we will store them in your virtual drive. We will allow your files to be downloaded according to your security settings. Apostolictoolbox has extensive security measures in place to protect your files while stored on our servers and we will prosecute any attempt to access this information without authorization.</p>\r\n<hr />\r\n<h3>Web-Server Log and Cookies</h3>\r\n<p>Tabernacle of Joy collects information about the areas and pages of the Apostolictoolbox website you visit. This information is collected in the form of the usual web server logs and cookies. Apostolictoolbox also collects this information to make the website viewable and useful for the majority of our clients.</p>\r\n<p>Our website utilizes a non-persistent cookie to track your session with our web site. This is an encrypted number, generated when you visit any site that supports sessions. This is a session cookie. It helps Apostolictoolbox track your sessions and store persistent information to make your visit to our site smoother. This cookie is saved permanently on your PC. This data does not contain any secure information (just an encrypted string). Additionally, we set a cookie when you log in to make further logging into our system a little easier. At no time are cookies used to track where you have been either before or after your visit to our website. No other website can access any information about you from the cookies we may store on your local computer. We do not share cookies or any other type of information with any other companies.</p>\r\n<hr />\r\n<h3>Access to your information</h3>\r\n<p>You have the right to access, upload and download your files and access and correct your personal information at any time. You may also grant access to your drive to other persons through folder sharing or providing the download link to your audience.</p>\r\n<p>If for some reason you cannot access your virtual drive on the Apostolictoolbox or you want to change other information you provided to us, please contact us atadmin@apostolictoolbox.org.</p>\r\n<hr />\r\n<h3>How we protect your information</h3>\r\n<p>Any information collected and processed with Tabernacle of Joy is treated with the utmost confidentiality. Tabernacle of Joy will not sell or rent out any personal information gathered from clients. We will make no public release of any personal information that is collected through our proprietary file sharing tool. All client-specific information gathered through Tabernacle of Joy will be the property of the user. To prevent unauthorized access or disclosure, to maintain data accuracy and to ensure the appropriate use of information, we have put into place physical, electronic and managerial procedures to safeguard the information that we collect online. We use encryption when collecting or transferring data.</p>\r\n<p>Automated and scheduled backups for premium users make the service considerably more reliable. Daily copying of the information will help you avoid any unpleasant consequences.</p>\r\n<p>On-site security includes closed circuit video monitoring, alarmed doors with secure card-key access, monitored 24x7.</p>\r\n<hr />\r\n<h3>E-mail non-disclosure</h3>\r\n<p>Our system stores your e-mail addresses on our server in a secured location. These e-mail addresses are kept on the server for granting access to the account. These addresses are yours, not the property of Apostolictoolbox.</p>\r\n<p>postolictoolbox Customer Support team may examine these lists as well as the account files for support and troubleshooting purposes. They also may examine the files stored by the users in case of abuse reporting.</p>\r\n<p>Apostolictoolbox will never use or sell these e-mail addresses and files to anyone; any attempt to access your e-mail addresses without your authorization will be prosecuted.</p>\r\n<p>We will only use your email to send the service and support letters. You may address the Apostolictoolbox Support Team with any questions and problems. We will make sure to process your request as soon as possible.</p>\r\n<hr />\r\n<h3>Anti SPAM Policy</h3>\r\n<p>The e-mail information we collect is never sold, rented out, leased, traded, swapped, marketed, exchanged, bartered, distributed, or disclosed in any way. Apostolictoolbox and its users agree to never initiate any SPAM emailing.</p>\r\n<hr />\r\n<h3>Third Party Web Sites</h3>\r\n<p>Apostolictoolbox website may contain links to Internet sites and services that are maintained by third parties. Those sites may have privacy and security policies that are different from those followed by Tabernacle of Joy. Tabernacle of Joy has no control over those sites and is not responsible or liable for the policies and practices followed by such third parties. When you visit any site outside www.apostolictoolbox.org this Privacy Policy is no longer valid, while the Privacy Policy of the current site you are visiting comes into force.</p>\r\n<hr />\r\n<h3>The Feedback Form</h3>\r\n<p>The Feedback Form is an online tool that allows you to report violations of Apostolictoolbox Services privacy statements and specific privacy concerns pertaining to apostolictoolbox.com.</p>\r\n<p>To access feedback form use the Feedback link at the top right of the screen of our web service.</p>\r\n<hr />\r\n<h3>Contact Us</h3>\r\n<p>If you have any questions or comments about our Privacy Policy, please contact us at admin@apostolictoolbox.org.</p>', 1, '2016-08-04 16:22:40', '2016-11-04 18:44:55', '0000-00-00 00:00:00'),
(5, 'Terms &amp; Conditions', 'terms-conditions', 'Terms &amp; Conditions', '', '', '<div class=\"tc_last_updated\">Last Updated: <strong>Dec 15, 2011</strong></div>\r\n<h3>Introduction</h3>\r\n<p>Welcome to the Apostolictoolbox free online file sharing service, which is operated by Tabernacle of Joy.</p>\r\n<p>Please read these terms of use carefully before using this Apostolictoolbox service.</p>\r\n<p>By using the Apostolictoolbox service, you, the User, signify your agreement to these terms of use. If you do not agree to these terms of use, you may not use the Apostolictoolbox service. We reserve the right, at our sole discretion, to change, modify, add, or delete portions of these terms of use at any time.</p>\r\n<p>Any such change, modification, addition, or deletion takes effect after five (5) calendar days following our posting of such notice on this web site.</p>\r\n<hr />\r\n<h3>House Rules</h3>\r\n<p>By using the Apostolictoolbox service, you agree not to do any of the following:</p>\r\n<ol>\r\n<li>Post, distribute, or otherwise make available or transmit any data, message, text, computer file, or other material that infringes any right of a third party and/or any domestic or international law, rule, or regulation, including but not limited to:\r\n<ul>\r\n<li>copyright, trademark, patent, or other proprietary rights;</li>\r\n<li>right of privacy or publicity;</li>\r\n<li>any confidentiality obligation.</li>\r\n</ul>\r\n</li>\r\n<li>Post, distribute, or otherwise make available or transmit any software or other computer files that contain a virus or other harmful component.</li>\r\n<li>Post, distribute, or otherwise make available or transmit any unwholesome and illegal materials.</li>\r\n<li>Publish or transmit any unlawful, harmful, threatening, abusive, harassing, defamatory, or racially or ethnically derogatory content, or any content expressing hate towards any person or groups of persons due to race, religion, colour, creed, national origin or sexual orientation.</li>\r\n</ol><hr />\r\n<h3>Acceptable Use</h3>\r\n<p>The Apostolictoolbox service provides accounts for storing only legal data. If you are reported to store copyrighted or illegal materials, your account will be deactivated and you will need to perform a bureaucracy procedure to have it activated again. Moreover, in case of breaking these rules, the owner of the copyright or other intellectual property rights will be informed and may call you to account for violating their rights.</p>\r\n<p>Though, Apostolictoolbox doesn\'t take the obligation to check the account contents, but we reserve the right, at our discretion, to audit any materials that are suspected in breaking the Apostolictoolbox terms of use, remove content, disable or remove the accounts of users who infringe the intellectual property rights of others or may expose Apostolictoolbox to civil or criminal liability.</p>\r\n<p>Apostolictoolbox declines all responsibility for the contents of the materials stored by Apostolictoolbox users. Each and every user of Apostolictoolbox is solely responsible for all materials uploaded to his account.</p>\r\n<p>Please, do not store unwholesome and other forbidden materials! The confirmed infringer will be reported to the appropriate legal authority. If you do not want to have big troubles you should not upload any kind of illegal materials. The identification won\'t be difficult - your ISP will be informed as well. Most ISPs apply a penalty actions to the clients that break their agreement by delivering unwholesome materials etc. So it is for sure you will get a serious punishment.</p>\r\n<p>You acknowledge that the Apostolictoolbox Service may contain features enabling users to transmit various types of communications to other Users, and further acknowledge and agree that you shall not use neither the Apostolictoolbox Service nor any links to shared files or folders on Apostolictoolbox to engage in spamming and junk mail. So if your campaigns receive an unreasonable amount of spam/abuse complaints, we reserve the right to shut down your account.</p>\r\n<hr />\r\n<h3>Disclaimer</h3>\r\n<p>All services in the Apostolictoolbox site are provided \"As is\" and without warranties of any kind. We disclaim all warranties, whether express or implied, including the warranties that the site and content are free of defects, virus free, and able to operate on an uninterrupted basis, that they will meet your requirements, or that errors will be corrected, and the implied warranties that the site and content are merchantable, of satisfactory quality, accurate, fit for a particular purpose or need, or non-infringing, unless such implied warranties are legally incapable of exclusion. Your use of Apostolictoolbox is solely at your own risk.</p>\r\n<p>We are not responsible for any losses or damages that may have caused by using Apostolictoolbox services.</p>\r\n<p>We reserve the rights to remove or replace any uploaded files that are unlawful, that may compromise the security of the servers, that are using excessive bandwidth, or when deemed necessary without prior notice.</p>\r\n<hr />\r\n<h3>Links to Third-Party Sites</h3>\r\n<p>The Apostolictoolbox site may contain links to third-party web sites. Those sites are independently managed and maintained by such third-party companies or individuals. We do not control those linked sites.</p>\r\n<hr />\r\n<h3>Contacts</h3>\r\n<p>For help with the Apostolictoolbox services, send message to admin@apostolictoolbox.org.<br /><br /> Thank you.</p>', 1, '2016-08-04 16:42:44', '2016-11-04 18:05:33', '0000-00-00 00:00:00'),
(6, 'Help', 'help', 'Help', 'Help', 'Help', '<h3>General questions</h3>\r\n<p><strong>Q. Why do you need to sign up?</strong></p>\r\n<p>We require a registration to create your account and set up your virtual drive, allowing you access to your files from any PC connected to the Internet, just by entering your email and password. Your files are kept safe within your account and there is no need to remember long links to your files. You need to be registered user in order to upload/download files. Registration is free, simple, and takes seconds to complete. There is no need to enter your credit card details.</p>\r\n<p><strong>Q. Where are the files stored?</strong></p>\r\n<p>The files you upload are hosted on our high-speed servers. Your individual virtual drive is set up for you when you register.</p>\r\n<p><strong>Q. How long the files are stored?</strong></p>\r\n<p>There is no expiration period for the files.</p>\r\n<p><strong>Q. How to cancel your account?</strong></p>\r\n<p>In case you would like to have the account cancelled immediately, please contact the Apostolictoolbox Support Team.</p>\r\n<hr />\r\n<h3>Managing your account</h3>\r\n<p><strong>Q. How to sign in?</strong></p>\r\n<p>To log into your Apostolictoolbox account, you can access it at the Main page by clicking on the &lsquo;Login&rsquo; tab. You\'ll get a login window after that. Type your e-mail and password, after which, click on &lsquo;Login to Apostolic Toolbox&rsquo; to access your account.</p>\r\n<p><strong>Q. How to sign out?</strong></p>\r\n<p>If you\'d like to be able to sign out anytime you are surfing the site, please take a look at the top side of each download page where there is an appropriate \'Logout\' option.</p>\r\n<p><strong>Q. How to change your Account Information?</strong></p>\r\n<p>Please access the &lsquo;My Account&rsquo; option, upon which you edit necessary details accordingly.</p>\r\n<p><strong>Q. How to change your e-mail?</strong></p>\r\n<p>Please contact the Apostolictoolbox Support Team concerning the issue.</p>\r\n<p><strong>Q. If you forgot your password?</strong></p>\r\n<p>If you forgot your password, please use the &lsquo;Forgot your password&rsquo; option found under the &lsquo;Login&rsquo; tab that will allow you to set the new password for your account. You will be prompted to enter in your registered email address so that a new password will be sent via e-mail with the instructions.</p>\r\n<hr />\r\n<h3>Search</h3>\r\n<p><strong>Q. How to search for a file?</strong></p>\r\n<p>Once you are logged into your account, click on the word \'Search\' tab on the toolbar. You will automatically be taken to the search system where you can easily download any file you need.</p>\r\n<p><strong>Q. How to search for one word or a part of the word?</strong></p>\r\n<p>You can insert a part of a phrase or a part of a word from the file title. Our system will show you all possible combinations with these letters.</p>\r\n<p><strong>Q. What files are shown in search results?</strong></p>\r\n<p>All shared files with proper settings are shown in search results.</p>\r\n<p><strong>Q. Why can&rsquo;t you find the files in search results?</strong></p>\r\n<p>Our system does not include files into the search service results if their names include certain words which might indicate illegal use of Apostolictoolbox. Our automatic filter prevents some files from being displayed in search service results even if the files are not illegal at all. Most probably the file(s) name(s) include words which are forbidden with our service since many files which have these words in their name break our Terms &amp; Condition or were reported as copyright infringements.</p>\r\n<hr />\r\n<h3>Managing files</h3>\r\n<p>Once you find the desirable file, simply click on the file in the list of files under &lsquo;My Files\' to view its download link. By clicking the \'Download\' button found at the files info page, you will be able to open it in your Internet browser.</p>\r\n<p><strong>Q. Why no download link appears?</strong></p>\r\n<p>If the download link doesn\'t appear it can mean that your browser does not allow javascript execution. Secondly your firewall may not allow files to be downloaded from certain web sites or even cancels all incoming files, so please check your firewall settings. For that matter please make sure you don\'t have any specific add-ons installed on your browser (e.g. NoScript in Firefox) which may interfere with the download.</p>\r\n<p><strong>Q. How to upload? </strong></p>\r\n<p>To upload a file to your virtual drive, please log into your account and use the \'Upload files\' tab found at the left of your account screen. Click the \'browse\' button and select the files you need from your computer and by clicking on the &lsquo;Add More files&rsquo; option, you will be able to upload more files accordingly. Once completed, press \'Upload\' after that. The file(s) will then be uploaded upon Admin approval.</p>\r\n<p><strong>Q. How to change the description of a file?</strong></p>\r\n<p>You can access it through the &lsquo;My Files&rsquo; tab and click on \'Edit\' button to edit the file description in the \'Description\' field at the bottom of the page. To save this change, click on the \'Update\' button. Your new file description can be seen on the download page of the file.</p>\r\n<p><strong>Q. How to delete a file?</strong></p>\r\n<p>Please log into your account and access it through the &lsquo;My Files&rsquo; tab to get to the file info page. You then can delete accordingly by clicking on the \'Delete\' button found.</p>\r\n<p><strong>Q. What happens with the files after deletion?</strong></p>\r\n<p>The files are deleted automatically without further restoring.</p>\r\n<p><strong>Q. Number of files that may be uploaded/downloaded per user?</strong></p>\r\n<p>For every 1 upload, you are able to download 4 files.</p>\r\n<p><strong>Q. Max size of the files to upload? </strong></p>\r\n<p>There are no restrictions on the amount of data that can be transferred.</p>\r\n<p><strong>Q. What files can be uploaded, stored and shared?</strong></p>\r\n<p>You can upload any files that meet our Terms &amp; Conditions, i.e. you cannot share illegal, unwholesome, copyrighted materials, etc. Here are the types of files that may be shared: FLV, WMV, MP4, M4V, MP3, DOCX, PPTX, PDF, PPT, PSD, DOC, JPG, PNG, and GIF</p>\r\n<hr />\r\n<h3>Sharing files</h3>\r\n<p><strong>Q. How to share files with other users?</strong></p>\r\n<p>Your files can be shared with only registered users. As soon as you upload your files on Apostolictoolbox you will be able to share your file with others using an access link.</p>\r\n<p><strong>Q. How to email a sharing link to the file?</strong></p>\r\n<p>You can email sharing links to only registered users. Firstly, you should click on the \'View\' button to access the file info page. Fill in the \'Message to recipient (optional)\' field and type the text of the message if needed. Click on the \'Submit\' button in the bottom corner to send your email.</p>\r\n<hr />\r\n<h3>Policy of the site</h3>\r\n<p><strong>Service abuse</strong></p>\r\n<p>If you receive an e-mail with a subject \'Service abuse\' it means that some of your files contain unlicensed copies of some works, or are engaged in other unauthorized activities relating to copyrighted works. You need to delete such files from your account as soon as you get such a notification.</p>\r\n<p><strong>Files containing viruses</strong></p>\r\n<p>If you are distributing or transmitting any software or other computer files that contain a virus or other harmful component, your account will be banned without further reactivation.</p>\r\n<p><strong>Abusive files</strong></p>\r\n<p>All unwholesome material is marked as adult content and access to this material is restricted. We ban accounts which are created to distribute unwholesome or other illegal material.</p>\r\n<p><strong>Copyright violation </strong></p>\r\n<p>All accounts which violate someone\'s copyright will be deactivated.</p>\r\n<p><strong>Contact Us </strong></p>\r\n<p>For any questions, please contact us at admin@apostolictoolbox.org.</p>', 1, '2016-08-04 17:09:47', '2016-09-24 12:25:42', '0000-00-00 00:00:00'),
(7, 'Tutorials', 'tutorials', 'Tutorials123', 'Tutorialsxyz descrip', 'Tutorialsxyz', '<h1>Here are some tutorials.</h1>\r\n<h2>How do I sign up?</h2>\r\n<p><iframe src=\"http://www.youtube.com/embed/ZT0gjPl_roQ\" width=\"420\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h2>How do I use the website features?</h2>\r\n<p><iframe src=\"http://www.youtube.com/embed/lrMBewMbIHw\" width=\"420\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>', 1, '2016-08-04 17:15:57', '2016-09-24 12:26:37', '0000-00-00 00:00:00'),
