(1, 'Ultimate TJ', 0, 1, '\r\nDear #user_name#,\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nWelcome!\r\n\r\n\r\n\r\nYou have succesfully registered at Apostolic Toolbox\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nYou can login to the site at http://www.apostolictoolbox.org/\r\n\r\n\r\n\r\nYour login information is given below:\r\n\r\n\r\n\r\nUsername: #username#\r\n\r\nPassword: #password#\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nThis is a site dedicated to sharing and receiving various materials. Our goal is to share resources to aid the furtherance of the Kingdom of God. You can share your Original Teachings, Sermons, Ideas and Designs through various formats such as Word, Powerpoint, Audio and Video files.\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nBecause of your involvement in ministry, we have given you an \"Inner group\" account. (Please do not share this account with anyone, this is solely for you.)\r\n\r\n\r\n\r\nThis means you are entitled to unlimited downloads as well as Pastor\'s collection of books.\r\n\r\n\r\n\r\nEvery file that you upload will then be vetted before it becomes \"Live\" for people to download.\r\n\r\n\r\n\r\nWe hope to also store and streamline valuable data by enabling you to access content and easily send files anywhere using the Web. With Apostolic Toolbox, we hope to improve productivity in your area of ministry.\r\n\r\n\r\n\r\nPlease click here for video tutorials to learn how to use the aposotolic toolbox.\r\n\r\n\r\n\r\nBy using the Apostolictoolbox service, you, the User, signify your agreement to the Terms & Conditions. If you do not agree to these Terms & Conditions, you may not use the Apostolictoolbox service. We reserve the right, at our sole discretion, to change, modify, add, or delete portions of these Terms & Conditions at any time.\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nPlease do not reply to this email as this is a computer-generated response.\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n', 1, '2016-11-03 13:01:31', '2016-11-03 13:01:31', '0000-00-00 00:00:00'),
